INSERT INTO `games` (`id`, `title`, `slug`, `short_description`, `image`, `original_image`, `mimes`, `description`, `position`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Valorant', 'valorant', 'Free to play multiplayer tactical first person shooter.', '318620227_game_valorant.png', 'valorant.png', 'png', '<p>Valorant is a free-to-play multiplayer tactical first-person shooter developed and published by Riot Games, for Microsoft Windows. First teased under the codename Project A in October 2019, the game began a closed beta period with limited access on April 7, 2020, followed by official release on June 2, 2020.</p>', 4, 1, '2020-10-15 23:20:36', '2022-04-30 03:13:44', NULL),
(2, 'Fortnite', 'fortnite', 'An online game developed by Epic Games.', '84938016_game_fortnite.png', 'fortnite.png', 'png', '<p>Fortnite is an online video game developed by Epic Games and released in 2017. It is available in three distinct game mode versions that otherwise share the same general gameplay and game engine.</p>', 1, 1, '2020-10-15 23:23:16', '2022-04-30 03:13:28', NULL),
(3, 'CSGO', 'csgo', 'Multiplayer game with first-person shooter, by Valve.', '2014355586_game_CSGO.png', 'CSGO.png', 'png', '<p>Counter-Strike: Global Offensive is a multiplayer first-person shooter video game developed by Valve and Hidden Path Entertainment. It is the fourth game in the Counter-Strike series and was released for Windows, OS X, Xbox 360, and PlayStation 3 in August 2012, while the Linux version was released in 2014.</p>', 5, 1, '2020-10-15 23:24:50', '2022-04-30 03:13:38', NULL),
(4, 'Dota 2', 'dota-2', 'Multiplayer online battle arena video game, by Valve.', '234899010_game_dota2.jpg', 'dota2.jpg', 'jpg', '<p>Dota 2 is a multiplayer online battle arena video game developed and published by Valve. The game is a sequel to Defense of the Ancients, which was a community-created mod for Blizzard Entertainment&#39;s Warcraft III: Reign of Chaos and its expansion pack, The Frozen Throne.</p>', 5, 1, '2020-10-15 23:26:12', '2021-01-07 15:19:08', '2021-01-07 15:19:08'),
(5, 'League of Legends', 'league-of-legends', 'Multiplayer games online at the arena, by Riot Games.', '1444590525_game_league.ong.png', 'league.ong.png', 'png', '<p>League of Legends is a 2009 multiplayer online battle arena video game developed and published by Riot Games for Microsoft Windows and macOS. Originally inspired by Defense of the Ancients, the game has followed a freemium model since its release on October 27, 2009.</p>', 4, 1, '2020-10-15 23:27:20', '2022-04-29 05:10:03', NULL),
(6, 'Valheim', 'overwatch', 'Upcoming survival game by the Swedish developer IGS.', '1127436163_game_!valheim.png', '!valheim.png', 'png', '<p>Valheim is an upcoming video game for survival and sandbox by the Swedish developer Iron Gate Studio. Published by Coffee Stain Studios.</p>', 4, 1, '2020-10-15 23:28:28', '2022-04-29 05:09:27', NULL),
(7, 'COD: Black Ops Cold War', 'cod-mobile', '2020 first-person shooter video game developed by Treyarch.', '1126519582_game_codcw.png', 'codcw.png', 'png', '<p>Call of Duty: Black Ops Cold War is a 2020 first-person shooter video game developed by Treyarch and Raven Software and published by Activision. It is the sixth installment in the Black Ops series, and the seventeenth installment in the overall Call of Duty series.</p>', 2, 1, '2020-11-23 09:07:07', '2022-04-29 05:08:57', NULL),
(8, 'Clash of Clans', 'team-fortress-2', 'Freemium mobile strategy video game developed by Supercell', '790432990_game_!clash.png', '!clash.png', 'png', '<p>Clash of Clans is a freemium mobile strategy video game developed and published by the Finnish game developer Supercell.</p>', 6, 1, '2020-11-23 09:11:15', '2022-04-29 05:08:31', NULL),
(9, 'Rocket League', 'rocket-league', 'Rocket League is a vehicle game for football from Psyonix.', '1733093333_game_rleague.png', 'rleague.png', 'png', '<p>Rocket League is a vehicular soccer video game developed and published by Psyonix. The game was first released for Microsoft Windows and PlayStation 4 in July 2015, with ports for Xbox One and Nintendo Switch being released later on, and a graphics update for Xbox Series X/S in 2020.&nbsp;</p>', 3, 1, '2021-01-07 15:18:42', '2022-04-29 05:07:19', NULL),
(10, 'Clash of Clans', 'clash-of-clans', 'Clash of Clans', '324507705_game_clashofclans.jpg', 'clashofclans.jpg', 'jpg', '<p>Clash of Clans is a freemium mobile strategy video game developed and published by&nbsp;Supercell.</p>', 0, 1, '2021-03-04 15:14:13', '2021-03-04 15:14:42', '2021-03-04 15:14:42'),
(11, 'NBA 2K21', 'nba-2k21', 'NBA 2K21 is a basketball video game made by Visual Concepts.', '1506890965_game_!nba.png', '!nba.png', 'png', '<p>NBA 2K21 is a basketball game simulation game developed by Visual Concepts and published by 2K Sports, based on the National Basketball Association. It is the 22nd part of the NBA 2K series and the successor to the NBA 2K20.</p>', 10, 1, '2021-03-31 03:56:45', '2022-04-29 05:07:56', NULL),
(12, 'Caliber', 'caliber', 'Fast and exciting firefights in PvP and PvE modes.', '1038317073_game_!caliber.png', '!caliber.png', 'png', '<p>Caliber is a game that is free to play for real special forces. Fast and exciting firefights in PvP and PvE modes, lots of ways to play your part in combat, operator adaptation and growth.</p>', 9, 1, '2021-06-23 13:49:57', '2022-04-29 04:55:03', NULL);
