(5, 2, 2, 'end rotation', 'endgame-rotation', 'Learn to rotate close to the playoffs in Fortnite!', 'https://www.youtube.com/embed/VvmQBAK9paQ', '1434839461_game_guide_!ss.png', '!ss.png', 'png', '<p>In this Fortnite Esports guide, you will learn how to effectively rotate to the next zone in Battle Royale Endgame.</p>\r\n\r\n<p>This video contains expert Fortnite players and coaches from EsportsGuides: Simsimsom.</p>', 1, NULL, 'Videoguide|Coach Simsimsom', '2020-11-23 07:58:12', '2022-10-13 10:10:25', NULL),
(6, 2, 2, 'double editions', 'double-edits', 'Aprende a editar dos veces en Fortnite!', 'https://www.youtube.com/embed/BQgLiP9LPOk', '1914740798_game_guide_!ss.png', '!ss.png', 'png', '<p>In this guide of Fortnite Esports, you will learn how to duplicate the edition in the effective way.</p>\r\n\r\n<p>This video presents the expert player of Fortnite and trainer of EsportsGuides: Simsimsom.</p>', 1, NULL, 'Video guide|Trainer Simsimsom', '2020-11-23 07:59:16', '2022-10-13 10:07:51', NULL),
(7, 2, 2, 'Fortnite 90\'s', 'fortnite-90s', '¡Aprende a realizar los 90 en Fortnite!', 'https://www.youtube.com/embed/0x31Ks1_dnk', '2052663836_game_guide_!ss.png', '!ss.png', 'png', '<p>En esta Gu&iacute;a de Fortnite Esports aprender&aacute;s a realizar los 90&#39;s de manera efectiva..</p>\r\n\r\n<p>Este video presenta al jugador experto de Fortnite y entrenador de EsportsGuides: Simsimsom.</p>', 1, NULL, 'Videoguía|Entrenador Simsimsom', '2020-11-23 08:00:32', '2022-10-13 09:57:11', NULL),
(8, 6, 1, 'The importance of Pressuring', 'pressuring-ability-use', 'Learn the importance of pressure within Overwatch.', '', '1200099592_game_guide_ow1.jpg', 'ow1.jpg', 'jpg', '<h3>WHAT DOES PRESSURING&nbsp;THE ENEMY MEAN?</h3>\r\n\r\n<p>Pressuring the enemy is a precise job. You are not aiming to kill, although it often results in that. Your goal is to weaken a specific branch of theirs and enable your team to win the teamfight that follows. Pressuring your enemy takes shape in several different types of pressure that this guide will cover below:</p>\r\n\r\n<h3>PRESSURING ENEMY SHIELDS</h3>\r\n\r\n<p><img alt=\"Reinhardt Team\" src=\"https://images.ctfassets.net/et9p1kivitqh/4uLl86CdniDyHr3Ut2IcAq/a50a33c8111ad6a84142bc1f68db842c/Reinhardt_Overwatch_006.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Reinhardt Team\" /></p>\r\n\r\n<p>This is the default type of pressure.. Your aim is to destroy the enemy shields before they destroy yours.</p>\r\n\r\n<p>The two teams face off with tanks at the front and damage dealers and supports behind them. Attackers push and the defenders hold. To gain or hold space and complete your objective you need to eliminate your enemies or force them to retreat.</p>\r\n\r\n<p>The most straightforward way to do that is by brute-forcing your way at them. Focusing the enemy shields allows your tanks to play more aggressively under the shields&#39; protection while your enemies are forced to retreat having no front line of defense apart from their own bodies.</p>\r\n\r\n<p>Whenever you are unsure of what to do just stay with your team and damage the enemy shields.</p>\r\n\r\n<h3>PRESSURING THE BACKLINE</h3>\r\n\r\n<p><img alt=\"One trick Ana\" src=\"https://images.ctfassets.net/et9p1kivitqh/6iNKbiPKwfxjes4avjKQPs/fc0fc62f4bed3265fae7ad97e54f39fc/Screenshot_10.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"One trick Ana\" /></p>\r\n\r\n<p>There are two aspects to that which form the two main goals you are trying to accomplish. The first aspect is putting pressure on the enemy supports and the second one is putting pressure on the enemy damage dealers.</p>\r\n\r\n<p>Putting pressure on the enemy supports distracts them and makes them unable to heal their teammates. This allows your team to win an engagement off of the superior sustainability you have due to actually having supports healing them. Most supports also bring a lot of utility and defensive ultimates to the table.</p>\r\n\r\n<p>When facing off against an enemy damage dealer you are shifting their attention from your team&#39;s shields or from your supports. This alleviates the burden and helps your team stabilize or advance forward without worry.</p>\r\n\r\n<p>You are essentially healing your team by preventing them from being damaged or killed by distracting the enemy to focus you.</p>\r\n\r\n<p>&nbsp;</p>', 1, NULL, 'Text Guide', '2020-11-23 08:16:00', '2021-03-18 06:20:02', '2021-03-18 06:20:02'),
(9, 6, 2, 'Overwatch Tank Guide', 'tank-ult-tips', 'Improve your tank gameplay in Overwatch!', '', '1275004284_game_guide_maxresdefault (5).jpg', 'maxresdefault (5).jpg', 'jpg', '<h2>Which Tank To Pick</h2>\r\n\r\n<p>Not every tank will do as good in every composition or pairing with a second tank. This is what we&#39;re going to teach you in this guide. Let&rsquo;s proceed with some tank tips!<br />\r\n&nbsp;</p>\r\n\r\n<h2>Use Covers More</h2>\r\n\r\n<p>You cannot solely rely on shields, they can easily be broken. Just because you&rsquo;re a tank, doesn&rsquo;t mean you don&rsquo;t need to use the walls, covers and so on.<br />\r\n&nbsp;</p>\r\n\r\n<h2>Tanks To Carry With In Low Skill Rating</h2>\r\n\r\n<p>The best tanks to carry in low skill ratings are Roadhog and Wrecking Ball.<br />\r\n<br />\r\nThe reasoning behind this is that they have a huge solo impact, they can pick off and disrupt with ease, while not needing so much support from the team. This is mainly for Bronze to Platinum range.<br />\r\n<br />\r\nLike you probably know, in low skill rating games you need to carry solo harder than ever due to inexperienced teams on both sides and no possibility to rely on a good team and communication. You need to take things in your own hands.<br />\r\n<br />\r\nIf you don&rsquo;t play Hog or Hamster,&nbsp;Zarya,&nbsp;Sigma&nbsp;and Winston can also have an immense solo impact in low SR games. However, you need to learn how to play them properly - the more tanks you know how to play, the more weaknesses and different situations you&rsquo;ll be able to cover.<br />\r\n<br />\r\nIf you are a one-trick&nbsp;Reinhardt&nbsp;or Winston or whatever else, you won&rsquo;t get far with your Skill Rating even though you&rsquo;re comfortable with them and highly skilled. Imagine being grouped up with a tank that plays just the ones like you are or similar heroes with similar strengths.<br />\r\n<br />\r\nLet&rsquo;s move on to specific tank tips.<br />\r\n&nbsp;</p>\r\n\r\n<h3>Zarya</h3>\r\n\r\n<p>Space and someone to help you create it, and two, high energy charge. In order to do that effectively, you need to pair up with a tank that allows you to get it.<br />\r\n<br />\r\nIf your second tank is someone like Orisa, that won&rsquo;t end up well, she won&rsquo;t want to soak the damage and build your ult while someone like Reinhardt, that is much more suitable and Zarya will shine. This is an example of pairing yourself properly with a viable second tank.<br />\r\n&nbsp;</p>\r\n\r\n<h3>Roadhog</h3>\r\n\r\n<p>He doesn&rsquo;t need that much support from the team and he can go his own way most of the time.<br />\r\n<br />\r\nHe is an ideal pick if the second tank in your team isn&rsquo;t that good, won&rsquo;t work with you or communicate. Roadhog is then ideal because he doesn&rsquo;t need that much synergy with the second tank or the team.<br />\r\n&nbsp;</p>\r\n\r\n<h3>Reinhardt and Orisa - Main Tanks</h3>\r\n\r\n<p>A lot of people complain that off tanks such as Zarya and Hog have more impact than the main tanks. I do understand what you mean and it truly does feel like that sometimes.<br />\r\n<br />\r\nHowever, if you&rsquo;re playing a main tank, the most important thing to do is taking space aggressively - and I mean it. Push and take that space, don&rsquo;t feed but dance on that line between feeding and being a strong aggressive tank.<br />\r\n<br />\r\nWith time and practice, you will learn how to dance on that line even more beautiful. You will learn when to push, how hard to push, when to pull back and so on. If you feel like you&rsquo;re doing less than on off-tank. Remember that off tanks wouldn&rsquo;t exist if there was no - main tank. Main tanks are the staple of composition and no one else could do anything if it weren&rsquo;t for you.<br />\r\n<br />\r\nThis is one of the reasons why you need to expand your Overwatch tank pool. If you only play off tanks, you won&rsquo;t be able to fill the gap if nobody wants to main tank and vice versa. I and my other colleague tanks that work in the&nbsp;Overwatch<a href=\"https://www.boostingfactory.com/overwatch\"> </a>boosting&nbsp;business know this, and their roster is big enough to cover main and off tanks.<br />\r\n&nbsp;</p>\r\n\r\n<h3>D.Va</h3>\r\n\r\n<p>As D.Va your primary goal should be to counter high ground hitscan and projectile heroes, such as&nbsp;Hanzo, McCree, and Soldier:76. The second thing you can do is eat Orisa pulls and Moira orbs.<br />\r\n<br />\r\nHowever, if the enemy team picks heroes like Doomfist, Mei or&nbsp;Brigitte, then your strengths are now not needed and picking D.Va is not a good choice. You need something that&rsquo;s better in frontline fighting such as Rein or Zarya. A tank that is good versus the enemy composition.<br />\r\n<br />\r\nIt&rsquo;s not important what your team thinks, YOU after reading this guide should know which tank to pick in which situation and stick to that. However, it&rsquo;s implied that you have enough hours on that hero and you can play him sufficiently well. Let&rsquo;s talk about that a bit.</p>', 1, NULL, 'Video Guide', '2020-11-23 08:17:47', '2021-03-18 06:19:59', '2021-03-18 06:19:59'),
(10, 6, 2, 'Ultimate Beginner Guide', '8-heroes-secretly-broken', 'New to Overwatch? Improve your gameplay with our Ultimate Beginners Guide.', '', '1088799847_game_guide_maxresdefault (4).jpg', 'maxresdefault (4).jpg', 'jpg', '<h1>The Ultimate Overwatch Beginners Guide</h1>\r\n\r\n<p>The point of this guide isn&rsquo;t to explain everything in a huge amount of&nbsp;detail but to give you a better understanding of what&rsquo;s important and why. By having a solid foundation, you&rsquo;ll be able to further research and analyze the game on your own and, with time, master all of its many layers of mechanics.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Overwatch In a Nutshell</strong></h2>\r\n\r\n<p>Overwatch is a combination of an FPS (First Person Shooter) and a MOBA (Multiplayer Online Battle Arena). This means you&rsquo;ll play fascinating heroes from a first-person perspective who don&rsquo;t &ldquo;just&rdquo; shoot or throw out missiles of some kind. Each hero has a set of abilities &mdash; the first one is bound to your Left Shift key, the second one to your &ldquo;E&rdquo; key, and the third one (the most important and game-changing one), which is also known as an &ldquo;ultimate&rdquo; ability, is bound to your &ldquo;R&rdquo; key.</p>\r\n\r\n<p>So, to simplify things, you can think of the game as a more complex shooter, and even though a couple of additional abilities don&rsquo;t necessarily make it considerably harder, they do complicate things quite a bit. You have to be aware of what each hero can do at any point in time, and you also have to keep track of what&rsquo;s going on-screen. That&rsquo;s easy on paper, but once twelve players start throwing stuff around (much of which is visually complex in nature), things can become a bit overwhelming.</p>\r\n\r\n<p>Utilizing the full potential of your hero and ability kit is of the utmost importance and will allow you to dominate on the fields of battle.</p>\r\n\r\n<p>There are also a couple of distinct types of maps that have different win conditions, but more on that below.</p>\r\n\r\n<h2><strong>The Meta</strong></h2>\r\n\r\n<p>Soon enough, you&rsquo;ll hear of this thing called the &ldquo;meta.&rdquo; When something is meta, it means that it&rsquo;s viable and will give you the best odds of finding success. That can be a hero, or a strategy on a map, or a team composition. Maybe it&rsquo;s a mix. As an example, some well-documented (and highly played) metas have been dive, double shield, and GOATS (just to name a few). The GOATS meta was almost universally despised because it consisted of three tanks and three supports who would just clump up together and go head-first into battle &mdash; there was little nuance or skill expression involved. That meta died out once Blizzard introduced role lock (meaning every team had to consist of two damage dealers, two tanks, and two supports).</p>\r\n\r\n<p>Dive comps are also a staple part of Overwatch. They consist of heroes like Genji and Winston literally diving into the opposing backline. The double shield meta is currently the most played of the bunch and it revolves around two incredibly potent tanks &mdash; Sigma and Orisa, along with an even more lethal DPS duo of Reaper and Doomfist.</p>\r\n\r\n<p>The meta always evolves. Players come up with new and unique ways of playing the game and thus shift the meta in any given direction. There is, however, a pattern to all of this. Whenever one meta takes over, it&rsquo;s only a matter of time before it gets nerfed and then we&rsquo;re back to square one.</p>\r\n\r\n<p>There&rsquo;s a certain ebb and flow to the whole thing, and whenever Blizzard releases an update, the meta changes. Sometimes in a small, nuanced way. Other times it&rsquo;s a huge, game-altering kind of thing. Either way, frequent updates make the game more balanced and, perhaps equally as important, refreshing.</p>\r\n\r\n<h2><strong>Quick Play</strong></h2>\r\n\r\n<p>Quick Play is for when you just want to have a bit of fun. It&rsquo;s akin to a &ldquo;normal game&rdquo; of League of Legends or Dota 2. You just jump in, get clumped up with a group of randoms, and play the game for a while. You don&rsquo;t get much for winning, but at least it&rsquo;s a nice way for you to rack up experience and level up your account.</p>\r\n\r\n<h2><strong>Competitive Play</strong></h2>\r\n\r\n<p>If you want to truly test your mettle and play in a more serious manner, you can also queue up for Competitive Play. By winning, you&rsquo;ll climb the ranked ladder and therefore fight against tougher opposition the higher you go. By playing Competitive, you&rsquo;ll also unlock special season-specific items like emotes, sprays and player icons, and you can also earn Competitive Points which you can then use to unlock special cosmetic items (like golden weapons for your main heroes).</p>\r\n\r\n<p>Competitive play is divided into seasons, with each season lasting around two months (at least at the time of this writing). Once the season ends, your rank will reset, and you&rsquo;ll start from square one once the forthcoming season commences.</p>\r\n\r\n<p>To start playing Competitive, you first have to hit level 25, which is definitely for the best &mdash; you need as much experience as possible before competing on the ranked ladder.</p>\r\n\r\n<h2><strong>Game Modes</strong></h2>\r\n\r\n<p>At the time of this writing, there are seven game modes in Overwatch, with four of them being available in Quick Play and Competitive.</p>\r\n\r\n<h3><strong>Assault</strong></h3>\r\n\r\n<p>When playing on an Assault map, there&rsquo;s an attacking and a defending team. The former has to capture two control points, whereas the latter has to defend them. Assault maps include Hanamura, Horizon Lunar Colony, Temple of Anubis, Volskaya Industries, and Paris.</p>\r\n\r\n<h3><strong>Control</strong></h3>\r\n\r\n<p>Control maps have a single control point in the center of the map, and both teams are fighting to capture it. Once the team holds it for long enough (and there&rsquo;s a percentage meter showing who&rsquo;s ahead), they&rsquo;ll get the win.</p>\r\n\r\n<h3><strong>Escort</strong></h3>\r\n\r\n<p>Escort maps, also known as Payload maps, have a payload that the attacking team has to push (by simply being around it) towards the defending team. If they complete the whole route, they&rsquo;ll win the game. If the defending team stops them at any point, they get the win instead.</p>\r\n\r\n<p>Escort maps include Dorado, Junkertown, Rialto, Watchpoint: Gibraltar, and Route 66.</p>\r\n\r\n<h3><strong>Hybrid</strong></h3>\r\n\r\n<p>Hybrid maps are a combination of Escort and Assault maps. This means that the attacking team first has to capture a point, and then push the payload throughout the map. The defending team, again, has to stop them.</p>\r\n\r\n<p>Hybrid maps include Hollywood, Eichenwalde, King&rsquo;s Row, Numbani, and Blizzard World.</p>\r\n\r\n<p>There&rsquo;s also Capture the Flag, Elimination, and Deathmatch which are available in both Arcade and custom Game Browser. Blizzard also frequently releases special seasonal events which are accompanied with unique game modes like &ldquo;Yeti Hunt&rdquo; or &ldquo;Junkenstein&rsquo;s Revenge.&rdquo; These modes are a nice way to relax and forget about the ranked ladder grind &mdash; they&rsquo;re just for fun, and there are often a couple of cosmetic goodies up for grabs as well.</p>\r\n\r\n<p><strong>TIP:</strong>&nbsp;Each map (and map type) is designed in a certain way to have a set number of strengths and weaknesses. Some maps are easier to navigate and traverse when you&rsquo;re on the attacking side, others are a bit more favorable to the defending team; some maps are filled with various spots where you can hide and flank from, whereas others don&rsquo;t provide much shelter.</p>\r\n\r\n<p>It&rsquo;s all about balance. This means they all share similar faults as well, and with time you&rsquo;ll find that you can even exploit the design of a map by playing in a certain way.</p>\r\n\r\n<h2><strong>The Heroes</strong></h2>\r\n\r\n<p>This is arguably where Overwatch stands out the most: its diverse cast of characters.</p>\r\n\r\n<p>You have three distinct categories of heroes, and each of them corresponds to a distinct role:</p>\r\n\r\n<p><img alt=\"Overwatch - The Heroes\" height=\"327\" loading=\"lazy\" sizes=\"(max-width: 775px) 100vw, 775px\" src=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-The-Heroes.png\" srcset=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-The-Heroes.png 775w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-The-Heroes-300x127.png 300w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-The-Heroes-768x324.png 768w\" width=\"775\" /></p>\r\n\r\n<h3><strong>DPS (Damage per Second)</strong></h3>\r\n\r\n<p>DPS heroes are the ones who deal the most damage. They&rsquo;re often on the squishier side, which is a fair trade-off as they possess immense power. Their tools and weapons of choice vary, with each hero bringing something unique to the table. Do you prefer the role of a sniper? Great, then go for Hanzo or Widowmaker. Perhaps you want to get up close and personal? Then Doomfist is the perfect fit.</p>\r\n\r\n<p>If you&rsquo;re the kind of player who gravitates towards damage-dealing heroes, then you&rsquo;ll have a palette of options to choose from in Overwatch.</p>\r\n\r\n<p><img alt=\"Overwatch - Damage Per Second\" height=\"165\" loading=\"lazy\" sizes=\"(max-width: 779px) 100vw, 779px\" src=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Damage-Control.png\" srcset=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Damage-Control.png 779w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Damage-Control-300x64.png 300w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Damage-Control-768x163.png 768w\" width=\"779\" /></p>\r\n\r\n<h3><strong>Tanks</strong></h3>\r\n\r\n<p>As the name implies, tanks are the ones who stand in front and take in the most damage. They&rsquo;re not weak by any stretch of the imagination, but they need to protect their teams first and foremost. Unlike in some other MOBA games, playing tanks in Overwatch isn&rsquo;t nearly as boring an experience. There&rsquo;s also a fair bit of diversity and you can definitely find a hero that&rsquo;ll fit perfectly with your playstyle.</p>\r\n\r\n<p>Tanks can be quick and nimble or slow and seemingly indestructible. Some of them can annihilate entire teams whereas other excel at getting into the heat of battle, creating chaos, and getting out.</p>\r\n\r\n<p><img alt=\"Overwatch - Tanks\" height=\"187\" loading=\"lazy\" sizes=\"(max-width: 774px) 100vw, 774px\" src=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tanks.png\" srcset=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tanks.png 774w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tanks-300x72.png 300w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tanks-768x186.png 768w\" width=\"774\" /></p>\r\n\r\n<h3><strong>Supports</strong></h3>\r\n\r\n<p>Support heroes provide peel (the act of protecting your carries), utility, crowd control, healing, shielding, and so on. They&rsquo;re mostly on the squishier side of the spectrum (except, say, Brigitte), but that doesn&rsquo;t mean they don&rsquo;t pack a punch. On the contrary.</p>\r\n\r\n<p>As a support, you need to protect your teammates to the best of your ability while also protecting yourself &mdash; supports always have a target on their backs.</p>\r\n\r\n<h3>Which heroes are best for someone who&rsquo;s just starting out?</h3>\r\n\r\n<p>That&rsquo;s a good question, but it&rsquo;s not as easy to answer as it might sound. Everyone has different amounts of experience (not to mention mechanical skill), which means some heroes might be easier than others to pick up. Regardless, there are certain heroes that are relatively simple by design but who still offer a lot of value to the team and will provide you with a solid enough chance of leaving a mark.</p>\r\n\r\n<p>For DPS, you can try out Soldier: 76 or Junkrat, for tanks go for Reinhardt or Orisa, and for supports Moira or Mercy. These are by no means simple heroes, but they do have a somewhat forgiving learning curve and are more than capable of dominating when played correctly.</p>\r\n\r\n<h3><strong>TIP #1</strong></h3>\r\n\r\n<p>If you&rsquo;re unsure which role (or hero) is right for you, don&rsquo;t fret &mdash; just enter the Overwatch Practice Range! Here you can test any ability and hero to your heart&rsquo;s content. You can move, jump, experiment, shoot stuff and even destroy both stationary as well as moving targets.</p>\r\n\r\n<p><img alt=\"Overwatch - Tip 1\" height=\"374\" loading=\"lazy\" sizes=\"(max-width: 777px) 100vw, 777px\" src=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tip-1.png\" srcset=\"https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tip-1.png 777w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tip-1-300x144.png 300w, https://2txp1g4bjeyvg8rqz491ffs8-wpengine.netdna-ssl.com/wp-content/uploads/2020/01/Overwatch-Tip-1-768x370.png 768w\" width=\"777\" /></p>\r\n\r\n<h3><strong>TIP #2</strong></h3>\r\n\r\n<p>Being flexible is key in Overwatch. If you&rsquo;re an OPT (One-trick pony &mdash; a player who specializes in just a single hero), you probably won&rsquo;t get too far. Try to master at least two champions in each role. Finally, being able to swap heroes mid-game is incredibly important &mdash; should the need arise. If you&rsquo;re playing, say, Brigitte, and you&rsquo;re getting countered by the enemy team, you should, by all means, have another pocket pick prepared.</p>\r\n\r\n<h3><strong>TIP #3</strong></h3>\r\n\r\n<p>Once you&rsquo;ve gotten a good grasp of a hero, make sure to play a couple of &ldquo;Play vs. AI&rdquo; games. You&rsquo;ll have human teammates, but computer-controlled opponents. This is a very forgiving game mode so you can make as many mistakes as you want!</p>\r\n\r\n<h2><strong>Role Lock</strong></h2>\r\n\r\n<p>Role lock is a fairly new thing to Overwatch. It&rsquo;s long overdue, but better late than never. What it does, basically, is enforce a 2-2-2 team comp by default, meaning each team has to consist of two DPS heroes, two tanks, and two supports.</p>\r\n\r\n<p>That kind of set-up offers the perfect mix of offense and defense. So when queueing up, you can pick which role you want to play as. If you want to play DPS, you&rsquo;ll have to wait a bit longer as it&rsquo;s a highly sought-after role. If, on the other hand, you want to play as a support, you&rsquo;ll find a match in record time. You can also pick more roles if you&rsquo;re flexible.</p>\r\n\r\n<p>Just have in mind that once you enter a match and the hero selection screen comes up, you won&rsquo;t be able to change roles until the match is over.</p>\r\n\r\n<h2><strong>The Overall Experience</strong></h2>\r\n\r\n<p>As with any other online game, be prepared to communicate with a wide variety of people &mdash; some of them will be calm, friendly, and kind; others, however, will be toxic and immature, and that&rsquo;s perhaps putting it mildly</p>\r\n\r\n<p>Just know what you&rsquo;re getting yourself into. Playing Overwatch can be one of the best experiences in the world when things are going your way, but once that fails to be the case, the game (much like any other online multiplayer title) tends to bring out the worst in people.</p>\r\n\r\n<h2><strong>Communication</strong></h2>\r\n\r\n<p>Communicating with your teammates is of the utmost importance. Overwatch is a team game through and through, and you won&rsquo;t get far by yourself. If even just a single player isn&rsquo;t doing his job right, there&rsquo;s a good chance that the entire team will crumble.</p>\r\n\r\n<p>Never disregard your allies and go in alone &mdash; that won&rsquo;t accomplish anything. Instead, try to synchronize, to layer abilities, crown control, and potentially pull off game-winning wombo combos.</p>\r\n\r\n<h3><strong>TIP #1</strong></h3>\r\n\r\n<p>Objectives over kills &mdash; Getting a ton of kills and dishing out damage is important. That&rsquo;s a no-brainer. But players often focus on skirmishing too much and fail to grasp the biggest picture. You need to push the payload, or take control of a zone on the map. Don&rsquo;t always fight if it isn&rsquo;t pushing you towards the objective. Otherwise you&rsquo;re just mindlessly trading blows and wasting time.</p>\r\n\r\n<h3><strong>TIP #2</strong></h3>\r\n\r\n<p>Target selection is incredibly important. Just because you can hit an enemy tank doesn&rsquo;t mean you should &mdash; taking out priority targets like supports or DPS heroes is one of the most important (and impactful) things in the game.</p>\r\n\r\n<h3><strong>TIP #3</strong></h3>\r\n\r\n<p>Save your ultimate &mdash; Using your hero&rsquo;s ultimate in an intelligent way can either make or break a game. Try to save it for the perfect moment (you&rsquo;ll eventually begin to recognize them as you play the game) or a game-winning push/engage.</p>\r\n\r\n<h2><strong>Professional Play</strong></h2>\r\n\r\n<p>Watching some of the best players in the world fight for a hefty paycheck isn&rsquo;t just incredibly entertaining &mdash; it&rsquo;s also educational. These individuals compete in Overwatch for a living, so it&rsquo;s only natural that they come up with the most ingenious strategies. With time, you&rsquo;ll be able to replicate and incorporate some aspects of their play into your own Quick Play/Competitive adventures.</p>\r\n\r\n<p>By analyzing what the pros do, your own play will improve &mdash; even on a subconscious level. Take notice of how they move or group up at certain moments of the game. Follow what they do with their specific heroes and team comps and how they utilize their strengths to win the game.</p>\r\n\r\n<p>And, even better, find the players whose playstyle you like the most and try to emulate them to the best of your heir ability. There&rsquo;s so much you can learn just from watching and taking notes. Sometimes it&rsquo;s a really big strategy you didn&rsquo;t know existed. Other times it&rsquo;s a small, nuanced thing that blows your mind.</p>', 1, NULL, 'Text Guide', '2020-11-23 08:19:55', '2021-03-18 06:19:49', '2021-03-18 06:19:49');
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(11, 5, 1, 'Securing Baron Nashor', 'winning-more-games', 'Learn how to secure Baron Nashor for your team and gain it\'s advantages!', '', '1433078453_game_guide_league-of-legends-baron-nashor-wide.jpg', 'league-of-legends-baron-nashor-wide.jpg', 'jpg', '<h2>Securing Baron Nashor</h2>\r\n\r\n<p>When it comes to taking this&nbsp;major<a href=\"http://mobalytics.gg/blog/league-of-legends-objectives-decompilation-guide/\"> </a>objective, you need to secure it in a safe manner to increase the likelihood of scoring a victory. Games are often won or lost at Baron because it can take a long time to kill and also deals a lot of damage.</p>\r\n\r\n<p>We will discuss some different tips you can use to secure the Baron in a way that will reduce the chances of the enemy stealing it. As the map is equal on both sides, some of the information we are going to discuss can be transferable and be used for the Elder Dragon and the Dragon pit.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>1. Sufficient Vision Control</h3>\r\n\r\n<p>Vision is incredibly important throughout the game as it can tell your team a lot of things. When taking the Baron, vision can allow you to take it safely by knowing where the enemy is at any given time.</p>\r\n\r\n<p>Vision will prevent the enemy from sneaking up on your team-or contesting the objective. By knowing where the enemy jungler is, it will allow your team to reposition and block the enemy from being able to enter the pit.</p>\r\n\r\n<p>Control Wards are incredibly important to place inside the pit itself in order to cancel and block any enemy vision. If you didn&rsquo;t know, Control Wards block vision trinkets and wards.</p>\r\n\r\n<p>When the enemy places a normal trinket or ward in the pit- do not start auto-attacking it as the enemy will be able to see the health of the objective which may allow them to steal it.</p>\r\n\r\n<p>However, Control Wards do not deny or block other Control Wards. This means that the enemy will be able to see what is happening in the pit if one is placed.</p>\r\n\r\n<p>If the enemy has placed a Control Ward in the pit, make sure to destroy it as quickly as you can so you can continue blocking vision.</p>\r\n\r\n<p>Wards are not always going to be around the Baron pit. In fact, they can be in the river, or in your own jungle too.</p>\r\n\r\n<p><img alt=\"Blue team objective control\" height=\"520\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"http://mobalytics.gg/wp-content/uploads/2018/11/Blue-team-objective-control.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control.jpg 740w, https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control-300x211.jpg 300w, https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control-600x422.jpg 600w, https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control-455x320.jpg 455w, https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control-285x200.jpg 285w, https://cdnportal.mobalytics.gg/production/2018/11/Blue-team-objective-control-700x492.jpg 700w\" width=\"740\" /></p>\r\n\r\n<p>As you can see by the image, you&rsquo;ll need to have vision in the enemies jungle to spot them before they are knocking at the Baron&rsquo;s door.</p>\r\n\r\n<p>This will give you enough time to decide on what to do when they get closer. For instance, you may try to finish off the Baron or you can back off and retreat.</p>\r\n\r\n<p>No matter what side of the map you are on, you will always want to prioritize having wards that are further out rather than close by. This is because they will give you more time to react to the enemy.</p>\r\n\r\n<p>Every ward you place should be in an area where the enemy could possibly pass by it. There is no point wasting a ward by putting it somewhere where the enemy is not going to be.</p>\r\n\r\n<p>For example, putting it behind the Baron pit if you are the red team (this is because the enemy is coming from the opposite side).</p>\r\n\r\n<p><img alt=\"Red team objective control\" height=\"520\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"http://mobalytics.gg/wp-content/uploads/2018/11/Red-team-objective-control.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control.jpg 740w, https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control-300x211.jpg 300w, https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control-600x422.jpg 600w, https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control-455x320.jpg 455w, https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control-285x200.jpg 285w, https://cdnportal.mobalytics.gg/production/2018/11/Red-team-objective-control-700x492.jpg 700w\" width=\"740\" /></p>\r\n\r\n<p>The areas we have suggested are not the only places you can ward though. In most situations, a poor ward is better than no ward at all.</p>\r\n\r\n<p>If you have any spare wards on your person, make use of them and place them around the objective to make it safer to take.</p>\r\n\r\n<h3>2. Don&rsquo;t always try to sneak it</h3>\r\n\r\n<p>In lower ELOs, a lot of Barons are taken through pure luck and sneakiness rather than careful planning and macro. The higher up you go, the chances of a sneaky Baron capture is reduced because in many situations, the Baron will be warded consistently after 20 minutes.</p>\r\n\r\n<p>I recommend that you try to avoid sneaking the Baron in general because it can often go wrong and you may either lose the objective or your life.</p>\r\n\r\n<p>You may also waste a lot of your time and fall behind in farm and XP because you&rsquo;re trying to take the objective alone.</p>\r\n\r\n<p>When you are sneaking the objective, the enemy may realize that your team is missing for a long period of time and go and check the objective.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Baron is not easy to take because of its tankiness, especially earlier on in the game when it first spawns. It can take quite a long time to burn down if you are alone or with a few members of your team.</p>\r\n\r\n<p>If the enemy is aware of their surroundings, they would notice that you are or multiple members of your team are missing. If the Baron is the only objective available, they would put two and two together and rotate to your location.</p>\r\n\r\n<p>When you are trying to sneak an objective, you may not have the best of setups as you are trying to rush the objective and take it as quickly as you can.</p>\r\n\r\n<p>This means that you may have little to no preparation time to ward around the object- which can cost you. This can also mean that you do not take the time to clear vision around the objectives.</p>\r\n\r\n<p>Instead of trying to be sneaky and secure the objective without the enemy knowing, put in the time and effort to make sure that the objectives will be safe and secure. You can do this by:</p>\r\n\r\n<ol>\r\n	<li>Placing wards around the objectives to spot the enemy.</li>\r\n	<li>Making sure that the pit itself is not warded by placing a Control Ward inside.</li>\r\n	<li>Backing off if the enemy decides to rotate to the Baron.</li>\r\n</ol>\r\n\r\n<p><strong>Please note:</strong>&nbsp;If you can take the Baron in a secure manner, then sneaking is fine. But make sure that you have sufficient warding around the objective so you do not get wiped out by the enemy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a href=\"http://mobalytics.gg/blog/5-ways-to-improve-your-communication-in-league-of-legends/\">Communication</a>&nbsp;is so important in League of Legends, especially when trying to sneak an objective. Make sure to communicate with your team to have an easier time at securing the Baron.</p>\r\n\r\n<h3>3. Be ready to turn when the enemy comes</h3>\r\n\r\n<p>If the enemy jungler is alive and nearby when you&rsquo;re attempting to take Baron, they have the opportunity to steal the objective. This can make securing the objective quite difficult because you have a 50/50 chance of coming out ahead, and realistically- it can go either way.</p>\r\n\r\n<p>It is also made harder when the enemy is a higher level than you (as their Smite will deal more damage). This is why it is recommended to either finish off the Baron before the enemy can get to your team, turn and fight them as soon as they enter the river, or just back off.</p>\r\n\r\n<p>If you&rsquo;re able to fight the enemy, it is good to stop taking Baron and fight them instead. When you are focusing objectives such as the Baron, your priority will be focused on the Baron itself which leaves the enemy at full health. The enemy would be able to unload damage on your team while receiving none in return.</p>\r\n\r\n<p>If you are unable to fight the enemy, but they are coming towards you, it is important that you back off and peel away from the Baron and the enemy as a whole. This is because they can win the team fight and then take the Baron afterward.</p>\r\n\r\n<p>Make sure that you stay alive when the Baron is up as it will allow your team to be able to contest it. If you are dead, the enemy will be able to take it for free.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>However, if you can safely secure the objective before the enemy gets to you. For example, if the Baron is low enough for you to burst it down- at around 2 or 3000 health, then you should take the objective and then back off as soon as you have killed it.</p>\r\n\r\n<p>It is important that you back off and not fight the enemy, as you will potentially lose all the players who have the buff. To some extent, this would make the Baron obsolete, and the enemy will be given the opportunity to take towers.</p>\r\n\r\n<h3>4. Know your Smite power</h3>\r\n\r\n<p>Smite is a necessity for every Jungler in the game. It has a direct impact on how you jungle, and move around the map. It will also drastically increase your chances of securing the Baron if used correctly.</p>\r\n\r\n<p>Smite develops throughout the game, dealing more damage every time you level up. Theoretically, the later the game goes on and the higher level you&rsquo;re, the easier and safer it should be to take because you can Smite it at higher health.</p>\r\n\r\n<p>Here are some tips and tricks to improve your last hitting ability.</p>\r\n\r\n<ul>\r\n	<li>Take into account the damage of other champions\r\n	<ul>\r\n		<li>Some champions are really good at taking the Baron. Champions like Kalista with her Rend (E), and Cho&rsquo;Gath with his ultimate come to mind.</li>\r\n		<li>In some cases, their damage dealt will be more than what your Smite can deal &ndash; so it&rsquo;s better for your allies to finish it off instead (however, make sure that you communicate your intentions with your team.</li>\r\n		<li>On the flip side, if the enemy has any abilities that can finish off the objective, take into account what they have and who can steal it.</li>\r\n		<li>For example, the enemy Cho&rsquo;Gath flashing over the wall and chomping down on it. When this is the case, make sure they&rsquo;re dead or have the ability on cooldown before taking it.</li>\r\n	</ul>\r\n	</li>\r\n	<li>Make sure that you have Smite available before starting the Baron.\r\n	<ul>\r\n		<li>Smite is needed to secure the Baron (unless someone else can finish it off- read above). So making sure that you have it available to you will allow you to secure it safely.</li>\r\n		<li>This sounds obvious but you&rsquo;d be surprised how often Junglers forget or do not let their team know.</li>\r\n		<li>Keep practicing\r\n		<ul>\r\n			<li>Practice always makes perfect. You can try to improve your Smite ability by just practicing and finishing off objectives by Smiting them at the last possible second. Check out this tool from&nbsp;<a href=\"http://www.smiterino.com/\">Smiterino</a>&nbsp;to help you hone your skills.</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>', 1, NULL, 'Text Guide', '2020-11-23 08:28:48', '2020-12-08 14:58:09', '2020-12-08 14:58:09'),
(12, 5, 1, 'Bard Guide', 'bard-one-shots', 'Improve your Bard gameplay with our simple guide!', '', '1538949355_game_guide_maxresdefault-5.jpg', 'maxresdefault-5.jpg', 'jpg', '<h1>Strategy</h1>\r\n\r\n<ul>\r\n	<li>Collect as many magical chimes that are near your lane as it empowers Bard&rsquo;s auto attack to further increase his poke damage against enemy laners.</li>\r\n	<li>Cast&nbsp;<strong>(Q) Cosmic Binding&nbsp;</strong>on enemy laners who are either behind or in front of their minions or lane partners to root and stun them in place. You can also disable them if you cast&nbsp;<strong>(Q) Cosmic Binding</strong>&nbsp;on enemy champions near terrain or walls.</li>\r\n	<li>Place&nbsp;<strong>(W) Caretaker&rsquo;s Shrine</strong>&nbsp;in safe areas during the laning phase (i.e. near the allied turrets) to have fully charged heals each time you or your lane partner touches it to regain lost health.</li>\r\n	<li>You can set up ganks for your jungler from unique locations with&nbsp;<strong>(E) Magical Journey</strong>, as you can cast it on terrain that are not normally wared. You and your team can also use this skill to escape ganks by the enemy team.</li>\r\n	<li>You can stun enemies by luring them into your&nbsp;<strong>(E) Magical Journey</strong>&nbsp;then hitting them with&nbsp;<strong>(Q) Cosmic Binding</strong>.</li>\r\n	<li>Cast&nbsp;<strong>(R) Tempered Fate</strong>&nbsp;to disable enemy champions and either position your team for a more advantageous team fight or to disengage and regroup.</li>\r\n	<li><strong>(R) Tempered Fate</strong>&nbsp;can be casted on enemy turrets &ndash; use this to tower dive on low-health enemy champions.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1>Core Items</h1>\r\n\r\n<p><strong>Eye of the Watchers</strong>&nbsp;&ndash; A standard Sightstone upgrade for Ability Power-based Supports, Eye of the Watchers aids Bard by giving him bonus Ability Power, Mana Regeneration and ward placement capabilities.</p>\r\n\r\n<p><strong>Redemption</strong>&nbsp;&ndash; This item gives Bard another healing skill to help his teammates during clashes. Redemption also has decent boosts in health, cooldown reduction and mana regeneration.</p>\r\n\r\n<p><strong>Ardent Censer</strong>&nbsp;&ndash; A great synergy item for Redemption and Bard&rsquo;s&nbsp;<strong>(W) Caretaker&rsquo;s Shrine</strong>, Ardent Censer gives bonus attack speed to allied champions who were healed or shielded by Bard. This proves useful during clashes where Bard can heal either a single teammate or his whole team and give them all bonus attack speed.</p>', 1, NULL, 'Text Guide', '2020-11-23 08:29:24', '2020-12-08 15:00:14', '2020-12-08 15:00:14');
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(13, 5, 1, 'The Basics', 'the-basics', 'Our Ultimate basics guide will give you all the info you need to know about League of Legends!', '', '1294581604_game_guide_maxresdefault-6.jpg', 'maxresdefault-6.jpg', 'jpg', '<h2>LoL Guide for Beginners (Everything You Need to Know)</h2>\r\n\r\n<p>Welcome to our absolute beginner&rsquo;s guide for League of Legends, in this guide we&rsquo;ll cover the fundamental basics of how LoL is played.</p>\r\n\r\n<p>Whether you&rsquo;re thinking about playing the game, just downloaded it, or still learning the ropes, this guide is for you!</p>\r\n\r\n<p>We thought it was a good time to release this guide since a lot of people are downloading League for the first time to play TFT and may eventually want to try it out.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 id=\"whatislol\">1. What is League of Legends?</h2>\r\n\r\n<p>League of Legends is a multiplayer online battle arena, also known as a MOBA. It&rsquo;s been one of the most popular games of all time and currently one of the biggest esports.</p>\r\n\r\n<p>In a standard game of League, ten players are split into two teams of five and battle it out on a map called Summoner&rsquo;s Rift.</p>\r\n\r\n<p>Each of these players controls a single character, known as a champion.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>What is a champion?</h3>\r\n\r\n<p>All ten players in a League of Legends match controls a single champion.</p>\r\n\r\n<p>There are currently over 140 champions with new ones being continuously added over time.</p>\r\n\r\n<p>Every champion has special abilities and powers with unique playstyles.</p>\r\n\r\n<p>Before a game begins at champ select, each team takes turns selecting champions.</p>\r\n\r\n<p>There&rsquo;s a lot of strategies involved as you work with your team to create teams with champions that work well together (more on this later).</p>\r\n\r\n<p>Every game you play can be vastly different since every champion has their own feel and gameplan.</p>\r\n\r\n<h3>How do you win?</h3>\r\n\r\n<p>The ultimate goal of LoL is to destroy the other team&rsquo;s base, but it&rsquo;s not easy.</p>\r\n\r\n<p>Your enemies will do everything they can to kill you and destroy your base.</p>\r\n\r\n<p>Each base has a series of turrets and waves of minions that constantly spawn.</p>\r\n\r\n<p>If you started a game and tried to run straight to the enemy base, you&rsquo;d certainly die, not just because the enemy team would be trying to stop you at all costs, but also because you may be too weak and die.</p>\r\n\r\n<p>League is sort of like a role-playing game (RPG) that takes place in a very short amount of time.</p>\r\n\r\n<p>You begin at level 1 and gradually get stronger throughout the game by gaining experience and earning gold to buy items.</p>\r\n\r\n<p>The two teams continually grow in power and collide. Eventually, one team is able to get the upper hand and make a final push for a victory.</p>\r\n\r\n<h3>What is Summoner&rsquo;s Rift?</h3>\r\n\r\n<p>This is the standard map that the professionals play on and it&rsquo;s where you&rsquo;d be if you were trying to climb the ranked ladder.</p>\r\n\r\n<p>There are other maps in League, but for now, we&rsquo;ll focus on Summoner&rsquo;s Rift since it&rsquo;s where you&rsquo;ll likely be spending most of your time.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2018/12/Basic-map.jpg\"><img alt=\"Summoner\'s Rift map\" height=\"629\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2018/12/Basic-map.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/12/Basic-map.jpg 740w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-300x255.jpg 300w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-600x510.jpg 600w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-647x550.jpg 647w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-376x320.jpg 376w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-235x200.jpg 235w, https://cdnportal.mobalytics.gg/production/2018/12/Basic-map-700x595.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p><strong><em>Here are the basics of the Summoner&rsquo;s Rift map:</em></strong></p>\r\n\r\n<p>There are two teams of five players: the blue team (base at bottom left corner) and the red team (base at the top right corner).</p>\r\n\r\n<p>To achieve victory, one team has to destroy the opposing team&rsquo;s Nexus (basically the core of their base).</p>\r\n\r\n<p>During a match, minions will continually spawn from each base&rsquo;s Nexus and proceed through the three lanes (the paths are shown in the graphic above).</p>\r\n\r\n<p>The three lanes are known as top lane, mid lane, and bot lane. In all three lanes, there are turrets which will attack enemy champions and minions.<a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Nexus-and-turrets.jpg\"><img alt=\"Nexus and turrets\" height=\"450\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Nexus-and-turrets.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets-300x182.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets-600x365.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets-526x320.jpg 526w, https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets-329x200.jpg 329w, https://cdnportal.mobalytics.gg/production/2019/06/Nexus-and-turrets-700x426.jpg 700w\" width=\"740\" /></a>Summoners must destroy all turrets in at least one lane and then destroy the last two towers that protect a Nexus before being able to attack and destroy it.</p>\r\n\r\n<h3>Turrets and Inhibitors</h3>\r\n\r\n<p>Destroying turrets and other structures called inhibitors rewards players with gold and allows the minion waves to push through the lane (since there aren&rsquo;t any turrets to stop them).</p>\r\n\r\n<p>Inhibitors are structures that are behind the initial turrets inside a base. If an inhibitor is destroyed, upgraded minions, called Super Minions, will spawn until an inhibitor respawns after a few minutes.<a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Super-minions.jpg\"><img alt=\"Super minions\" height=\"385\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Super-minions.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Super-minions.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Super-minions-300x156.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Super-minions-600x312.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Super-minions-615x320.jpg 615w, https://cdnportal.mobalytics.gg/production/2019/06/Super-minions-384x200.jpg 384w, https://cdnportal.mobalytics.gg/production/2019/06/Super-minions-700x364.jpg 700w\" width=\"740\" /></a>&nbsp;A team can often use the Super Minions to successfully siege a base that was previously difficult to attack and create an opportunity to push to victory.</p>\r\n\r\n<h3>The Fountain and Shop</h3>\r\n\r\n<p>At the beginning of each game, you&rsquo;ll begin at your fountain. You&rsquo;ll revisit your fountain because it&rsquo;s where you&rsquo;ll respawn when you die and it&rsquo;s where your shop is located.<a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Fountain-and-shop.jpg\"><img alt=\"Fountain and shop\" height=\"370\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Fountain-and-shop.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-300x150.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-600x300.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-640x320.jpg 640w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-400x200.jpg 400w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-700x350.jpg 700w, https://cdnportal.mobalytics.gg/production/2019/06/Fountain-and-shop-320x160.jpg 320w\" width=\"740\" /></a>&nbsp;You can return to your fountain at any time during a game to heal or purchase items. All you have to do is use the Recall ability which every summoner has access to &ndash; just be careful and use it safely because you can be interrupted while casting it.</p>\r\n\r\n<h3>Income and Items</h3>\r\n\r\n<p>As we mentioned earlier, killing a minion, structure, or enemy champion grants players gold which can be used to purchase items at the fountain&rsquo;s shop.</p>\r\n\r\n<p>The ultimate purpose of gold is to give players to have flexibility in their stat growth and play styles. Whether you want more damage, survivability, or utility, there are a wide variety of items to fit your needs.</p>\r\n\r\n<p>We recommend checking out our&nbsp;<a href=\"https://mobalytics.gg/blog/category/lol-items/\">LoL item guides series</a>&nbsp;if you want to learn more about what different items do and when to build them.</p>\r\n\r\n<h2 id=\"champbasics\">2. LoL Champion Basics</h2>\r\n\r\n<p>Now that we understand the basics of the map, let&rsquo;s get back to talking about champions. Champions are the heart and soul of League of Legends as they&rsquo;re often what players resonate with most.</p>\r\n\r\n<p>While Summoner&rsquo;s Rift stays constant, the different combinations of champions that are chosen by the ten players in game can create vastly different rhythms and feels.</p>\r\n\r\n<p>Right now there are currently over 140 champions, each of them representing a different playstyle and experience.<a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/all-champions.jpg\"><img alt=\"All LoL champions\" height=\"393\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/all-champions.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/all-champions.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/all-champions-300x159.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/all-champions-600x319.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/all-champions-603x320.jpg 603w, https://cdnportal.mobalytics.gg/production/2019/06/all-champions-377x200.jpg 377w, https://cdnportal.mobalytics.gg/production/2019/06/all-champions-700x372.jpg 700w\" width=\"740\" /></a>&nbsp;Some are simple and easy to play while others may take a hundred games to master. Whether you like dealing damage from afar, brawling at close quarters, or helping your team with utility, there&rsquo;s a champion for you.</p>\r\n\r\n<p>In the next few sections, we&rsquo;ll discuss different aspects of champions, such as their abilities, stats, and scaling.</p>\r\n\r\n<h3>Auto-attacks and Abilities</h3>\r\n\r\n<p>Every champion has auto-attacks and abilities at their disposal. Auto-attacks, also known as &ldquo;basic attacks&rdquo; occur when a player right clicks on a target. Doing so will cause a champion to continually attack a target until it dies.</p>\r\n\r\n<p>Abilities are cast using Q, W, E, and R. Every champion has abilities that are unique to them for each of these buttons. Here&rsquo;s Ashe&rsquo;s W, Volley, in action below:</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-skillshot.jpg\"><img alt=\"Ashe\'s W, Volley\" height=\"494\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-skillshot.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Ashe-skillshot.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-skillshot-300x200.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-skillshot-600x401.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-skillshot-479x320.jpg 479w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-skillshot-700x467.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>All champions also have access to two abilities, using D and F, called Summoner Spells. These are up to a player&rsquo;s personal preference, we&rsquo;ll discuss these later on.</p>\r\n\r\n<p>Lastly, champions can also cast abilities from items such as Redemption and Tiamat, using the number keys, 1-7.</p>\r\n\r\n<h3>Champion Stats</h3>\r\n\r\n<p>A major aspect that sets champions apart is the distribution of their stats. Stats represent a champion&rsquo;s make up as far as how hard they are to kill, how much damage they do, and how fast they move or attack.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Champ-stats-Ashe.jpg\"><img alt=\"LoL champion stats\" aria-describedby=\"caption-attachment-10187\" height=\"126\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Champ-stats-Ashe.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Champ-stats-Ashe.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Champ-stats-Ashe-300x51.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Champ-stats-Ashe-600x102.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Champ-stats-Ashe-700x119.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p id=\"caption-attachment-10187\">From left to right: attack damage, ability power, armor, magic resist, attack speed, cooldown reduction, critical strike chance, movement speed.</p>\r\n\r\n<p>For the purpose&rsquo;s of this beginner guide, we won&rsquo;t be getting too technical about stats. Here are the basics:</p>\r\n\r\n<h4>Health (indicated by a green bar)</h4>\r\n\r\n<ul>\r\n	<li>Health represents the amount of damage you can take before dying and being sent to your fountain.</li>\r\n</ul>\r\n\r\n<h4>Ability Resources: Mana, Energy, and others</h4>\r\n\r\n<ul>\r\n	<li>Abilities cost resources in order to cast them, most champions use mana, energy, or fury.</li>\r\n	<li>The majority of champions, such as Lux and Vel&rsquo;Koz, use mana.</li>\r\n	<li>Mana is indicated by a blue bar below the health bar and regenerates over time.</li>\r\n	<li>Champions such as Akali and Kennen use energy.</li>\r\n	<li>Energy is indicated by a yellow bar and also regenerates over time but at a much faster rate. These champions often have ways to get energy back as well, such as by auto-attacking./li&gt;</li>\r\n	<li>The tradeoff is that unlike mana, you cannot increase the amount of energy you have through buying items.</li>\r\n	<li>Other champions use other sources, such as their health, fury, rage, or courage.</li>\r\n	<li>Using health is straightforward, your champion basically takes damage in order to cast their spell.</li>\r\n	<li>Fury, rage, and courage, are dependent on their champions. Be sure to check them out for more details.</li>\r\n</ul>\r\n\r\n<h4>Attack Damage (AD)</h4>\r\n\r\n<ul>\r\n	<li>Attack damage, also known as physical damage, represents the damage dealt by basic auto-attacks.</li>\r\n	<li>Depending on a champion, AD can also empower abilities.</li>\r\n	<li>Numbers from abilities and items that refer to attack damage are displayed as orange.</li>\r\n</ul>\r\n\r\n<h4>Ability Power (AP)</h4>\r\n\r\n<ul>\r\n	<li>Ability power primarily makes your abilities (QWER) more powerful, however, AP can also strengthen some items and runes.</li>\r\n	<li>Numbers from abilities and items that refer to ability power are displayed as green.</li>\r\n</ul>\r\n\r\n<h4>Armor</h4>\r\n\r\n<ul>\r\n	<li>Armor is a defensive stat that mitigates physical damage. Building it will help you survive against champions with a lot of attack damage.</li>\r\n</ul>\r\n\r\n<h4>Magic Resist (MR)</h4>\r\n\r\n<ul>\r\n	<li>You probably guessed it, but magic resist is the counterpart to armor that mitigates damage from ability power.</li>\r\n</ul>\r\n\r\n<h4>Attack Speed (AS)</h4>\r\n\r\n<ul>\r\n	<li>Attack speed represents how fast your champion auto-attacks. In general, this is a good combination with attack damage if you&rsquo;re looking to increase your physical damage output.</li>\r\n</ul>\r\n\r\n<h4>Cooldown Reduction (CDR)</h4>\r\n\r\n<ul>\r\n	<li>Abilities have &ldquo;cooldowns&rdquo; representing how long it will be before you can cast it again. Items that give you CDR allow you to cast abilities more often.</li>\r\n</ul>\r\n\r\n<h4>Critical Strike Chance</h4>\r\n\r\n<ul>\r\n	<li>This stat represents your chance of landing a critical strike &ndash; critical strikes cause your auto-attacks to deal double its damage.</li>\r\n	<li>For example, if you have 50% crit chance, your attacks will likely crit 50% of the time. If you have 100% crit chance, they will crit every time.</li>\r\n</ul>\r\n\r\n<h4>Movement Speed (MS)</h4>\r\n\r\n<ul>\r\n	<li>Movement speed represents how fast your champion moves around the map. This can be increased with abilities and items such as boots.</li>\r\n</ul>\r\n\r\n<h3>Experience and Leveling up a Champion</h3>\r\n\r\n<p>In League of Legends, every champion starts at level 1 and continues to level up until the max of level 18.</p>\r\n\r\n<p>Champions gain experience by farming minions and jungle camps or killing (or assisting in killing) champions.</p>\r\n\r\n<p>Note that killing jungle camps or monsters will only provide experience for the player who landed the killing blow.</p>\r\n\r\n<p>Destroying turrets and inhibitors grants experience to a whole team globally.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Experience-range.jpg\"><img alt=\"Experience range\" aria-describedby=\"caption-attachment-10190\" height=\"410\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Experience-range.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Experience-range.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Experience-range-300x166.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Experience-range-600x332.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Experience-range-578x320.jpg 578w, https://cdnportal.mobalytics.gg/production/2019/06/Experience-range-361x200.jpg 361w, https://cdnportal.mobalytics.gg/production/2019/06/Experience-range-700x388.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p id=\"caption-attachment-10190\">Even at this range, Aurelion Sol will get experience when the minion dies.</p>\r\n\r\n<p>You can also gain experience by being within range of enemy minions or enemy champions dying. This radius is about equal to around 3x a champion&rsquo;s auto-attack (exactly 1600 range).</p>\r\n\r\n<p>Gaining levels and experiences allows champions to grow in power. While buying items allow champions to have freedom in choosing which stats to gain, gaining levels activates predetermined increases to a champion&rsquo;s stats.</p>\r\n\r\n<p>For example, at level 1, Ashe will have around 539 base hp. At level 18, she&rsquo;ll have 1984. This growth applies to health, health regen, mana, mana regen, attack damage, attack speed, armor, and magic resist.</p>\r\n\r\n<p>Leveling up also grants skill points which are used to increase the power of a champion&rsquo;s QWER abilities.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-Skill-up.jpg\"><img alt=\"Ashe Skill Level Up\" height=\"590\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-Skill-up.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-300x239.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-600x478.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-690x550.jpg 690w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-401x320.jpg 401w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-251x200.jpg 251w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-Skill-up-700x558.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>The effect of skill points can be dependent on the champion and the ability itself. In the example above for Ashe&rsquo;s W, Volley, increasing from ability level 1 to 2 will yield an increase of damage from 20 to 35 and a reduction in CDR from 15 to 12.5 seconds.</p>\r\n\r\n<h3>Summoner Spells</h3>\r\n\r\n<p>Beyond their QWER abilities, every summoner also must choose two summoner spells for their champion. Summoner spells act as two additional abilities with their own purposes and cooldowns.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/all-Summoner-spells.jpg\"><img alt=\"all summoner spells\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/all-Summoner-spells.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/all-Summoner-spells.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/all-Summoner-spells-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/all-Summoner-spells-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/all-Summoner-spells-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>They offer flexibility in helping you adapt at champ select and allow you to play toward your preferred playstyle. When you first start playing, you&rsquo;ll gradually unlock them over time (check out the section at the bottom for more info). In this section, we&rsquo;ll be going over what each one does and why you&rsquo;d want to take it.</p>\r\n\r\n<h4>Heal (240 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Heal.jpg\"><img alt=\"Heal\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Heal.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Heal.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Heal-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Heal-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Heal-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Heal instantly replenishes some of your health (based on your level) and increases your movement speed by 1%.</li>\r\n	<li>It also heals one other ally. You can choose which one it targets by hovering them when you cast Heal. If you don&rsquo;t specifically with your cursor it will automatically heal the ally closet to dying.</li>\r\n	<li>This is most commonly seen at a bot lane by the ADC role or sometimes, the Support role. This is because it heals two allies at once, giving it more value there than compared to other roles.</li>\r\n</ul>\r\n\r\n<h4>Ghost (180 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ghost.jpg\"><img alt=\"Ghost\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ghost.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Ghost.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Ghost-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Ghost-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Ghost-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>This summoner spell grants a large amount of increased movement speed (based on level) for 10 seconds and allows you to run through units (champions, monsters, minions).</li>\r\n	<li>Ghost makes a great choice for champions that rely on chasing down their opponents or want to stay at a safe distance.</li>\r\n	<li>It&rsquo;s a lot less flexible than its counterpart, Flash, so you&rsquo;ll often see it paired with Flash rather than replacing it.</li>\r\n</ul>\r\n\r\n<h4>Barrier (180 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Barrier.jpg\"><img alt=\"Barrier\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Barrier.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Barrier.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Barrier-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Barrier-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Barrier-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Barrier instantly grants you a shield (based on your level) that is great for mitigating burst damage.</li>\r\n	<li>You&rsquo;ll often see Barrier for the Mid lane role but it&rsquo;s also taken by ADCs and Supports.</li>\r\n</ul>\r\n\r\n<h4>Exhaust (210 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Exhaust.jpg\"><img alt=\"Exhaust\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Exhaust.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Exhaust.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Exhaust-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Exhaust-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Exhaust-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Exhaust slows a champion and reduces their damage output by 40% over 2.5 seconds.</li>\r\n	<li>This is primarily used defensively but can be used as a crowd control option for chasing opponents.</li>\r\n</ul>\r\n\r\n<h4>Flash (300 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Flash.jpg\"><img alt=\"Flash\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Flash.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Flash.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Flash-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Flash-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Flash-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Flash is by far the most popular summoner spell. It allows you to blink a short distance in any direction.</li>\r\n	<li>This may sound very simple at first but the flexibility Flash offers let&rsquo;s it be equally viable in offensive and defensive situations.</li>\r\n	<li>You can use it to engage and surprise an enemy, or use it to escape over a wall or out of harm&rsquo;s way.</li>\r\n</ul>\r\n\r\n<h4>Teleport (360 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Teleport.jpg\"><img alt=\"Teleport\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Teleport.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Teleport.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Teleport-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Teleport-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Teleport-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>This summoner spell allows you to instantly teleport to an allied ward, minion, or tower.</li>\r\n	<li>Be aware that this takes 4-seconds to channel and it can be interrupted by a stun or other forms of crowd control.</li>\r\n</ul>\r\n\r\n<h4>Smite (210 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Smite.jpg\"><img alt=\"Smite\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Smite.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Smite.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Smite-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Smite-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Smite-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Smite allows you to instantly cast a high burst damage spell upon a minion, monster, or pet (a minion controlled by a champion&rsquo;s abilities).</li>\r\n	<li>This is a jungler&rsquo;s core summoner spell and is required in order to play the role.</li>\r\n	<li>Smiting objectives (see the objectives section) allows you to secure them more reliably to get the last-hit before your foes.</li>\r\n	<li>It also helps clear jungle camps and offers increased damage or a slow based on the jungle item upgrade you purchase.</li>\r\n</ul>\r\n\r\n<h4>Cleanse (210 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Cleanse.jpg\"><img alt=\"Cleanse\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Cleanse.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Cleanse.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Cleanse-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Cleanse-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Cleanse-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>This summoner spell is sort of like a get out of jail free card as it removes all disables (except for being airborne from knockouts or being suppressed).</li>\r\n	<li>It allows you to get out of an otherwise tight situation and also increases your tenacity, which means that it makes you temporarily resistant to additional incoming crowd control effects.</li>\r\n</ul>\r\n\r\n<h4>Ignite (180 second cooldown)</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/ignite.jpg\"><img alt=\"Ignite\" height=\"85\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/ignite.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/ignite.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/ignite-300x34.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/ignite-600x69.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/ignite-700x80.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Ignite is a spell that lasts over 5 seconds and&nbsp;inflicts burning damage.</li>\r\n	<li>It can often help you secure a kill as an enemy is trying to escape if you&rsquo;re able to land it in time.</li>\r\n	<li>It also decreases the amount of healing a champion can receive so it&rsquo;s useful against champions with healing effects.</li>\r\n	<li>This also implies that it counters the Heal spell, just make sure to cast Ignite before the Heal goes off.</li>\r\n</ul>\r\n\r\n<h3>Runes</h3>\r\n\r\n<p>League of Legends is all about discovering the best way for you to play based on your personal preferences. On top of summoner spells, runes provide another way for you to tune your champion to either maximize their strengths or to help keep their weaknesses in check.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Runes.jpg\"><img alt=\"Runes\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Runes.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Runes.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Runes-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Runes-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Runes-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>In this section, we&rsquo;ll be covering the overarching themes of each of the five main rune trees and explaining how to equip rune pages.</p>\r\n\r\n<p>The five rune trees are Precision, Domination, Sorcery, Resolve, and Inspiration.</p>\r\n\r\n<h4>Precision</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Precision.jpg\"><img alt=\"Precision\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Precision.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Precision.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Precision-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Precision-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Precision-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Focuses on empowering auto-attacks making it ideal for ranged carries like Ashe or a melee fighter like Tryndamere.</li>\r\n	<li>Example: Press the Attack rewards you for continuously attacking the same target by increasing your overall damage output.</li>\r\n</ul>\r\n\r\n<h4>Domination</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Domination.jpg\"><img alt=\"Domination\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Domination.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Domination.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Domination-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Domination-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Domination-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Improves your ability to instantly burst or kill a target, it&rsquo;s no surprise that you&rsquo;ll often see assassins like Katarina or Talon take Domination.</li>\r\n	<li>Example: Predator grants you a huge burst of movement speed to allow you to quickly chase down your prey.</li>\r\n</ul>\r\n\r\n<h4>Sorcery</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Sorcery.jpg\"><img alt=\"Sorcery\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Sorcery.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Sorcery.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Sorcery-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Sorcery-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Sorcery-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Sorcery augments your abilities but also provides a good amount of utility. It&rsquo;s most commonly taken by mages and casters like Karma or Lux.</li>\r\n	<li>Example: Summon Aery improves the punch of your spells and also increases the potency of supportive spells by shielding an ally you cast on.</li>\r\n</ul>\r\n\r\n<h4>Resolve</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Resolve.jpg\"><img alt=\"Resolve\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Resolve.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Resolve.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Resolve-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Resolve-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Resolve-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>If you&rsquo;re looking to bolster your defensive capabilities, this is your rune. Beefy tanks and engagers like Nautilus and Leona love the Resolve tree.</li>\r\n	<li>Example: Aftershock provides a burst of bonus armor and magic resist if you immobilize an enemy.</li>\r\n</ul>\r\n\r\n<h4>Inspiration</h4>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Inspiration.jpg\"><img alt=\"Inspiration\" height=\"180\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Inspiration.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Inspiration.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Inspiration-300x73.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Inspiration-600x146.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Inspiration-700x170.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<ul>\r\n	<li>Inspiration is all about breaking the rules with wacky powers and capabilities. It can be used by many different champions but is very situational.</li>\r\n	<li>Example: Unsealed Spellbook allows you to switch your summoner spells to other ones, rewarding your ability to adapt and think ahead.</li>\r\n</ul>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Rune-page.jpg\"><img alt=\"Rune Page\" height=\"598\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Rune-page.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Rune-page.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-300x242.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-600x485.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-681x550.jpg 681w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-396x320.jpg 396w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-247x200.jpg 247w, https://cdnportal.mobalytics.gg/production/2019/06/Rune-page-700x566.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>At summoner level 10, you&rsquo;ll receive full access to customize your rune page. You can create a rune page in your client outside of game or during champ select. Either way, your created rune page will stay saved until you delete it for another one or change it.</p>\r\n\r\n<p>When creating a rune page there are three main components:</p>\r\n\r\n<ul>\r\n	<li>Primary tree</li>\r\n	<li>Secondary tree</li>\r\n	<li>Shards</li>\r\n</ul>\r\n\r\n<p>Note that choosing runes can be tricky because you can only choose one rune per row, so make sure to keep that in mind.</p>\r\n\r\n<p>The primary tree grants you access to a rune tree&rsquo;s most powerful choices, known as a keystone. In total, you&rsquo;ll get four rune choices from your primary tree so make sure they&rsquo;re in line with what your champion excels at.</p>\r\n\r\n<p>The secondary tree only provides you with two choices, you&rsquo;ll want to use this to compliment your primary tree.</p>\r\n\r\n<p>Lastly, you get three choices of shards. Shards provide a little bit of flexibility independent of the five trees. For example, you can choose between having additional raw damage, more attack speed, or shorter cooldowns.</p>\r\n\r\n<p>Shards aren&rsquo;t as powerful as your primary and secondary tree but can allow you to have more flexibility to cater to your playstyle or help prepare you against a bad matchup.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-rune-build.jpg\"><img alt=\"Ashe Rune Build\" aria-describedby=\"caption-attachment-10216\" height=\"501\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/06/Ashe-rune-build.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build.jpg 740w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build-300x203.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build-600x406.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build-473x320.jpg 473w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build-295x200.jpg 295w, https://cdnportal.mobalytics.gg/production/2019/06/Ashe-rune-build-700x474.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p id=\"caption-attachment-10216\">A suggested rune build from&nbsp;<a href=\"https://app.mobalytics.gg/champions/ashe/build\">Ashe&rsquo;s champion page</a>.</p>\r\n\r\n<p>Understanding optimal rune builds can be difficult, especially as a beginner. Be sure to try them all out and check out our&nbsp;<a href=\"https://app.mobalytics.gg/champions\">champion pages</a>&nbsp;where we curate and constantly update the best rune pages for every role.</p>\r\n\r\n<h2 id=\"fiveroles\">3. The Five LoL Roles</h2>\r\n\r\n<p>In a standard game of League of Legends, each of the five players on a team is assigned to one of the five specific roles. The five roles are Top, Jungle, Mid, ADC, and Support.</p>\r\n\r\n<p>Before a match, you have the opportunity to select a primary role which indicates the role you&rsquo;d prefer to play, as well as a secondary role which represents a backup choice.</p>\r\n\r\n<p>Since roles vary in popularity, keep in mind that you are not guaranteed to get either of your primary or secondary choices. You can also choose an option to &ldquo;Fill&rdquo; which means that you don&rsquo;t mind playing any of the roles.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2018/03/client-positions.png\"><img alt=\"Positional Roles\" aria-describedby=\"caption-attachment-4240\" height=\"252\" sizes=\"(max-width: 260px) 100vw, 260px\" src=\"https://mobalytics.gg/wp-content/uploads/2018/03/client-positions.png\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/03/client-positions.png 260w, https://cdnportal.mobalytics.gg/production/2018/03/client-positions-206x200.png 206w\" width=\"260\" /></a></p>\r\n\r\n<p id=\"caption-attachment-4240\">From left to right: Top, Jungle, Mid, ADC, Support, and at the bottom, Fill.</p>\r\n\r\n<p>If you&rsquo;re a brand new player, we suggest that you spend time playing a few games of each role to get a feel for where each one operates and what each one does. Eventually, you do want to settle on a &ldquo;main&rdquo; role because it can really help you improve faster and learn to specialize a particular skill set.</p>\r\n\r\n<p>For more reasons on why you should pick a main role and some guidelines for understanding the expectations of the five roles, check out our infographic below:</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/05/main-role-infographic-updated-final.jpg\"><img alt=\"How to Choose Your Main Role in League of Legends (infographic)\" height=\"5908\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/05/main-role-infographic-updated-final.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final.jpg 900w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-768x5041.jpg 768w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-156x1024.jpg 156w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-300x1969.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-600x3939.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-780x5120.jpg 780w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-84x550.jpg 84w, https://cdnportal.mobalytics.gg/production/2019/05/main-role-infographic-updated-final-700x4595.jpg 700w\" width=\"900\" /></a></p>\r\n\r\n<p>Keep in mind that these were just guidelines regarding the five roles. The champions that are played within each role and the expectations for each often change over time as players experiment and optimize.</p>\r\n\r\n<p>For example, in Season 8, many champions that would be normally found in mid lane became temporarily commonplace at the ADC role (this is a story for another time).</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2018/12/Roles-map.jpg\"><img alt=\"League of Legends role map\" height=\"614\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2018/12/Roles-map.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/12/Roles-map.jpg 740w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-300x249.jpg 300w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-600x498.jpg 600w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-663x550.jpg 663w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-386x320.jpg 386w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-241x200.jpg 241w, https://cdnportal.mobalytics.gg/production/2018/12/Roles-map-700x581.jpg 700w\" width=\"740\" /></a>Use these guidelines to get a solid foundation for what each role in the game&rsquo;s current state (circa Season 9) to get you off your feet, but as you get better, don&rsquo;t be afraid to try things out in a Normal match. If you find a new way to play a role that works well, put it to the test in a ranked match!</p>\r\n\r\n<h2 id=\"teamcomp\">4. What is a team comp?</h2>\r\n\r\n<p>Since League of Legends is a 5 vs 5 team game, the combinations of champions that your team assembles at champ select can be incredibly important. Often times, you can greatly increase your chances of winning by synergizing the abilities and strengths of your choices.</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2018/09/Champ-select-1.jpg\"><img alt=\"Champ select\" height=\"295\" sizes=\"(max-width: 740px) 100vw, 740px\" src=\"https://mobalytics.gg/wp-content/uploads/2018/09/Champ-select-1.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2018/09/Champ-select-1.jpg 740w, https://cdnportal.mobalytics.gg/production/2018/09/Champ-select-1-300x120.jpg 300w, https://cdnportal.mobalytics.gg/production/2018/09/Champ-select-1-600x239.jpg 600w, https://cdnportal.mobalytics.gg/production/2018/09/Champ-select-1-502x200.jpg 502w, https://cdnportal.mobalytics.gg/production/2018/09/Champ-select-1-700x279.jpg 700w\" width=\"740\" /></a></p>\r\n\r\n<p>An easy example to understand is an area-of-effect team (AoE) composition. This team combines five champions who have spells and abilities that can either deal damage to multiple champions or hold multiple champions in place with crowd control.</p>\r\n\r\n<p>Every team comp tends to have a goal in mind, known as a win condition. The win condition of an AoE comp is to catch and kill multiple team members at once. If the AoE comp is able to do so, they will likely win a fight.</p>\r\n\r\n<p>Another example of a team comp would be the skirmish comp. Skirmish team comps utilize champions that have high mobility and like to fight in messy fights from multiple angles.</p>\r\n\r\n<p>A skirmish team comp would likely beat an AoE team comp because an AoE team comp would struggle to lock down multiple skirmishers at once if they play their cards right.</p>\r\n\r\n<p>Since the AoE team comp relies on powerful spells that have long cooldowns, while skirmishers have attacks and abilities that are weaker but can be cast more often, the skirmish team comp can play around the abilities of the AoE team comp.</p>\r\n\r\n<p>In the infographic below, we cover the strengths and weaknesses of the most common team compositions:</p>\r\n\r\n<p><a href=\"https://mobalytics.gg/wp-content/uploads/2019/03/League-of-Legends-team-comps.jpg\"><img alt=\"League of Legends Team Comps\" height=\"1541\" sizes=\"(max-width: 950px) 100vw, 950px\" src=\"https://mobalytics.gg/wp-content/uploads/2019/03/League-of-Legends-team-comps.jpg\" srcset=\"https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps.jpg 950w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-185x300.jpg 185w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-768x1246.jpg 768w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-631x1024.jpg 631w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-300x487.jpg 300w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-600x973.jpg 600w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-780x1265.jpg 780w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-339x550.jpg 339w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-197x320.jpg 197w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-123x200.jpg 123w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-940x1525.jpg 940w, https://cdnportal.mobalytics.gg/production/2019/03/League-of-Legends-team-comps-700x1135.jpg 700w\" width=\"950\" /></a></p>\r\n\r\n<p>If you&rsquo;re learning about the game as a new player, don&rsquo;t worry too much about creating the perfect team comp at champ select. You&rsquo;ll want to focus more on just playing your comfort champions and mastering them.</p>\r\n\r\n<p>We just wanted to introduce you since it is something that will be mentioned often in game and in other places such as if you watch pro-play or streamers.</p>', 1, NULL, 'Text Guide', '2020-11-23 08:30:00', '2020-12-08 14:59:40', '2020-12-08 14:59:40');
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(14, 4, 1, 'Best Beginner Heroes', 'viper-best-item-build', 'Get started with your first beginner hero on Dota 2!', '', '1669216270_game_guide_dota-2.jpg', 'dota-2.jpg', 'jpg', '<p>What are the best Dota 2 heroes for beginners? Getting started in Dota 2 can seem like a bit of a daunting task. 119 heroes staring at you from the pick screen, arranged in all sorts of categories, grimacing at you unattractively. Learning the game is complex enough without having to narrow down your hero choices, so we&rsquo;ve done all the hard work for you &ndash; we advise picking one of the following.</p>\r\n\r\n<p>All of the heroes play a very specific role in battle. Some of them can be played in multiple roles, sometimes even within the same game. To do well at Dota 2 it is important to understand what these roles are and how they interact with each other. But it is equally as important to realise that a hero&rsquo;s role should inform how you play them and the items you purchase.</p>\r\n\r\n<p>If you&rsquo;re finding these basics a touch confusing, don&rsquo;t worry: so did we when we started playing. But now we&rsquo;ve learned the strategies behind a great team, we can provide you with advice to help you choose the right character, and understand their position in the five-player team.</p>\r\n\r\n<p><strong>The best Dota 2 heroes are</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong><a data-target=\"Lich\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Lich\" rel=\"noopener\">Lich</a></strong></li>\r\n	<li><strong><a data-target=\"Witch_Doctor\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Witch_Doctor\" rel=\"noopener\">Witch Doctor</a></strong></li>\r\n	<li><strong><a data-target=\"Lion\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Lion\" rel=\"noopener\">Lion</a></strong></li>\r\n	<li><strong><a data-target=\"Spirit_Breaker\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Spirit_Breaker\" rel=\"noopener\">Spirit Breaker</a></strong></li>\r\n	<li><strong><a data-target=\"Bounty_Hunter\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Bounty_Hunter\" rel=\"noopener\">Bounty Hunter</a></strong></li>\r\n	<li><strong><a data-target=\"Undying\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Undying\" rel=\"noopener\">Undying</a></strong></li>\r\n	<li><strong><a data-target=\"Bristleback\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Bristleback\" rel=\"noopener\">Bristleback</a></strong></li>\r\n	<li><strong><a data-target=\"Axe\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Axe\" rel=\"noopener\">Axe</a></strong></li>\r\n	<li><strong><a data-target=\"Abaddon\" href=\"https://www.pcgamesn.com/dota/best-dota-2-heroes-beginners#Abaddon\" rel=\"noopener\">Abaddon</a></strong></li>\r\n</ul>\r\n\r\n<p><img alt=\"The \'heroes\' tab on Dota 2 - 117 heroes, some of which are the best Dota 2 heroes\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-hero-screen-124x70.jpg 124w\" title=\"best-dota-2-heroes-hero-screen\" width=\"900\" /></p>\r\n\r\n<p>Before you jump into your very first game, take some time to get acquainted with the basic ideas of Dota 2 with our&nbsp;<a href=\"https://www.pcgamesn.com/dota/dota-2-beginner-s-guide-everything-you-need-know\" target=\"_blank\">How to play Dota 2</a>&nbsp;guide, which will explain lanes and the different phases of the game.</p>\r\n\r\n<p>When you queue for a&nbsp;<a href=\"https://www.theloadout.com/dota-2/ranks\" rel=\"noopener\" target=\"_blank\">Dota 2 ranked</a>&nbsp;match, you can choose to queue either Ranked Classic or Ranked Roles. When you queue for Ranked Roles, you choose which role(s) you&rsquo;re willing to play &ndash; for some reason, everyone wants to play Core, which has led to high queue times while everyone waits to find Support players. To combat this, in order to enjoy the luxury of choosing your role, you must earn Ranked Role games through queuing with all roles selected or as hard or soft support. So if you want to play Core, you either need to bring a Support into the queue with you, or rack up some time as Support yourself.</p>\r\n\r\n<p>You can&rsquo;t play ranked until you&rsquo;ve clocked up 100 hours of unranked, which might seem like a lot &ndash; but it&rsquo;s probably for the best as Dota 2 can be a very tricky beast to figure out. You don&rsquo;t need to specify your role when queuing for unranked or turbo matches but once in-game you&rsquo;ll be working with your teammates to make sure all the positions are covered. Let&rsquo;s go through those roles now and explain exactly what they entail.</p>\r\n\r\n<p>Players sometimes describe roles in terms of their farm priority, effectively this means which hero needs to obtain the largest share of the gold and exp so they can become powerful and have a big impact on the game, or &lsquo;carry&rsquo; the game (Position 1), and which hero is going to take a relatively paltry amount of gold and exp and spend their time making sure their cores can secure these resources (Position 5). These positions usually correspond to specific lanes, but like everything else in this game, people can and do play it differently. For a new player, though, this is what your fellow players will probably mean.</p>\r\n\r\n<h2>DOTA 2 ROLES</h2>\r\n\r\n<p><img alt=\"Five heroes assemble before the game starts; Faceless Void, Ember Spirit, Oracle, Zeus and Razor, some of the best Dota 2 heroes\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-group1-124x70.jpg 124w\" title=\"best-dota-2-heroes-group1\" width=\"900\" /></p>\r\n\r\n<h3>SUPPORTS</h3>\r\n\r\n<p><strong>Hard Support (Position 5)</strong><br />\r\nThe hard support typically supports the safe lane player during the laning stage, making sure their carry can safely last-hit, whilst also trying to prevent their opponents from doing the same. They help out with denying the opponents&rsquo; creeps &ndash; particularly if the hard support is a ranged hero and the carry is melee &ndash; and also help to keep the creeps fighting a nice distance away from the tower by pulling and stacking jungle creeps. The hard support allows the rest of the team to safely take the gold and exp from the map and so they tend to be weak and poor. Sorry.</p>\r\n\r\n<p>Thankfully, observer wards are now free, so providing vision for your team won&rsquo;t plunge you into poverty. Even better, thanks to the introduction of neutral items which drop from jungle creeps, you&rsquo;ll be receiving a helpful buff around 15 mins into the game when your cores upgrade their neutral items and you can scavenge from their reject pile.</p>\r\n\r\n<p>Even though playing hard support isn&rsquo;t particularly glamorous, it&rsquo;s a great place to start for beginners. In lower skill games the success or failure of your team largely depends on how well your cores can last-hit and farm, and the mechanics of last-hitting take a while to figure out and finesse. In your first games, while you&rsquo;re still getting a feel for everything, you should really just focus on using your abilities and items properly and learning what the heroes do, and as a support you can still have a positive impact on your game with a few pennies and a pocket full of lint.</p>\r\n\r\n<p><em><strong>Lord it over &rsquo;em:</strong>&nbsp;pit&nbsp;the best Dota 2 heroes against each other in&nbsp;<a href=\"https://www.pcgamesn.com/dota-underlords\" target=\"_blank\">Dota Underlords</a></em></p>\r\n\r\n<p><strong>Soft Support (Position 4)</strong><br />\r\nThe soft support hangs out with the offlaner, in &ndash; you guessed it &ndash; the offlane (more on this later). In the offlane, you want to ruin your opponents&rsquo; laning as much as possible. If the hard support is a babysitter to their core, you&rsquo;re a bullying older brother who wants to use stuns and disables to put the opponents&rsquo; safe laner in their place. The offlaner you&rsquo;ll be laning with is also generally tougher early game than a safe laner, so the enemy should be scared of you. You want to block their jungle camps so they can&rsquo;t pull, stop them from pulling, and generally make their lane miserable.</p>\r\n\r\n<p>Often, the position 4 roams around the map, especially to the midlane, to lend them a hand by attacking &ndash; or &lsquo;ganking&rsquo; &ndash; the enemy midlaner. You&rsquo;ll usually have abilities that are useful in team fights, but might also be well placed to help push lanes.</p>\r\n\r\n<h3>CORES</h3>\r\n\r\n<p><strong>Offlane (Position 3)</strong><br />\r\nOfflane can be tricky, but it can also be liberating. You&rsquo;re trying to secure the last-hits and denies (how many you&rsquo;ve secured is your CS, or Creep Score) in the lane, so you can win the lane and put your enemies at a major disadvantage. While you do want to fight and be aggressive, don&rsquo;t underestimate the value of securing the CS over everything. Work with your support to coordinate plays &ndash; notice when you have a power advantage over the enemy, perhaps you have an extra level on them &ndash; and be proactive. Your level 6 is probably more of a significant power spike than your opposing safelaners&rsquo; level 6, because those heroes are built to be strong later in the game, whereas you peak earlier. Similarly, know when to hang back safely &ndash; sometimes you&rsquo;ll be on your own as your support pays helpful visits to other lanes.</p>\r\n\r\n<p>Once the laning stage is over, you should be focusing on objectives and shutting down the opposing team&rsquo;s plays. Hanging out in a squad with your supports is recommended, as is keeping an eye on the minimap so you can respond to pushes by defending towers while your cores farm. You should make sure the waves are pushed out as much as possible, to take control of the map for your team. Item wise, you&rsquo;ll be best served by items that benefit your team as well as yourself.</p>\r\n\r\n<p><strong>Mid (Position 2)</strong><br />\r\nMid is daunting because you&rsquo;re exposed and alone, and everyone is looking at you, much like that recurring nightmare where you&rsquo;re 13 and show up to school naked &ndash; just us? Psychological implications aside, to succeed in the middle lane you just need to be very careful, watch your positioning and manage your resources correctly. You don&rsquo;t have to be perfect, your task is only to beat the enemy midlaner &ndash; who is probably also new, so that&rsquo;s very possible.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In the middle lane, you are vulnerable to ganks by players from both top and bottom, you don&rsquo;t have trees to hide in, you usually don&rsquo;t have a buddy to hang around with, &ndash; and your carefully balanced approach can be completely upended by the power runes that spawn in the river every two minutes. Grab yourself a ward for mid &ndash; they&rsquo;re free now, so you can always ensure you have vision to keep yourself safe and informed. If you have a ranged spell, it&rsquo;s worth using it to secure last-hit on the ranged creep, because the mid lane really is about CS above all else.</p>\r\n\r\n<p>The upside of playing mid is you&rsquo;re not sharing the lane exp with anyone else on your team, meaning throughout the whole laning stage you&rsquo;re probably going to be the biggest dog in the yard, and you can and should use that advantage to help out your other lanes. Keep an eye on your minimap, and remember it&rsquo;s not the end of the world if you lose mid &ndash; just try not to lose too badly.</p>\r\n\r\n<p><strong>Safe Lane (Position 1)</strong><br />\r\nOoh, look at you, Position 1, you&rsquo;re a rock star, but actually at the beginning of the game you&rsquo;re a weak little baby. You&rsquo;re a baby who will grow up to become a farmer and later a serial killer. If you identify with this trajectory, you certainly belong in position 1, and maybe jail.</p>\r\n\r\n<p>Playing safe lane carry is both boring and flashy. Boring because you literally only need to kill creeps, farm lanes, and farm the jungle as efficiently as possible to win the game. However, it&rsquo;s flashy because at some point you&rsquo;ll emerge from the jungle to show off the high impact item you&rsquo;ve just acquired and kick everyone&rsquo;s collective ass.&nbsp;Also, as the hard carry you have an automatic right to claim all the&nbsp;<a href=\"https://www.pcgamesn.com/dota-2/neutral-items-best\" target=\"_blank\">best Dota 2 neutral items</a>&nbsp;for yourself.</p>\r\n\r\n<p>To begin with, stay safe, invest in items that help you farm, and let your teammates distract your enemies elsewhere on the map while you get gold and exp. Feel free to contribute to fights if you can get there in time to swing them in your team&rsquo;s favour, but otherwise concentrate on your personal development &ndash; hustle before tussle, as they say, or they would if they were as hamfisted as we are.</p>\r\n\r\n<p>So now you&rsquo;re ready to play your first game of Dota 2, and you&rsquo;re wondering which hero to play. We&rsquo;ve given you a list of the best heroes for beginners, but if you&rsquo;re looking for a curated, streamlined experience, I&rsquo;d suggest playing the following three heroes in order, getting comfortable with each one before moving on. We&rsquo;ll start with a hard support and move up to soft support, and then offlaner &ndash; three roles you should try out to get started in Dota 2.</p>\r\n\r\n<p><img alt=\"Lich, one of the best Dota 2 heroes, in the Dire offlane jungle.\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-lich1-124x70.jpg 124w\" title=\"best-dota-2-heroes-lich\" width=\"900\" /></p>\r\n\r\n<h2>LICH (POSITION 5)</h2>\r\n\r\n<p>Lich is a ranged intelligence hero, a blue skeleton boy who harnesses the power of frost to protect his teammates and harass his enemies. He&rsquo;s a support hero, traditionally played as a hard support, and is great fun once he reaches level 6. If his foes cluster too close together, he launches his devastating ultimate &ndash; Chain Frost &ndash; which bounces between them, doing a hefty chunk of damage that might just kill them&nbsp;all if they&rsquo;re squishy enough.</p>\r\n\r\n<ul>\r\n	<li><strong>Frost Blast</strong></li>\r\n</ul>\r\n\r\n<p>Target an enemy and cast Frost Blast to dump ice on their heads like that charity bucket challenge. This does both direct damage and additional damage in a small radius of the target. The foe&rsquo;s attack and movement speed is reduced for 4 seconds, and the cooldown is pretty short. Skilling this first and blasting foes as you contest the bounty runes is the way to go &ndash; using it as often as possible on a squishy hero combined with some right clicks can even secure a kill.</p>\r\n\r\n<ul>\r\n	<li><strong>Frost Shield</strong></li>\r\n</ul>\r\n\r\n<p>Cast on your allies, yourself, or your buildings to apply a shield that gives the target resistance against attack damage. The shield lasts for 6 seconds and releases a pulse of ice magic every second, damaging, and slowing any enemies in range. The cast range on this is pretty large, and you should use this to protect your carry or yourself in case of particularly intense negative attention from your foes. Alternatively, coordinate an attack with your lane partner &ndash; they go for the enemy, you cast Frost Shield on them and they can withstand much more retaliation, and as they chase, the pulses from the shield slow the enemy down.</p>\r\n\r\n<ul>\r\n	<li><strong>Sinister Gaze</strong></li>\r\n</ul>\r\n\r\n<p>Your eyes meet from across the bar. You feel the magnetism immediately &ndash; as if some powerful force is drawing the two of you together. Your feet, as if they&rsquo;ve a mind of their own, carry you forward, you can&rsquo;t look away; you&rsquo;re literally incapable of breaking this spell. You feel your mana being sapped at a rate of 10/15/20/25%. Now you&rsquo;re face to face with him &ndash; Ethreain, the frost mage. He dumps a bucket of ice on your head.</p>\r\n\r\n<ul>\r\n	<li><strong>Chain Frost</strong></li>\r\n</ul>\r\n\r\n<p>Lich hurls the most painful of snowballs, one made entirely of ice. This projectile bounces between enemy units on impact and will bounce up to ten times. In the early game, while your enemies are still relatively weak, the impact can be devastating &ndash; just try to avoid casting it while there are too many enemy creeps in the vicinity because it&rsquo;ll bounce to them, too, which is a waste.</p>\r\n\r\n<h3>SUGGESTED ITEMS:</h3>\r\n\r\n<p>It&rsquo;s generally a good idea to head out to the lane with a pocket full of regen, which you will be using to heal yourself after trading attacks with your opponents. This war of attrition is lost by whoever runs out of regen first, meaning they can&rsquo;t assert their presence properly until they heal or ferry themselves some more regen. Two sets of tangos &ndash; at least &ndash; are advised, and it&rsquo;s generally expected you share a couple with your mid laner. We&rsquo;d recommend filling your bags with a couple of juicy Mangos for an instant injection of mana.</p>\r\n\r\n<p>Once you&rsquo;ve earned some gold in lane, we suggest making use of your trusty courier to bring you items, depending on how your lane is going. Send your faithful friend to fetch your Magic Stick as soon as you can afford it, or stuff it full of Mangos so you can keep up the aggression. At lower levels your donkey pal is particularly vulnerable &ndash; before he gains wings at level 4, he can only slowly dodder toward you on stubby little legs, so you may need to do some babysitting to ensure he doesn&rsquo;t run into any trouble.</p>\r\n\r\n<ul>\r\n	<li><strong>Magic Wand</strong></li>\r\n</ul>\r\n\r\n<p>Buy a Magic Stick as soon as you have 200 gold &ndash; it can give you the little boost of health or mana you might need to secure a kill or avoid dying. Upgrade it to a Magic Wand after you&rsquo;ve got your Brown Boots.</p>\r\n\r\n<ul>\r\n	<li><strong>Boots of Speed&nbsp;</strong>(Brown Boots)</li>\r\n</ul>\r\n\r\n<p>Sure, you look basic af, but Boots of Speed also make you faster. You can buy them for 500 gold, and the extra movement speed is really going to help, so get them as soon as you can afford it. So what if Lich doesn&rsquo;t have feet, that&rsquo;s none of your business.</p>\r\n\r\n<ul>\r\n	<li><strong>Aether Lens</strong></li>\r\n</ul>\r\n\r\n<p>Next you&rsquo;ll want to grab an Aether Lens, which increases the range of your abilities and gives you more mana. If you buy the Energy Booster from the secret shop first, it will upgrade your boots to Arcane Boots which can be activated to give you and your nearby allies a boost of mana. When you&rsquo;re ready to make your Aether Lens, right click and disassemble your Arcane Boots, then right click on your Energy Booster and select Unlock Combining.<iframe data-is-safeframe=\"true\" data-load-complete=\"true\" frameborder=\"0\" height=\"1\" id=\"google_ads_iframe_/6928793/PCGamesN-MPU2_1\" marginheight=\"0\" marginwidth=\"0\" name=\"\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" scrolling=\"no\" src=\"https://c2b31e44659bf9acaf04491f12ac7541.safeframe.googlesyndication.com/safeframe/1-0-37/html/container.html?upapi=true\" title=\"3rd party ad content\" width=\"1\"></iframe></p>\r\n\r\n<ul>\r\n	<li><strong>Glimmer Cape</strong></li>\r\n</ul>\r\n\r\n<p>As well as being incredibly fashionable, Glimmer Cape makes you invisible for a short time, and increases your magic resistance, allowing you to get out of sticky situations in a pinch. Being invisible in low skill games is great because your enemies probably won&rsquo;t be carrying the items necessary to find you, so you can laugh at their confusion while you make a hasty retreat. You can use it on your friends, too, if they need to avoid an awkward encounter.</p>\r\n\r\n<ul>\r\n	<li><strong>Force Staff</strong></li>\r\n</ul>\r\n\r\n<p>Have you ever had someone shove you really hard in the back and you go flying in the direction you were facing? Seriously, just us again? Well if you buy a force staff, you can shove yourself in the back. Trust us, that&rsquo;s a good thing. You can also help your teammates by shoving them, too.</p>\r\n\r\n<h3>LICH ALTERNATIVES</h3>\r\n\r\n<p>Enjoyed playing position 5 but fancy trying something else? Try&nbsp;<strong>Witch Doctor</strong>&nbsp;<a id=\"Witch_Doctor\" name=\"Witch_Doctor\" rel=\"noopener\" target=\"_blank\"></a>&ndash; he has a fantastic set of abilities &ndash; a stun, a heal, a percentage based damage over time spell, and a high damage single target channeled ultimate, meaning you can take down an enemy hero all on your own if the conditions are right.</p>\r\n\r\n<p>Or have a go at&nbsp;<strong>Lion<a id=\"Lion\" name=\"Lion\" rel=\"noopener\" target=\"_blank\"></a></strong>, who has a stun, a hex (turns enemies into frogs!) a mana draining spell, and a really big strong finger which hurts people when he points at them.</p>\r\n\r\n<p><img alt=\"Spirit Breaker, one of the best Dota 2 heroes, snarling at the enemy from the midlane\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-spirit-breaker-1-124x70.jpg 124w\" title=\"best-dota-2-heroes-spirit-breaker-1\" width=\"900\" /></p>\r\n\r\n<h2>SPIRIT BREAKER (POSITION 4)<a id=\"Spirit_Breaker\" name=\"Spirit_Breaker\" rel=\"noopener\"></a></h2>\r\n\r\n<p>Spirit Breaker is a rampaging cow, the worst fear of countryside ramblers everywhere. Picture this: you&rsquo;re strolling along the riverbank when, like a foghorn, an almighty &lsquo;Mooooo&rsquo; pierces the air. A huge blue cow barrels toward you and conks you in the noggin. Bam. That&rsquo;s Spirit Breaker.</p>\r\n\r\n<p>He&rsquo;s a melee strength hero, and is best played in the offlane as a position 4 &ndash; he&rsquo;s useful without items and doesn&rsquo;t farm very well, which is pretty ironic, really. Spirit Breaker is what&rsquo;s known as a roamer or a ganker &ndash; he wants to catch vulnerable enemies unawares and headbutt them straight into the afterlife. In the lane, against a melee carry you can play pretty aggressively &ndash; skill bash first and punch &lsquo;em. Then once you get Charge of Darkness, you can start to make your presence known across the rest of the map.&nbsp;&nbsp;</p>\r\n\r\n<ul>\r\n	<li><strong>Charge of Darkness</strong></li>\r\n</ul>\r\n\r\n<p>Spirit Breaker charges toward an enemy target, passing through all objects on his way. Any enemy he hits on the way to his target, along with his target, are affected by Greater Bash (see below). The cast range on this is global, which means anyone SB can see can be targeted from anywhere on the map. See vulnerable enemy, charge them, secure kill, moo triumphantly.</p>\r\n\r\n<ul>\r\n	<li><strong>Bulldoze</strong></li>\r\n</ul>\r\n\r\n<p>Activate this to gain movement speed and status resistance for 8 seconds. You&rsquo;ll want to activate this mid charge to ensure nothing can stop you in your relentless pursuit of the target. This is one of the few things you can cast while charging, alongside items like Shadow Blade and Phase Boots.</p>\r\n\r\n<ul>\r\n	<li><strong>Greater Bash</strong></li>\r\n</ul>\r\n\r\n<p>When your high school rival holds a party on the same day as yours, you&rsquo;ll feel the sting of a Greater Bash. Sigh. Anyway this is a passive skill, which means you don&rsquo;t have to activate it yourself &ndash; it&rsquo;s always on. When attacking, Spirit Breaker has a percentage chance to Greater Bash, which stuns the target, knocks them back, and increases your movement speed. Greater Bash also does damage based on your movement speed.</p>\r\n\r\n<ul>\r\n	<li><strong>Nether Strike</strong></li>\r\n</ul>\r\n\r\n<p>Spirit Breaker&rsquo;s ultimate ability. He slips into the nether realm and when he comes out, he headbutts the target really, really hard &ndash; a Greater Bash with extra damage and knockback.</p>\r\n\r\n<h3>SUGGESTED ITEMS:</h3>\r\n\r\n<p>Start with a couple of tangos and a healing salve, as well as an Orb of Venom.</p>\r\n\r\n<ul>\r\n	<li><strong>Orb of Venom</strong></li>\r\n</ul>\r\n\r\n<p>Orb of Venom adds a nasty sting to your attacks, poisoning the enemy for 5 magical damage per second over 3 seconds and slowing them too. Ouch.</p>\r\n\r\n<ul>\r\n	<li><strong>Bracer</strong></li>\r\n</ul>\r\n\r\n<p>A bracer on Spirit Breaker is great because as a strength hero, he really benefits from the extra stats. The bracer makes SB able to withstand a little more and become even more of a threatening presence early.</p>\r\n\r\n<ul>\r\n	<li><strong>Boots of Speed -&gt; Power Treads</strong></li>\r\n</ul>\r\n\r\n<p>Get your brown boots as soon as you can afford them. Spirit Breaker loves shoes because they make him faster and thus make him do more damage. Upgrade them to Power Treads, which you&rsquo;ll want to switch to Red (Strength).</p>\r\n\r\n<ul>\r\n	<li><strong>Urn of Shadows &ndash; &gt; Spirit Vessel</strong></li>\r\n</ul>\r\n\r\n<p>Urn of Shadows can be cast on either your friends or your foes, in which case it heals 240 health over time or does 200 damage over time, respectively. During the early game when enemies are weak, 200 damage is a big deal, so cast it as soon as you arrive on the scene to add extra damage to your ganks. Later on you can upgrade it into a Spirit Vessel, which will do much the same thing but with percentage-based damage, making it a must against tanky heroes.</p>\r\n\r\n<ul>\r\n	<li><strong>Blade Mail</strong></li>\r\n</ul>\r\n\r\n<p>When activated, Blade Mail makes you really spiky for 4.5 seconds, meaning anyone who tries to hurt you also receives the same damage you do. It also passively returns 20+20% of any attack damage you take. Spirit Breaker is often the first one on the scene in team fights, so for the first few seconds is expected to soak up the brunt of the enemy&rsquo;s attacks. Popping your Blade Mail will ensure they&rsquo;re weakened by attacking you, swinging the tide of the battle in your favour.</p>\r\n\r\n<h3>SPIRIT BREAKER ALTERNATIVES</h3>\r\n\r\n<p>Enjoyed Spirit Breaker? If you like taking a more active role and playing around the map, we&rsquo;d recommend trying&nbsp;<strong>Bounty Hunter</strong>,&nbsp;<a id=\"Bounty_Hunter\" name=\"Bounty_Hunter\" rel=\"noopener\" target=\"_blank\"></a>who uses invisibility to run around, steal gold, and track enemy heroes, ruining their farm.</p>\r\n\r\n<p>If you enjoy being a Big Boi, try&nbsp;<strong>Undying</strong>,<a id=\"Undying\" name=\"Undying\" rel=\"noopener\" target=\"_blank\"></a>&nbsp;who steals strength from his enemies, harasses them with zombies, and transforms into a monstrously large flesh golem. I know you&rsquo;ve always felt like there was a flesh golem inside you, waiting to break free.</p>\r\n\r\n<p><img alt=\"One of the best Dota 2 heroes, Bristleback, unleashes his quills\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-bristleback-quill-spray-124x70.jpg 124w\" title=\"best-dota-2-heroes-bristleback-quill-spray\" width=\"900\" /></p>\r\n\r\n<h2>BRISTLEBACK (POSITION 3)<a id=\"Bristleback\" name=\"Bristleback\" rel=\"noopener\"></a></h2>\r\n\r\n<p>The most aggressive hedgehog you&rsquo;ve ever met, Bristleback will sneeze on you and then turn you into a pincushion. Bristleback is pretty simple to play &ndash; he shoots out quills, which do more damage the more times an enemy has been hit by them. This means the longer Bristleback hangs around in the fight, the more damage he can do &ndash; and his abilities mean he&rsquo;s really difficult to kill. Items for Bristleback focus on turning him into a formidable tank who is hard to kill and hard to escape from.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bristleback is a great offlaner to start off with because his tankiness makes him more forgiving to play in case you go out of position as you learn the game, and his quill spray makes farming super easy.</p>\r\n\r\n<ul>\r\n	<li><strong>Viscous Nasal Goo</strong></li>\r\n</ul>\r\n\r\n<p>Cast this on your foes to reduce their armour and movement speed, and also to disgust them. The effect stacks, so if you sneeze enough you can seriously slow your enemy down.</p>\r\n\r\n<ul>\r\n	<li><strong>Quill Spray</strong></li>\r\n</ul>\r\n\r\n<p>Shoot out your quills in a radius around you, dealing additional damage based on how many quills are already stuck in your foe. Since it hits everything in a circular radius, this is a great skill for pushing out lanes or for farming creeps in the jungle. To make the most of this, you should stack camps so you can farm super efficiently &ndash; we&rsquo;ll explain stacking later on.</p>\r\n\r\n<ul>\r\n	<li><strong>Bristleback</strong></li>\r\n</ul>\r\n\r\n<p>Bristle got back, and you can&rsquo;t touch. When attacked from the side or the rear, Bristleback takes reduced damage. The rear is better protected than the side, and when he receives a certain amount of damage to his derri&egrave;re, he automatically unleashes a retaliatory quill spray which costs no mana. This makes pursuing a retreating Bristleback very difficult and potentially painful, especially if you have low HP teammates around, who will be incredibly unhappy if the extra dose of acupuncture provoked by your attack causes them to die.</p>\r\n\r\n<ul>\r\n	<li><strong>Warpath</strong></li>\r\n</ul>\r\n\r\n<p>The more stacks Bristleback has built up, the more movement speed and attack damage he has. Basically, you are encouraged to spray and sneeze as much as possible &ndash; advice you should absolutely leave in the game world.&nbsp;</p>\r\n\r\n<h3>SUGGESTED ITEMS:</h3>\r\n\r\n<p>You should start off with some tangos, a Ring of Protection for some extra armour, and a Quelling Blade, which increases the damage you do to creeps, making it much easier for you to last hit.</p>\r\n\r\n<ul>\r\n	<li><strong>Boots of Speed -&gt; Phase Boots</strong></li>\r\n</ul>\r\n\r\n<p>You know the score by now, buy shoes for your little hedgehog feet so you can walk faster. Phase Boots give Bristleback even more movement speed, so he can hunt people down more easily.</p>\r\n\r\n<ul>\r\n	<li><strong>Ring of Health</strong></li>\r\n</ul>\r\n\r\n<p>Extra health regen, making you tankier to begin with, and also builds into two items you&rsquo;ll want later on, Vanguard and Hood of Defiance.&nbsp;Conveniently, it&rsquo;s available at the secret shop.</p>\r\n\r\n<ul>\r\n	<li><strong>Soul Ring</strong></li>\r\n</ul>\r\n\r\n<p>Gives you strength and even more health regen, and also allows you to sacrifice some of your health for mana, which will allow you to quill spray even more.</p>\r\n\r\n<ul>\r\n	<li><strong>Magic Wand</strong></li>\r\n</ul>\r\n\r\n<p>The wand is basically great on all Dota 2 heroes, especially heroes like Bristleback who can really use the periodic injection of mana to great effect.</p>\r\n\r\n<ul>\r\n	<li><strong>Vanguard -&gt; Crimson Guard</strong><br />\r\n	OR<br />\r\n	<strong>Hood of Defiance -&gt; Pipe of Insight</strong></li>\r\n</ul>\r\n\r\n<p>Which one of these you want basically depends on whether you&rsquo;re facing physical damage (Vanguard) or magic damage (Hood of Defiance). You probably have no idea which one you&rsquo;re up against because you&rsquo;re new to the game, but as a general rule, most abilities do magic damage, and right clicks do physical damage. It&rsquo;s a good idea to get into the habit of reading what your enemies&rsquo; skills do anyway, so do your homework before you decide. Both of these items protect your team as well as yourself when upgraded, so your buddies will thank you.</p>\r\n\r\n<ul>\r\n	<li><strong>Solar Crest</strong></li>\r\n</ul>\r\n\r\n<p>Solar Crest provides extra stats, mana and movement speed for Bristleback, and when cast on an enemy, removes some of their armour and reduces their movement speed, whilst also removing armour from Bristleback himself. This is great to use in combination with your nasal goo, which also reduces their armour and movement speed, meaning the physical damage of your quill spray will really hurt.</p>\r\n\r\n<ul>\r\n	<li><strong>Shiva&rsquo;s Guard</strong></li>\r\n</ul>\r\n\r\n<p>Shiva&rsquo;s Guard gives you even more armour and mana, and when activated emits a freezing wave that damages and slows enemies. This in combination with your goo will slow them to a crawl, leaving them unable to escape from your pointy wrath.</p>\r\n\r\n<ul>\r\n	<li><strong>Heart of Tarrasque</strong></li>\r\n</ul>\r\n\r\n<p>The Heart makes you super tanky &ndash; on top of the stats it gives you, it also o increases your passive health regeneration by 50% if you haven&rsquo;t taken damage recently. If you&rsquo;ve taken a bunch of damage, retreat for a little while then turn around and charge right back in at full health again.</p>\r\n\r\n<h3>BRISTLEBACK ALTERNATIVES</h3>\r\n\r\n<p>If you liked playing Bristleback, we&rsquo;d suggest other tanky offlaners like&nbsp;<strong>Axe</strong><a id=\"Axe\" name=\"Axe\" rel=\"noopener\" target=\"_blank\"></a>, who can taunt enemies in a radius around him, give enemies a damage-over-time debuff, and has a chance to automatically swing his axe when he&rsquo;s attacked, doing damage to all nearby enemies. Plus his ultimate instantly kills low hp enemies, which is satisfyingly brutal.</p>\r\n\r\n<p>There&rsquo;s also&nbsp;<strong>Abaddon<a id=\"Abaddon\" name=\"Abaddon\" rel=\"noopener\" target=\"_blank\"></a></strong>&nbsp;who casts a painful mist, a powerful shield, a debuff applied on every fourth hit, and whose ultimate causes him to heal from damage instead.</p>\r\n\r\n<p><img alt=\"The Dire team assemble - made up of some of the best Dota 2 heroes\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/dota-2-heroes-group-2-124x70.jpg 124w\" title=\"best-dota-2-heroes-group-2\" width=\"900\" /></p>\r\n\r\n<h2>DOTA 2 TIPS FOR BEGINNERS</h2>\r\n\r\n<p>So now you have a selection of heroes to try out, we&rsquo;re going to give you a couple of extra tips that will give you the best chance of winning those early games and hopefully start the dopamine reward cycle that gets you hooked on Dota. These Dota 2 hero tips are primarily for supports, but if they&rsquo;re not being done at all, they should be.</p>\r\n\r\n<h3>PULLING AND STACKING</h3>\r\n\r\n<p>So you know how there are camps of neutral creeps hanging out in the jungle, who mind their own business until someone comes up and interferes with their picnic? We&rsquo;re going to interfere with their picnic. We want the lane creeps to fight each other pretty close to our tower for safety, so if for whatever reason the party is taking place too far away from the tower and your carry is looking uncomfortable, you can go and round up the squad from the jungle, antagonise them into following you and lead them straight into the path of your incoming friendly lane creeps, who then follow the jungle creeps back into the jungle and start attacking them.</p>\r\n\r\n<p>Then the enemy creeps will have to travel further toward your tower to meet their counterparts in the lane, and so your carry gets to hang out in safe territory once again. This is called pulling. This can give you a huge advantage, and if you&rsquo;re playing against other new players they will probably let you get away with it. Even if your enemy tries to stop you, you&rsquo;ve just distracted them from causing trouble in the lane, so it&rsquo;s worth the effort.</p>\r\n\r\n<p><iframe data-is-safeframe=\"true\" data-load-complete=\"true\" frameborder=\"0\" height=\"1\" id=\"google_ads_iframe_/6928793/PCGamesN-MPU2_3\" marginheight=\"0\" marginwidth=\"0\" name=\"\" sandbox=\"allow-forms allow-popups allow-popups-to-escape-sandbox allow-same-origin allow-scripts allow-top-navigation-by-user-activation\" scrolling=\"no\" src=\"https://c2b31e44659bf9acaf04491f12ac7541.safeframe.googlesyndication.com/safeframe/1-0-37/html/container.html?upapi=true\" title=\"3rd party ad content\" width=\"1\"></iframe></p>\r\n\r\n<p>One camp of jungle creeps isn&rsquo;t strong enough to take care of a whole creep wave, so to deny the whole wave, you&rsquo;ll need to either pull through or stack the camp. Stay with us here, very few new players will know this, so you&rsquo;ll be the coolest and cleverest, promise. You can pull through by aggro-ing the other jungle camp and walking towards the fighting lane creeps just as the last jungle creeps from the first camp die. This takes practice and timing and is easy to mess up, so I would suggest stacking the camp instead.</p>\r\n\r\n<p>Creeps spawn in the jungle camps on the minute mark, provided the camps are empty. If you wander past and aggro the creeps about 5 seconds before this happens, the creeps will be outside the camp following you when the minute ticks over, meaning the empty camp will replenish itself even though its previous occupants are still alive. The original creeps then get bored and go back to their home which is now full of strangers, remaining there in a double occupancy situation.</p>\r\n\r\n<p>You can then drag some of them out to meet the next creep wave at about 15 seconds past the minute, and the combined forces of a stacked camp will be enough to deny the entire wave.</p>\r\n\r\n<p>If you can get the entire friendly wave to die to jungle creeps, then you&rsquo;re doing a fantastic job. This is actually a really big deal! You&rsquo;ve essentially denied your opponents an entire wave&rsquo;s worth of exp, which matters a ton at the start of the game. Remember these little advantages you give to your carry are everything, because they&rsquo;re going to take them and snowball.</p>\r\n\r\n<h3>WARDING</h3>\r\n\r\n<p>An eyeball on a stick is arguably one of the most powerful items in the game. Powerful in a kind of philosophical zen master kind of way &ndash; you can&rsquo;t actually hurt anyone with it, you just stick it in the ground like a little flag in a sandcastle and it tells you what it can see. Information is power, and knowing where the enemy heroes are &ndash; or aren&rsquo;t &ndash; will dictate where your team can safely farm, where the enemies are trying to sneak up on you, and where a vulnerable enemy is hanging out.&nbsp;</p>\r\n\r\n<p>There are two types of wards, observer wards and sentry wards. Observer wards are yellow and give vision &ndash; enemies can&rsquo;t see where you&rsquo;ve put them, unless they put down a sentry ward. Sentry wards are blue and reveal invisible units in a radius around them. If you think the enemy has an observer ward down somewhere, you can deward it by placing a sentry and attacking the enemy observer. Killing it gives you a small amount of gold and exp bounty, and is very satisfying.</p>\r\n\r\n<p>There are some frequently used ward spots across the map, usually on cliffs, marked with an eye painted on the ground. Because they&rsquo;re high up, wards placed here have unobstructed vision &ndash; but because they&rsquo;re so convenient, they&rsquo;re often dewarded by the enemy team.</p>\r\n\r\n<p><img alt=\"Dire\'s Ancient, fated to be destroyed or defended by the best Dota 2 heroes\" data-src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-900x506.jpg\" data-srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-124x70.jpg 124w\" height=\"506\" sizes=\"(max-width: 900px) 100vw, 900px\" src=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-900x506.jpg\" srcset=\"https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-900x506.jpg 900w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-213x120.jpg 213w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-740x416.jpg 740w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-768x432.jpg 768w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-580x326.jpg 580w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-297x167.jpg 297w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-183x103.jpg 183w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-280x158.jpg 280w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-263x148.jpg 263w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-233x132.jpg 233w, https://www.pcgamesn.com/wp-content/uploads/2019/10/best-dota-2-heroes-ancient-124x70.jpg 124w\" title=\"best-dota-2-heroes-ancient\" width=\"900\" /></p>\r\n\r\n<p>Congratulations, you have filled your brain completely to capacity with Dota 2 knowledge. Now it is time to apply everything you&rsquo;ve learned, or the random snippets you can remember, by jumping into a real match. You may want to practice against bots just to get used to casting spells, buying and using items, and other basic mechanics. However, once you feel comfortable we suggest you jump in to playing with and against real people as soon as possible.</p>\r\n\r\n<p>Dota 2 is such a difficult, complex, and occasionally beautiful game, and it will take you quite a while to even learn the basics &ndash; there&rsquo;s no getting around it. What&rsquo;s more, some new players have found their reception to be a little less than friendly. You may well receive some choice expletives from your teammates in the process of learning, but take our advice &ndash; just mute them. Explain you&rsquo;re new and if people aren&rsquo;t helpful, just mute them. They don&rsquo;t know anything about the game either, they&rsquo;re just being mean.</p>\r\n\r\n<p>Conversely, there are a ton of people out there who&rsquo;d be eager to help out a new player, and if you have a microphone, I&rsquo;d encourage you to communicate with your team and maybe pick up some friends to queue with. Make use of the plentiful resources and guides available to you, such as&nbsp;<a href=\"https://www.youtube.com/playlist?list=PLwL7E8fRVEdcbW1m5DuqY0QNqTIR0CyBe\" rel=\"noopener\" target=\"_blank\">Purge&rsquo;s Learn Dota series</a>.</p>\r\n\r\n<p>Congratulations on taking your first steps into Dota 2 &ndash; we fully expect to see you competing on stage at The International next year.</p>', 1, NULL, 'Text Guide', '2020-11-23 08:31:34', '2020-12-02 02:38:33', NULL);
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(15, 4, 1, 'Tower Aggro Guide', 'invoker-item-builds', 'Learn how to tackle towers like a pro in our exclusive Dota 2 guide.', '', '264843414_game_guide_maxresdefault (9).jpg', 'maxresdefault (9).jpg', 'jpg', '<p><strong>Introduction</strong></p>\r\n\r\n<p>More often than not, people will say: &ldquo;Gosh, the tower always switches to me when I go under it! Funny thing is, it never switches when my enemy goes. Haha.&rdquo; or &ldquo;If ONLY the tower did switch to that hero, I&rsquo;d have killed him!&rdquo;, as if randomness took its place in the decision of a tower&rsquo;s target. Well, first things first:</p>\r\n\r\n<p>RANDOMNESS IS THE LEAST IMPORTANT FACTOR IN THE DECISION OF A TOWER&rsquo;S TARGET!</p>\r\n\r\n<p>Meaning: Tower has priorities, and randomness only takes its place if you are dividing a &ldquo;priority level&rdquo; with someone else. And even so, as you shall see in this guide, it is not &ldquo;random&rdquo; in fact. So, arguably, we could say that there is NOTHING random in a tower&rsquo;s decision to attack.</p>\r\n\r\n<p><strong>Tower Priority</strong></p>\r\n\r\n<p>Let&rsquo;s talk about what matters, and what is the skeleton of this guide: The tower priority.</p>\r\n\r\n<p>I&rsquo;ll explain how it works:</p>\r\n\r\n<p>This is the priority list for a tower&rsquo;s target, with 1 being top priority:</p>\r\n\r\n<ol>\r\n	<li>Closest enemy hero attacking a friendly hero with auto attack</li>\r\n	<li>Closest enemy unit attacking a friendly hero with auto attack</li>\r\n	<li>Closest enemy unit or hero attacking the tower itself with auto attack</li>\r\n	<li>Closest enemy unit or hero attacking any friendly unit with auto attack</li>\r\n	<li>Closest enemy unit or hero</li>\r\n	<li>Closest enemy catapult</li>\r\n</ol>\r\n\r\n<p>And these are the &ldquo;Reseters&rdquo; (I am hereby defining the following things as &ldquo;Reseters&rdquo;, and this is how I&rsquo;ll call them throughout the guide, even in the videos), meaning: the tower resets its priority search, if one of the following happens:</p>\r\n\r\n<ul>\r\n	<li>The targeted enemy unit or hero dies</li>\r\n	<li>An enemy unit or hero targets a friendly unit or hero</li>\r\n	<li>An enemy hero being attacked by the tower manually attacks an enemy unit or hero (This is the famous tower target switch technique, where you A-attack one of your creeps to &ldquo;reset the aggro&rdquo;)</li>\r\n</ul>\r\n\r\n<p>Some observations have to be made:</p>\r\n\r\n<ul>\r\n	<li>There is nothing random in the process. It is an algorithm: The tower will recognize the target with the highest priority in the moment, and will attack it to death if no Reseter occurs</li>\r\n	<li>Spells ARE NOT AUTO-ATACK. This means you can spam spells under a tower and it won&rsquo;t switch.</li>\r\n	<li>Auto-cast spells (like Frost Arrows, Searing Arrows, Arcane Orb), even though are &ldquo;attacks&rdquo;, count as SPELLS for the tower IF YOU CAST THEM AT THE ENEMY INSTEAD OF USING THROUGH AUTO-CAST AND RIGHT-CLICK. Like before, you can spam them under a tower and it won&rsquo;t switch.</li>\r\n	<li>Think about it this way: The tower chooses someone, based on its priority and sticks to it until it dies (a priori). A reseter induces a memory loss on the tower. Then it chooses another unit, based on its priority, and sticks to it until it dies. And so on.</li>\r\n	<li>You may have noticed the list is a bit different from the wiki. The wiki&rsquo;s list is wrong, this is the right one. You can test it yourself : ).</li>\r\n</ul>\r\n\r\n<p>So, now we have the skeleton. But the skeleton is important, so let&rsquo;s do it one more time, but with another approach.</p>\r\n\r\n<p><strong>I&rsquo;ll explain the process in a lucid way now:</strong></p>\r\n\r\n<p>I am the tower. I am the almighty tower. There comes some units!</p>\r\n\r\n<p>IS SOMEONE ATTACKING MY HEROES NEAR ME?????<br />\r\nOh, no? Ok&hellip;<br />\r\nIS SOMEONE ATTACKING ME????<br />\r\nOh, no? Ok&hellip;<br />\r\nIS SOMEONE ATTACKING SOMEONE THAT I LIKE???<br />\r\nOh, there is a creep attacking one of my creeps! I&rsquo;ll KILL IT!<br />\r\nOh, yeah! DEAD!<br />\r\n[Memory Loss]<br />\r\n???? I am the tower. I am the almighty tower. Hey, there are some units nearby!<br />\r\nIS SOMEONE ATTACKING MY HEROES NEAR ME?????<br />\r\nOh, no? Ok&hellip;<br />\r\nIS SOMEONE ATTACKING ME????<br />\r\nOh, a pesky Sven is attacking me! I&rsquo;ll kill him!<br />\r\n[Sven retreats a bit, in order not to be close to the tower, and A-attack a creep]<br />\r\n[Memory Loss]<br />\r\n???? I am the tower. I am the almighty tower. Hey, there are some units nearby!<br />\r\n(and so on.)</p>\r\n\r\n<p><strong>Program-like</strong></p>\r\n\r\n<p>Now, if you are familiar with programming, I&rsquo;ll make a pseudo-algorithm to illustrate (mind me, there&rsquo;s a long time I don&rsquo;t play with programming):</p>\r\n\r\n<p>if priority 1:<br />\r\nattack target until RESETER, then go back to beginning<br />\r\nelse:<br />\r\nif priority 2:<br />\r\nattack target until RESETER, then go back to beginning<br />\r\nelse:<br />\r\nif priority 3:<br />\r\nattack target until RESETER, then go back to beginning<br />\r\nelse:<br />\r\nif priority 4:<br />\r\nattack target until RESETER, then go back to beginning<br />\r\nelse:<br />\r\nif priority 5:<br />\r\nattack target until RESETER, then go back to beginning<br />\r\nelse:<br />\r\nif priority 6:<br />\r\nattack target until RESETER, then back to beginning<br />\r\nelse:<br />\r\nback to beginning</p>\r\n\r\n<p><strong>Ways to abuse the knowledge</strong></p>\r\n\r\n<p>Well, most people say every knowledge is only as good as its applications. So, let&rsquo;s begin with some strategies:</p>\r\n\r\n<p>Tower Diving<br />\r\n<br />\r\nThe important aspects to remember here are:</p>\r\n\r\n<ul>\r\n	<li>Spells are not Reseters. Abuse this.</li>\r\n	<li>Switch targets (A-attack your creeps when they are in a higher-priority state) when you disengage the enemy.</li>\r\n	<li>If you have another Hero with you (which is highly advised when you dive a tower), you two can effectively switch the tower&rsquo;s aggro. Notice that some times this will be a two-man job: both of you will have to do your part on changing the aggro.</li>\r\n</ul>\r\n\r\n<p>Pushing</p>\r\n\r\n<p>There is really only one aspect to remember here:</p>\r\n\r\n<ul>\r\n	<li>Switch targets. If you can tank the tower safely for your creeps, do so, switching the tower&rsquo;s aggro to you. If tanking the tower will not be a safe decision, let the creeps do it, and change aggro to them if the tower begins hitting you.</li>\r\n</ul>', 1, NULL, 'Text Guide', '2020-11-23 08:32:27', '2020-12-02 02:44:17', NULL),
(16, 4, 1, 'Jungle Basics', 'pugna-item-builds', 'Learn how to tackle the Jungle with our basic guide!', '', '1486191160_game_guide_maxresdefault (8).jpg', 'maxresdefault (8).jpg', 'jpg', '<p>Jungling in Dota is a difficult job, but when done properly, can be the difference between winning a game and losing one.</p>\r\n\r\n<p>While a dedicated jungler is not required in many games, picking a jungler provides a number of benefits, including securing a large amount of farm and the ability to gank lanes to assist a struggling teammate.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>In this guide, we&#39;ll go over which heroes make for strong junglers, how to effectively farm neutral creeps, and what to do to counter the opponents&#39; jungle game.</p>\r\n\r\n<h2><strong>Jungler Heroes</strong></h2>\r\n\r\n<p>Junglers excel at efficiently farming neutral creeps at the beginning of the game. As a game progresses, other heroes become more than capable of taking down neutral creeps on their own, but the jungler is uniquely suited to clearing out neutral camps without much difficulty.</p>\r\n\r\n<p>Broadly, junglers come in two varieties. They can either sustain themselves through the damage done by neutral creeps, or they can summon minions or convert neutral creeps to take damage in their stead. No matter what kind of jungler you pick, it is important to pick up items that increase health and mana regeneration, as they need to be able to stay in the fight for as long as possible without going back to base to ensure they farm effectively.</p>\r\n\r\n<figure><img src=\"https://dqrt72khb0whk.cloudfront.net/uploads/image/file/14283/cropped_Axe.jpg?ts=1489608976\" />\r\n<figcaption>&nbsp;</figcaption>\r\n</figure>\r\n\r\n<p>Junglers with a focus on survivability typically have one or more abilities that allow them to either heal through lifesteal, or are capable of dealing high amounts of damage in a short period of time. Ursa makes for a prime example with his Fury Swipes, which increase the amount of damage dealt with each consecutive attack. Lifestealer is another solid choice, as he can heal himself with Feast to remain in the jungle for far longer than other heroes.</p>\r\n\r\n<figure><img src=\"https://dqrt72khb0whk.cloudfront.net/uploads/image/file/7341/cropped_Amberlight_Loading_Screen_4x3.jpg?ts=1484158046\" />\r\n<figcaption>&nbsp;</figcaption>\r\n</figure>\r\n\r\n<p>Summoner heroes, on the other hand, excel at jungling because they don&#39;t have to tank creeps&#39; damage in order to clear out camps. Enigma and Nature&#39;s Prophet are great for their ability to summon more units, while Enchantress and Chen can convert the creeps to their side.</p>\r\n\r\n<p>Compared to other junglers, summoners can take medium and large camps earlier. In general, these heroes should prioritize mana regeneration first so that they can remain in the jungle longer and sustain their high cost abilities.</p>\r\n\r\n<h2><strong>Creep Stacking</strong></h2>\r\n\r\n<p>Creep Stacking is essential to proper jungling. In short, creep stacking involves pulling away the creeps from a camp shortly before their respawn timer activates. If the creeps are outside of the camp&#39;s spawn box, additional creeps will spawn,which you can subsequently kill. The more stacks on a camp, the more farm you get.</p>\r\n\r\n<p>The recent 7.00 update changed the spawn timers for neutral camps, drastically changing how jungling works. Whereas the spawn time for camps used to be 0:30/1/2/3/4/etc., it is now 0:30/1/3/5/7/etc. The two minute time between spawns now means that speed is not as important as it once was. You now have enough time to clear out more camps and possibly execute a gank in between respawns.</p>\r\n\r\n<p>To stack a camp, you must first either attack a neutral creep or walk close to their position, causing the creeps to chase after you for a short period of time. While the size of each camps spawn box varies, it is generally possible to pull the creeps at the 53 or 54 second mark to safely stack a camp.</p>\r\n\r\n<p>While creep stacking is easy to pick up, there are other methods that can allow for even more efficient farming. A more advanced technique is creep pulling, which involves pulling a neutral camp into the path of incoming lane creeps. This is much harder to pull off, requiring careful timing, and is not recommended for beginners. Once it is mastered, however, you can use the lane creeps to take down harder neutral camps easily and without needing to worry about your survivability.</p>\r\n\r\n<h2><strong>Counter-Jungling</strong></h2>\r\n\r\n<p>While having a jungler on your team is important to secure farm, it&#39;s just as essential to know how to properly shut one down and prevent the enemy from doing the same.</p>\r\n\r\n<p><strong>RELATED:&nbsp;<a data-in-app-uri=\"thescoreesports:///news/13481\" href=\"http://www.thescoreesports.com/news/13481\">A basic guide to warding in Dota 2</a></strong></p>\r\n\r\n<p>As mentioned earlier, neutral creeps will not spawn in a camp if there is another unit inside of it. This includes wards, which are invisible to the enemy team unless they are using a Gem of True Sight or are placing Sentry Wards to counter-ward their jungle. Placing a ward inside a neutral camp in the enemy jungle will lower their overall efficiency, though it is up to you whether you use Sentry Wards or Observer Wards for the job.</p>\r\n\r\n<p>Observer Wards are great at providing sight range, but the limited amount your team has on hand combined with the fact that the most common spots to place them are often the most frequently de-warded means that they&#39;re often best used in other locations. That said, placing Observer Wards in the enemy jungle is a reliable way to both prevent additional creeps from spawning as well as potentially allowing you to see where the enemy jungler is, which could be used to set up a gank.</p>\r\n\r\n<p>On the other hand, Sentry Wards do not provide much vision, with their only other use being to de-ward enemy wards and detect invisible opponents. These are much more difficult to spot, and can be used to effectively shut down a neutral camp without much difficulty.</p>', 1, NULL, 'Text Guides', '2020-11-23 08:34:04', '2020-12-02 02:40:59', NULL),
(17, 7, 2, 'How to Dropshot', 'how-to-dropshot', 'Learn how to dropshot on Call of Duty: Black Ops Cold War', 'https://www.youtube.com/embed/vq7JRrbHDX4', '44075766_game_guide_!ss.png', '!ss.png', 'png', '<p>In this Call of Duty: Black Ops Cold War Esports Guide, you will learn how to effectively use dropshot against opponents in Call of Duty: Black Ops Cold War.</p>\r\n\r\n<p>This video features expert Call of Duty&nbsp;player &amp; EsportsGuides Coach:&nbsp;Simsimsom.</p>', 1, NULL, 'Video Guide|Coach Simsimsom', '2020-11-30 15:47:51', '2021-03-18 06:03:27', NULL),
(18, 7, 2, 'How to Jumpshot', 'how-to-jumpshot', 'Lär dig hur du hoppar och skjuter Call of Duty: Black Ops Cold War', 'https://www.youtube.com/embed/LyFQomHPcKo', '501239450_game_guide_!ss.png', '!ss.png', 'png', '<p>In this Call of Duty: Black Ops Cold War Esports Guide, you will learn how to effectively use jumpshot&nbsp;against opponents in Call of Duty: Black Ops Cold War.</p>\r\n\r\n<p>This video features expert Call of Duty&nbsp;player &amp; EsportsGuides Coach:&nbsp;Simsimsom.</p>', 1, NULL, 'Video Guide|Coach Simsimsom', '2020-11-30 15:50:16', '2021-03-18 06:01:25', NULL),
(19, 7, 2, 'Prefire Turtorial', 'prefire-turtorial', 'Learn how to prefire on Call of Duty: Black Ops Cold War', 'https://www.youtube.com/embed/ch1T43DncqQ', '1427032954_game_guide_!ss.png', '!ss.png', 'png', '<p>In this Call of Duty: Black Ops Cold War Esports Guide, you will learn how to effectively use prefire against opponents in Call of Duty: Black Ops Cold War.</p>\r\n\r\n<p>This video features expert Call of Duty&nbsp;player &amp; EsportsGuides Coach:&nbsp;Simsimsom.</p>', 1, NULL, 'Video Guide|Coach Simsimsom', '2020-11-30 15:52:41', '2021-03-18 06:00:04', NULL),
(20, 3, 1, 'Tips to win Dust 2', 'tips-to-win-dust-2', 'Learn some important tips to help you win your matches on Dust 2!', '', '745636178_game_guide_!ss.png', '!ss.png', 'png', '<p>&nbsp;</p>\r\n\r\n<aside>\r\n<h2>1. Find your default on T side</h2>\r\n</aside>\r\n\r\n<p>Firstly,&nbsp;players need to master what works for them as a default position on the T side.</p>\r\n\r\n<p>kennyS says: &quot;Well, you can just shoot through the doors.</p>\r\n\r\n<p>&quot;But in all seriousness, it&#39;s pretty hard, it&#39;ll all be down to objectives. You have to set up smaller objectives round by round. When you start a default on T side, you want one guy long, one guy at B and two guys going lower because the first objective is always to take short. As soon as you take short, you have the control of the map and if you have the control of the map you can do whatever you want. There&#39;s a lot of possibilities in what you can do - that&#39;s one of the cool things about CS.</p>\r\n\r\n<p>&quot;If you&#39;re looking for specific defaults to help you get better, you just have to watch a lot of demos and learn different ways you can do things efficiently.&quot;</p>\r\n\r\n<h2>2. Take short on T side after running your default</h2>\r\n\r\n<p>Building on kennyS&#39; point of running your default, nexa goes into&nbsp;more details as to why its important to take short ASAP!</p>\r\n\r\n<p><strong>Nexa</strong> says: &quot;One of the most common things to do on Dust II is you run your default, let your players who know their protocol take control, most commonly taking the short area.</p>\r\n\r\n<p>&quot;They go from lower, underground path where they throw a bunch of utilities and once you have this short control, it opens up the whole map. One of the most basic things to do is to run your default and take control of short - it&#39;s the easiest way to actually execute the round.</p>\r\n\r\n<p>&quot;The other thing is, of course, once you have the spawn is to move towards A long, you should always take it because you have the advantages. If you have good numbers, take A long, 90% of the times you&#39;ll just take the round right there.&quot;</p>\r\n\r\n<aside>\r\n<h2>3. Lurking isn&#39;t that important</h2>\r\n</aside>\r\n\r\n<p>Nexa &amp;&nbsp;kennyS agree&nbsp;that the role of the lurker&nbsp;isn&#39;t as effective on a map like Dust II.</p>\r\n\r\n<p>nexa adds: &quot;On other maps lurkers can have a huge impact but that&#39;s not the case on Dust II anymore. You could do it previously but everyone now is super ready and always expect you because once you&#39;re lurking there&#39;s only one or two exits you can come from so people don&#39;t get as surprised anymore - they just learn to check their corners and angles so it&#39;s not as effective as it was.&quot;</p>\r\n\r\n<p>kennyS agrees: &quot;I don&#39;t think it&#39;s a big deal if you&#39;re not lurking. Sometimes you just can&#39;t do it because you need strength on other areas of the map that you&#39;re executing. I think creating rotation is always a good thing but on Dust II lurkers just have less of an impact.&quot;</p>\r\n\r\n<h2>4. Utilise AWPers instead</h2>\r\n\r\n<p>Lurkers are less important on Dust II, utilising AWPers properly can be the difference between winning and losing a round. If you don&#39;t know what an AWPer is, they&#39;re the ones that hold the huge sniper rifle, capable of killing any player with a single bullet.</p>\r\n\r\n<p>nexa explained: &quot;The most important thing you can do on Dust II is learning how to use your AWPer effectively both on T and CT side because if you can get your AWPer to be comfortable and start making picks and aggressive plays, this is how you shut your opponent down on both sides.&quot;</p>\r\n\r\n<h2>5. What&#39;s the hardest position on CT side?</h2>\r\n\r\n<p>It&#39;s difficult to make plays on CT side ,it requires much more coordination. Both nexa and kennyS have identified the hardest positions on CT side.</p>\r\n\r\n<p>nexa points at B: &quot;With the new changes, B site is the hardest position on CT side. You can throw flashes and smokes too with the skybox change. It was already hard enough to hold B without that change but now it&#39;s really difficult.&quot;</p>\r\n\r\n<p>kennyS, an AWPer, opted for the pit. &quot;I do not want to play pit,&quot; He said. &quot;Pit just seems so boring and such a lonely position. It&#39;s not a position for someone like me. I like to move around the map, you have to be really patient to play pit so I personally wouldn&#39;t want to be there.</p>', 1, NULL, 'Text Guide', '2020-12-02 00:52:17', '2021-03-18 06:24:26', '2021-03-18 06:24:26'),
(21, 3, 1, 'Core Weapons & Accuracy', 'core-weapons-accuracy', 'Learn the basics of CSGO core weapons & accuracy.', '', '1266761272_game_guide_!ss.png', '!ss.png', 'png', '<h2 id=\"1-start-with-the-core-weapons\">1. Start with the Core Weapons</h2>\r\n\r\n<p>Many beginners will be excited by the vast selection of guns to choose from but don&#39;t know how to master them.&nbsp;For example, they purchase <strong>Desert Eagle</strong>&nbsp;or <strong>AWP</strong>&nbsp;but can&rsquo;t understand how such great weapons don&rsquo;t deliver nice headshots.</p>\r\n\r\n<p>So, start your practice with more effective in-game firearms. Such as:</p>\r\n\r\n<ul>\r\n	<li>Pistols:&nbsp;<strong>Tec-9</strong>&nbsp;(T),&nbsp;<strong>Five-SeveN</strong>&nbsp;(CT),&nbsp;<strong>P250</strong>&nbsp;(both teams)</li>\r\n	<li>Riffles:&nbsp;<strong>AK-47</strong>&nbsp;(T) and&nbsp;<strong>M4A4/M4A1-S</strong>&nbsp;(CT)</li>\r\n</ul>\r\n\r\n<p>Don&rsquo;t rush to learn about other guns unless you can use the above mentioned ones on a decent level - this is how to play CS GO and get victories.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 id=\"2-practice-accurate-shooting\">2. Practice Accurate Shooting</h2>\r\n\r\n<p>There are lots of things happening in CS:GO matches, you might have no time to stay calm and practice. But it is a worthy training that will pay off nicely.</p>\r\n\r\n<p>You have three options:</p>\r\n\r\n<ul>\r\n	<li>Start the game on community-created maps specially dedicated to aiming. Just search for&nbsp;<strong>aim training</strong>&nbsp;on the Steam Workshop.&nbsp;Make this CS GO training your regular practice.</li>\r\n	<li>Play with bots and concentrate only on shooting. Keep&nbsp;other important aspects aside for a while.</li>\r\n	<li>Play Deathmatch mode - it&#39;s great for practising fast-paced shooting.</li>\r\n</ul>', 1, NULL, 'Text Guide', '2020-12-02 00:58:59', '2021-03-18 06:24:32', '2021-03-18 06:24:32'),
(22, 3, 1, 'Ultimate Mirage Guide', 'mirage-flash-guide', 'Learn how to flash like a pro with our Ultimate Mirage flashbang guide!', '', '1754355309_game_guide_image1594373516.png', 'image1594373516.png', 'png', '<h1>MIRAGE: A SITE SMOKES &amp; FLASHES</h1>\r\n\r\n<p>So maybe you&#39;ve seen a bit of competitive Counter Strike and want to try your hand at it. Maybe you&#39;ve been playing Counter Strike and want to know how the pros manage to hit smokes and flashes with pinpoint accuracy. Bottom line is you&#39;re wondering which brick to look at when throwing a &#39;nade - we got you.</p>\r\n\r\n<hr />\r\n<p><img alt=\"Mirage callouts | Image credit: Valve\" src=\"https://images.ctfassets.net/et9p1kivitqh/2Er8E2ETynJBlbEGj3dI4d/d45f7fe2e90aabf13f667debe2f49c82/mirage-callouts-smokes-flashes.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Mirage callouts | Image credit: Valve\" /></p>\r\n\r\n<p>Mirage callouts | Image credit: Valve</p>\r\n\r\n<p>Today we will be tackling the smokes and flashes for the A bombsite on Mirage. As luck would have it, despite the omnipresent &quot;rush B&quot; meme, it&#39;s in fact the A site which is much closer to both the Terrorist and CounterTerrorist spawns. Furthermore, the two entrances closest to the T spawn are fairly safe up until the very access points. In contrast, the only relatively safe (that is unexposed to CTs who&#39;ve decided to extend into the map a bit) entrance to the B site features a long narrow corridor which can be held from two different angles and lines the Ts up for someone playing the Van position. However, how fast you can run to the default plant spot isn&#39;t the only thing that matters. CTs can still bang you out from their favorite spots so you need to disrupt their strategy.</p>\r\n\r\n<h2>SMOKES</h2>\r\n\r\n<p>A savvy team on the offense will want to close off the defender&#39;s entry points into the site in order to prevent rotation but also force the CTs into close range on those pistol rounds where your Glock can be used to its full potential or cripple an AWP trying to snipe you. To aid in this, Ts will want to smoke off Jungle / Connector, Stairs and Spawn. Here is how you can do that every time:</p>\r\n\r\n<p><b>Jungle</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/tM1UEKhs-SI\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Stairs</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/gQOVvHyp-Bw\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Spawn</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/7cfqxYWuytU\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Of course, if you&#39;re on the defense playing A and you get a whiff of the other team preparing to storm your site, you&#39;ll want to buy some time for your teammates to rotate, maybe gain back some map control. Jake &quot;Stewie2k&quot; Yip might&#39;ve made his name by taking those handicapped fights by going through smokes (you&#39;re seen first when exiting a smoke and thus at a disadvantage) but chances are your opponents will not be able to pull the same acrobatics off. Here&#39;s how you can use your smokes as a CT in order to slow or even cripple a push:</p>\r\n\r\n<p><b>Stairs to Palace</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/ADYA3qt8m8c\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Shadow to Palace</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/pjXn4TpAJpE\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Spawn to Slope</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/9azFxGWc3u0\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>FLASHBANGS</h2>\r\n\r\n<p>Next up are Flashbangs. Since those explode on a fuse after being thrown and players will look away if they see the distinctive model, you&#39;re aiming for a &quot;pop flash&quot; or creating a trajectory which has the Flashbang explode in such a spot that it nearly unreactable for the opponent holding the spot you want to flash. Here are the T flashes:</p>\r\n\r\n<p><b>Spawn to A site</b>,&nbsp;<i>flashes site</i>:</p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/ITgYo3plslo\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Palace to Shadow</b>,&nbsp;<i>flashes Shadow</i>:</p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/pwwbklDHMNo\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Palace to A site</b>,&nbsp;<i>flashes Stairs and Spawn</i>:</p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/Az9aNnti_fw\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Slope to Jungle</b>,&nbsp;<i>flashes Jungle and Connector</i>:</p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/huQ8StLsU7s\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Conversely, here are the CT flashes:</p>\r\n\r\n<p><b>From Stairs to A Site,</b>&nbsp;<i>flashes Slope, A site and even Palace:</i></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/X3zGgiDuC6o\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>From Ninja to Slope,</b><i>&nbsp;flashes Slope:</i></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/uEmMSW6csQQ\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>From Shadow to Slope,</b>&nbsp;<i>flashes Slope:</i></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/uRGnrCvDYgY\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>From Jungle to Slope,</b>&nbsp;<i>flashes Slope:</i></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/huQ8StLsU7s\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>MOLOTOVS/INCENDIARY GRENADES</h2>\r\n\r\n<p>Lastly we have the Molotovs / Incendiary grenades. Like Smokes they are used for area denial, but they last a lot less, 7 seconds versus 18, with the tradeoff being that nobody is Stewie2k-ing through them as they deal 40 damage per second. Due to their properties, they are best used to flush people from hiding spots which if you had to check would expose you too much. Here&#39;s the most popular T mollie:</p>\r\n\r\n<p><b>From Palace to Shadow:</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/Xzi7gNFCxdg\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>And here&#39;s the most popular CT incendiary:</p>\r\n\r\n<p><b>From Jungle to Tetris:</b></p>\r\n\r\n<p><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/SR8WE985JSg\" width=\"560\"></iframe></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, NULL, 'Text Guide', '2020-12-02 01:03:41', '2021-03-18 06:24:36', '2021-03-18 06:24:36'),
(23, 1, 1, 'Ultimate Beginner Guide', 'ultimate-beginner-guide', 'New to VALORANT? Improve your gameplay with our Ultimate Beginners Guide.', '', '498602927_game_guide_!ss.png', '!ss.png', 'png', '<h2 id=\"czqIfH\"><strong>VALORANT BASIC MATCH RULES</strong></h2>\r\n\r\n<p id=\"3rHkHV\">Each match has two teams of five players. Before a match begins, every player selects a&nbsp;character&nbsp;with a unique set of abilities.&nbsp;Matches have rounds, and the first team to win 13 rounds wins the match.</p>\r\n\r\n<p id=\"VFbJVj\">One team starts as the Attackers and one team starts as the Defenders, and after 12 rounds, the two teams switch sides. The Attackers&rsquo; goal is to plant a bomb (the Spike) on one of several bomb sites around the map. The Defenders&rsquo; job is to, well, defend, either by defusing the Spike after it&rsquo;s planted, or preventing the Attackers from planting the Spike within the round&rsquo;s time limit. Either team can also win a round by eliminating the other team, as there are no respawns during a round.</p>\r\n\r\n<p id=\"rNIpHV\">At the beginning of each round, every player in the match will get money (called Creds) that they can use during a Buy Phase to purchase weapons, armor, and abilities. The amount of Creds players get is determined by their performance in the previous round. Actions like planting the Spike, getting kills, and winning or losing a round will grant extra Creds.</p>\r\n\r\n<h2 id=\"QoL3Xv\"><strong>TIP #1: WALK, DON&rsquo;T RUN</strong></h2>\r\n\r\n<p id=\"D3mq2p\">Every time you run in&nbsp;<em>Valorant</em>&nbsp;(which is the default movement speed), your footsteps make noise, and any enemy nearby can hear you. Running is so loud that there&rsquo;s even a little circle that appears on your minimap to show you how far the sound of your footsteps is traveling. The solution to all that noise is to walk instead of run by holding Shift. Walking is slower, obviously, but it also makes you more accurate should you need to shoot quickly before you can stop &mdash; and it makes you impossible to hear, letting you and the rest of your team sneak up to enemy positions.</p>\r\n\r\n<p id=\"iegnDJ\">You should be walking almost everywhere you go in&nbsp;<em>Valorant&nbsp;</em>unless (A) you know there are no enemies near you, (B) the enemy already knows where you are, or (C) you have to get somewhere in a hurry. If you are confident that enemies aren&rsquo;t around and you need to move quickly, switch to your knife, as it&rsquo;s faster than running with a gun out.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"A crosshair pointed directly at a player in Valorant as the player runs by\" data-upload-width=\"1547\" sizes=\"(min-width: 1221px) 846px, (min-width: 880px) calc(100vw - 334px), 100vw\" src=\"https://cdn.vox-cdn.com/thumbor/V9cw04_ZL42ZUNZymDIzckdiv4Q=/0x0:1547x906/1200x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg\" srcset=\"https://cdn.vox-cdn.com/thumbor/66LiliicIJoImzPu1uPCU1BeJuk=/0x0:1547x906/320x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 320w, https://cdn.vox-cdn.com/thumbor/tholtAJDQKFs4nLUG0JLYmQ0L58=/0x0:1547x906/520x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 520w, https://cdn.vox-cdn.com/thumbor/uiTYqZXsgtY7x-50ZwrXP5nq2oQ=/0x0:1547x906/720x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 720w, https://cdn.vox-cdn.com/thumbor/q4VBeYyCRyQzE8qxTxHwrYvLEuE=/0x0:1547x906/920x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 920w, https://cdn.vox-cdn.com/thumbor/PBN_imoFBXGEtYxnxSLLSTjkF_4=/0x0:1547x906/1120x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 1120w, https://cdn.vox-cdn.com/thumbor/twXPT66eGBT_ayOHR51F3dHMono=/0x0:1547x906/1320x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 1320w, https://cdn.vox-cdn.com/thumbor/8g2TwkND9CSmISAI9ya4P_8Ruq8=/0x0:1547x906/1520x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 1520w, https://cdn.vox-cdn.com/thumbor/3L_pGvzeKFy4e0ngZCcVd6FygWQ=/0x0:1547x906/1720x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 1720w, https://cdn.vox-cdn.com/thumbor/jZJISyEr6fyUh7-19x13dNRRWqY=/0x0:1547x906/1920x0/filters:focal(0x0:1547x906):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874705/game_1.jpg 1920w\" /></p>\r\n\r\n<h2><strong>TIP #2: DON&rsquo;T RUN AND SHOOT</strong></h2>\r\n\r\n<p id=\"Ha7BNc\">With the tip about walking in mind, you should know that shooting accurately and running don&rsquo;t mix in&nbsp;<em>Valorant</em>, so you should try to avoid it at all costs. If you&rsquo;re running and you see an enemy you want to shoot, try to stop moving entirely before firing. It takes a while for your aim to settle, but as you get used to it, you&rsquo;ll get a better idea of when your shot will be accurate and when it won&rsquo;t be. The reticle growing and shrinking will even give you a hint of your accuracy.</p>\r\n\r\n<p id=\"x9yH73\">It will take practice to get this skill down, but running and shooting at the same time, then wondering why their bullets didn&rsquo;t hit, is probably the most frequent mistake that new&nbsp;<em>Valorant&nbsp;</em>players will make.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 id=\"rnun47\"><strong>TIP #3: KNOW WHEN TO SAVE YOUR CREDS</strong></h2>\r\n\r\n<p id=\"UFIGQl\">Save your Creds for better buys and to sync with your team. For example: You probably can&rsquo;t win a round if you&rsquo;re the only one on your team who bought a gun and everyone else is stuck with the basic pistol. But if you save for a round or two and let your teammates get some Creds as well, then the five of you with guns and armor will have a better chance of winning that round &mdash; and carrying that gear forward.</p>\r\n\r\n<p id=\"Vz7J7V\">There are a few different types of rounds that you should think about when you first start playing&nbsp;<em>Valorant</em>. You can let your teammates know what you&rsquo;re planning to do in each round over voice chat, or you can use one of the helpful buttons that Riot included on the buy menu that say things like &ldquo;Save,&rdquo; or you can let your teammates know that you have plenty of money.</p>\r\n\r\n<h3 id=\"61D0RV\"><strong>SAVE ROUNDS</strong></h3>\r\n\r\n<p id=\"O4pGTg\">Everyone buys very little in hopes of saving for the next Buy round. This might mean you don&rsquo;t buy anything at all, or that you only buy a pistol and one ability.</p>\r\n\r\n<h3 id=\"pDGSYb\"><strong>FULL BUY ROUNDS</strong></h3>\r\n\r\n<p id=\"hB2QIN\">Everyone on the team buys weapons &mdash; usually either rifles or sniper rifles &mdash; as well as armor and whatever abilities they need.</p>\r\n\r\n<h3 id=\"boCagi\"><strong>FORCE BUY ROUNDS</strong></h3>\r\n\r\n<p id=\"FO0TI9\">You don&rsquo;t have enough for a Full Buy Round, but you and your team buy anyway, getting the best weapons and armor you can. You might do this to catch the enemy off guard, or because you need a win here to start a comeback and can&rsquo;t afford to wait for more money.</p>\r\n\r\n<h3 id=\"e8GqSG\"><strong>PARTIAL BUY ROUNDS</strong></h3>\r\n\r\n<p id=\"E18Ave\">This means that one or two people on the team might buy a weapon, but everyone makes sure they&rsquo;ll have enough Creds for a Full Buy Round next time.</p>\r\n\r\n<p><img alt=\"A Valorant player getting shot\" data-upload-width=\"1647\" sizes=\"(min-width: 1221px) 846px, (min-width: 880px) calc(100vw - 334px), 100vw\" src=\"https://cdn.vox-cdn.com/thumbor/RdsUduc8vtfSJI949JyrhsGJlGk=/0x0:1647x911/1200x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg\" srcset=\"https://cdn.vox-cdn.com/thumbor/1OTKXvoPmqwi0X9c5KOGeioQcZs=/0x0:1647x911/320x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 320w, https://cdn.vox-cdn.com/thumbor/QKHyPHzLPXjB9qTKv9gBiAcHXXE=/0x0:1647x911/520x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 520w, https://cdn.vox-cdn.com/thumbor/L1SK4njbxOBpvaqka-LzwfIosQY=/0x0:1647x911/720x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 720w, https://cdn.vox-cdn.com/thumbor/PLiudg1lEhE8pQtfYh1ZrJwaB9I=/0x0:1647x911/920x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 920w, https://cdn.vox-cdn.com/thumbor/hioxOdr-6xnKUNX8vT1MDFHlcdY=/0x0:1647x911/1120x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 1120w, https://cdn.vox-cdn.com/thumbor/z8TuWdJvMhGCF0pnlLV_wuJIHGM=/0x0:1647x911/1320x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 1320w, https://cdn.vox-cdn.com/thumbor/mZBP3wy67MC8k7yWSxi6WAZMAZc=/0x0:1647x911/1520x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 1520w, https://cdn.vox-cdn.com/thumbor/tkQPEHP_XjKMtXjKe8vPtO4Vj-s=/0x0:1647x911/1720x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 1720w, https://cdn.vox-cdn.com/thumbor/LkpXkSLWsoCvk6kyFPGG4gyGQ0o=/0x0:1647x911/1920x0/filters:focal(0x0:1647x911):no_upscale()/cdn.vox-cdn.com/uploads/chorus_asset/file/19874762/game_2.jpg 1920w\" /></p>\r\n\r\n<h2 id=\"PZxRI5\"><strong>TIP #4: BUY ARMOR</strong></h2>\r\n\r\n<p id=\"tUllcP\">Guns are the most exciting thing to buy in&nbsp;<em>Valorant</em>, but guns are only good if you&rsquo;re alive to use them. That&rsquo;s where armor comes in. Buying armor doesn&rsquo;t feel like the cool thing to do, but it&rsquo;s almost always the right decision. Without armor, your 100 hit points won&rsquo;t last long &mdash; one or two bullets could kill you.</p>\r\n\r\n<p id=\"7a5NK7\">Armor should always be part of your Full Buy Rounds, and you should prioritize it over the best weapons if you can&rsquo;t afford both. There are two types of armor: one that costs 400 Creds and gives you 25 extra health, and one that costs 1,000 Creds and gives you 50 extra health. Both types of armor absorb 70% of damage taken.</p>\r\n\r\n<h2 id=\"FunX8J\"><strong>TIP #5: KEEP YOUR RETICLE AT HEAD HEIGHT</strong></h2>\r\n\r\n<p id=\"n5L2Vi\">The less you have to move your mouse, the faster you can aim and shoot. When you&rsquo;re walking, you should always try to keep your aim at the same height at which an enemy&rsquo;s head would be. Most players &mdash; in all shooters, not just&nbsp;<em>Valorant</em>&nbsp;&mdash; have a tendency to keep their reticle pointed toward the ground. But if you run into someone while aiming down, you&rsquo;ll have to shift your aim up. If your aim is already around their head, it&rsquo;s a smaller movement to find the sweet spot, and therefore a lot faster.</p>\r\n\r\n<p id=\"5OHboN\">A nice way to practice is to keep your gun at the head height of your allies before each round begins. This gives you a nice starting point to get used to.</p>', 1, NULL, 'Text Guide', '2020-12-02 01:36:48', '2021-03-18 06:08:54', NULL),
(24, 1, 1, 'Ultimate Aim Guide', 'advanced-aiming', 'Drastically improve your VALORANT aiming with our ultimate aim guide!', '', '1968243661_game_guide_!ss.png', '!ss.png', 'png', '<p>Valorant&rsquo;s cast of heroes have a slew of powers to one up the enemy, however; it&rsquo;s your aim and game sense that will get you through most situations in Riot Games&rsquo; team-based, tactical shooter. While hero abilities are a core part of the game, you&rsquo;ll notice that Valorant has more in common with CS:GO (Counterstrike: Global Offensive) than it does with other hero-based shooters like Overwatch.</p>\r\n\r\n<h2>1. Crosshair placement</h2>\r\n\r\n<p>Crosshair placement is&nbsp;the most important aspect of aiming to improve your k/d in Valorant. It means keeping your aim centered on screen, setting your crosshair at perfect head height, as you push or peel over the course of the round. The idea is to minimize the amount of correction you will have to make when you see a player. If your crosshair is at head height, then you only have to cover a (relatively small) horizontal distance. This will take time, and the dedication to break a few bad habits. This goes out to any of you aiming at the floor and those of you with their crosshairs in the clouds: Make the effort to change toward this playstyle and you will see your game improve with discipline.</p>\r\n\r\n<h2>2. Practice</h2>\r\n\r\n<p>You should be dropping into the range before you queue up, practicing your &ldquo;flick&rdquo; aiming and tracking, or getting a feel for Valorant&rsquo;s arsenal of weapons.</p>\r\n\r\n<p>Want to pick the Operator? Go ahead, it&rsquo;s OP, but get used to it. Getting a handle on the ranges, spreads, and strengths of each weapon while figuring out what you&#39;re comfortable with will help you as your econ shrivels up and your options start to run out. Be careful not to spend too long in the range and burn yourself out, though. You can start slow, but thirty minute sessions with consistency will show results.</p>\r\n\r\n<h2>3. Sit still</h2>\r\n\r\n<p>Sprinting across the map, hip firing a submachine gun is nothing more than a fantasy when you drop into a game of Valorant. Your shots will be noticeably wild and inaccurate while shooting on the go, even if you aim down sight. Take your time with those corners and plant your feet. A vandal can one shot someone with a heavy shield, but only if you click on their head. The steadier hand in Valorant comes out on top just as often as the quickest hand.</p>\r\n\r\n<h2>4. Your crosshair and you; what you&rsquo;re doing wrong</h2>\r\n\r\n<p>Reducing the spread indicator and picking a colour to stand out against the drab backdrop of Bind will help a lot. It can also give you a more accurate reference to land that flick headshot with increased consistency. It&rsquo;s all about what&#39;s best for you. Once you adjust your crosshair, you&rsquo;ll be shocked at the improvement. In the simplest terms: your crosshair should be simple, small, non-distracting and consistent. Always choose a static crosshair over a dynamic one that adapts when you fire or move. If your crosshair can&rsquo;t be consistent, neither will you.</p>\r\n\r\n<h2>5. From the hip</h2>\r\n\r\n<p>Aiming down sight makes you more accurate, but decreases your fire rate. It&rsquo;s optimal for range but, in close when one shot could be all you need, keeping yourself scoped out gives a better field of view and a higher fire rate for when you find more than just a Sage around that corner.</p>\r\n\r\n<h2>6. Before you play</h2>\r\n\r\n<p>All these tips are for naught if you aren&rsquo;t set up properly, so, to the many who will find this insultingly basic, this is for the few who might not know. If you haven&rsquo;t figured this one out yet: Find a sensitivity that is right for you. Valorant is a slower paced game than most, so a lower sensitivity is more forgiving. Adjust your DPI to something comfortable for all games and then adjust your sensitivity as best you can. You can find multiple converters online to figure out preferred settings for Valorant and all your other favorite games while you&rsquo;re at it. Most pro players find themselves at 400 or 800 DPI, but find what works for you and a mouse that suits your game to keep your edge.</p>\r\n\r\n<h2>7. Leave no stone unturned</h2>\r\n\r\n<p>If you&rsquo;re new to PC or never really got aiming down with a mouse, then an Aim trainer might be your best bet. Aim Hero, Osu, Aiming.pro, and 3D Aim Trainer have a myriad of games and modes that help you with different aspects of PC gaming. Whether it&rsquo;s tracking, flick aiming, or strafe firing, you&rsquo;ll find more than a few options to help sharpen your skills. You can find aim trainers ranging in price from free to topping out around twenty dollars, with different games and drills to test your skill.</p>', 1, NULL, 'Text Guide', '2020-12-02 01:44:40', '2021-03-18 06:10:03', NULL);
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(25, 1, 1, 'Ultimate Split Smokes', 'ultimate-split-smokes', 'Learn how to smoke areas of Split like a pro with this guide!', '', '304083096_game_guide_Loading_Screen_Split.png', 'Loading_Screen_Split.png', 'png', '<h1>VALORANT GAMESGUIDZ: BEST SMOKES ON SPLIT</h1>\r\n\r\n<p>Smokes are some of the best abilities players can use in Valorant for the cover they grant to your team, but it&rsquo;s crucial to use them properly. To help with this, here&rsquo;s a guide to the best smoke locations for Split, whether you&rsquo;re attacking or defending.</p>\r\n\r\n<hr />\r\n<h2>BEST VALORANT SMOKES ON SPLIT</h2>\r\n\r\n<p>Winning rounds on Split is a super uphill battle for attackers, but using smoke properly can make a big difference. There are a lot of different ways to approach the spike sites, and using smoke to cover multiple approaches can keep the enemy team guessing as they look on from the high ground. As for how to do that, let&rsquo;s examine the different options.</p>\r\n\r\n<h3>HOW DO I SMOKE A SITE MAIN ON SPLIT?</h3>\r\n\r\n<p><img alt=\"Valorant Smoke A Site Main on Split\" src=\"https://images.ctfassets.net/et9p1kivitqh/ILXY9YwbQLoWhSkC1zMVH/efc20807cda7697aae3c70a76f97ac2e/valorant-how-to-smoke-a-site-main-split-2.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Valorant Smoke A Site Main on Split\" /></p>\r\n\r\n<p>As the most straightforward path to the A site, safely traversing this route requires a number of well-placed smokes. The first step starts with blocking off Ramp, to deter any attempts to flank as your team advances.</p>\r\n\r\n<p><img alt=\"Split Attack A Plant Smoke\" src=\"https://images.ctfassets.net/et9p1kivitqh/2KD2y6WEuDLc4FRM5XlJxl/6e3cae3cf066087842501f9dcd0af755/split-attack-a-plant-4.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Attack A Plant Smoke\" /></p>\r\n\r\n<p>From there, smoke off Heaven and the back hall. That way, you simply have to check corners as you swing off to the right and plant the spike. Without additional knowledge of where exactly your team is moving from and how many members are nearby, no one will risk peeking out of the smoke (and it&rsquo;s easy to take them out if they do).</p>\r\n\r\n<h3>HOW TO SMOKE A FROM HEAVEN</h3>\r\n\r\n<p><img alt=\"Split Attack A Heaven Smoke\" src=\"https://images.ctfassets.net/et9p1kivitqh/4oEkYq8yyHomr6Styevf5F/376ee915b89da8f64bed8c71e230fae8/split-attack-a-heaven-6.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Attack A Heaven Smoke\" /></p>\r\n\r\n<p>If you decide to go up Ramp and into Heaven after taking control of A Main, it will be important to make sure it&rsquo;s too risky for anyone to reinforce whoever is unlucky enough to get caught in your push. By dropping Smoke at the back of Heaven and near the ropes, the enemy will have to hide in the corner and hope they can take a trade.</p>\r\n\r\n<p>Then, with the high ground, it&rsquo;s easy to cover your teammates as they advance toward A site and when the rest of the enemy team arrives.</p>\r\n\r\n<h3>HOW DO I SMOKE A FROM MID ON SPLIT?</h3>\r\n\r\n<p><img alt=\"Split Attack A Mid\" src=\"https://images.ctfassets.net/et9p1kivitqh/7dcx63VrnEiTmbOpup4HBq/265f04aaaa6a425e5ef7c3916217973c/split-attack-a-mid-smoke-8.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Attack A Mid\" /></p>\r\n\r\n<p>The final way to attack A is by going through mid and taking the ropes up to A Heaven. While this requires avoiding any opponents who might be hiding in wait, you can still take control of the area if you can get close.&nbsp;</p>\r\n\r\n<p>Assuming you survive that first part, it&rsquo;s important to cover the entrance to Ramp and the back door of Heaven. Once it&rsquo;s safe uptop, take a quick peak and then fully enter the room when the coast is clear. From there, it&rsquo;s just a matter of covering your team as if they descend upon the site.</p>\r\n\r\n<h3>BEST WAYS TO SMOKE B FROM MAIN ON SPLIT</h3>\r\n\r\n<p><img alt=\"Split Attack B Heaven\" src=\"https://images.ctfassets.net/et9p1kivitqh/2gOOyZiDPW1b5xz9BWjLbt/31d0052dace1605669690fb871274cbe/split-attack-b-heaven-10.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Attack B Heaven\" /></p>\r\n\r\n<p>Attacking B is difficult on Split, but there are ways to make it manageable. The step is not to waste any smoke on taking B main, since it should be possible to take control of that room with sheer numbers or other abilities.</p>\r\n\r\n<p>Then, once you&rsquo;re inside, you will need to complete some very specific smokes to stop you from getting picked off from above. First, drop two smokes at B Heaven, and make sure they&rsquo;re far back enough so that they don&rsquo;t end up too low to block any line of sight.&nbsp;</p>\r\n\r\n<p>Additionally, cover the space between the plant site and the boxes across from you. Doing so will prevent anyone on the ground from popping out to shoot you, meaning you only need to clear the two corners to your left and right as you enter the area. From there, just rotate around the central pillar and you should be clear to plant the spike.</p>\r\n\r\n<p><img alt=\"Split Attack B Ground\" src=\"https://images.ctfassets.net/et9p1kivitqh/5PZJxiVFICT7tSCinjgy3o/7c3adceef654184f7bde2aeb44af3fb2/split-attack-b-ground-12.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Attack B Ground\" /></p>\r\n\r\n<p>Alternatively, if you&rsquo;re able to cross Heaven without using these resources, you can drop smoke in other advantageous positions. Cutting off the side of the pillar below Heaven prevents anyone on the ground from bothering you in that direction, and cutting off the defenders spawn makes it harder for reinforcements to surprise you.</p>\r\n\r\n<h3>HOW TO SMOKE B FROM MID ON SPLIT</h3>\r\n\r\n<p>The only other way onto B is through Mid, which could require a bit of dueling as you take control of the entryway. It&rsquo;s usually not worth using smoke here, as you&rsquo;ll almost certainly need it more as you descend onto the plant site.</p>\r\n\r\n<p>Once you make it through this first challenge, it&rsquo;s time to drop smoke in some familiar places. Block off Heaven just as you would if you were approaching from B main so that enemies below can&rsquo;t see you coming. Then, block off B stairs to prevent any enemies from interrupting your plan.&nbsp;</p>\r\n\r\n<h2>BEST DEFENSE SMOKES ON SPLIT</h2>\r\n\r\n<p>While attacking on Split can feel grueling at times, the defender&rsquo;s job is much easier. There is a high up vantage point looking out on both spike sites, which means you won&rsquo;t need to use as many resources for controlling those parts of the map. Instead, you can focus on protecting yourself from the many flanking opportunities around the map.&nbsp;</p>\r\n\r\n<p>Let&rsquo;s look at the best places to smoke for each site.</p>\r\n\r\n<h3>HOW DO I SMOKE A SITE ON SPLIT?</h3>\r\n\r\n<p>There are lots of solid defense points on A, from back hall, to Heaven, to Ramp. Each path requires different smoke placement, but all are much safer when blocked off properly.&nbsp;</p>\r\n\r\n<p><img alt=\"Split Defense A Long\" src=\"https://images.ctfassets.net/et9p1kivitqh/7Kuo6wBZX3jAD3jIJkV62l/ee336540402bddef514732bfee9b6b96/split-defense-a-long14.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense A Long\" /></p>\r\n\r\n<p>To start, if you&rsquo;re defending the area from back hall, there&rsquo;s only one real direction to watch: straight ahead. Block off the choke point outside A main and let the enemy team just who is on the other side. If you&rsquo;re up in Heaven, throwing a similar smoke is always a good play. Just have someone up there watching to see if anyone is rotating behind your back.</p>\r\n\r\n<p><img alt=\"Split Defense A Ramps\" src=\"https://images.ctfassets.net/et9p1kivitqh/4yu1J661P0OlWh5Fj6cLiG/23e5f80ebc37c0671978b49ceeed3f68/Split-Defense-A-_Ramps-16.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense A Ramps\" /></p>\r\n\r\n<p>If you want to play a bit farther forward, Ramps is a good option that will get you close to the action right from the start of the round. When playing here, there are a few options depending on how aggressive you want to play. The first is to drop a smoke right in front of you and then hide in the corner. Enemies will rarely expect you to smoke off that spot and not just retreat into Heaven.</p>\r\n\r\n<p><img alt=\"Split Defense A Ramps 2\" src=\"https://images.ctfassets.net/et9p1kivitqh/1IRVwpIdVF2VZROFsFLa2x/1bc9f01f7b7ec161d01ed1d865d3bf6a/Split-Defense-A-Ramps-2-18.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense A Ramps 2\" /></p>\r\n\r\n<p>However, if you want to play a bit more aggressive, just block off the enemy&rsquo;s entrance to A Main, forcing them to either waste valuable time or rush through blind and hope they get you before you get them.</p>\r\n\r\n<h3>HOW TO SMOKE OFF MID ON SPLIT</h3>\r\n\r\n<p><img alt=\"Split Defense Mid New\" src=\"https://images.ctfassets.net/et9p1kivitqh/ywTndEGzxxIxwYo52aBVJ/d949925e053a05919cfa2fee6861621d/split-defense-mid-new-20.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense Mid New\" /></p>\r\n\r\n<p>If you happen to post up in Mid, there used to be a few different options for defensive smokes. However, Patch 1.0 changed the map and opened up the choke point that was the primary means of defending this area. Whereas you could previously play on either side of the old choke point, now it&#39;s probably best to play at the next best choke point. By smoking as seen above, you can control both paths toward Mid and still discourage pushes.</p>\r\n\r\n<p>However, be warned: getting this smoke in the right spot is quite tricky since the space is a bit too wide for a single smoke. That&#39;s why it&#39;s important to claim the high ground here. It allows you to cover up the small gaps and have a height advantage on anyone brave enough to walk through your smoke.</p>\r\n\r\n<p><img alt=\"Split Defense Mid Fall Back\" src=\"https://images.ctfassets.net/et9p1kivitqh/27DGCEjr6o2bHMKrN8zwRP/0453239fcb1b251c65b69f5f33ceff84/split-defense-mid-fall-back-22.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense Mid Fall Back\" /></p>\r\n\r\n<p>If this plan doesn&#39;t work and you&rsquo;re pushed back by the enemy, retreat toward B and drop another smoke on the path to A. That can convince enemies that you dropped it to cover your retreat, and they could expose themselves while you&rsquo;re waiting around the corner.</p>\r\n\r\n<p><img alt=\"Split Defense Mid Fall Back 2\" src=\"https://images.ctfassets.net/et9p1kivitqh/2PwGxewYiGtHfa1gWYYLSG/bd392df787cd53bbf60c46841277cffa/split-defense-mid-fall-back-2-24.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense Mid Fall Back 2\" /></p>\r\n\r\n<p>If the above plan fails again and they push you back further, there&rsquo;s one final spot you can smoke to stall the enemy push: the doorway between Mid Hall and B Heaven. They may just rush you regardless, though, since they&rsquo;ve already bullied you so much. Fingers crossed your team has rotated to help by that point.</p>\r\n\r\n<p><img alt=\"Split Defense B Back\" src=\"https://images.ctfassets.net/et9p1kivitqh/4yjiAi4Un2o6CKiIeQvGYr/4d19b71d22532f06cc80a0a4846bf74a/split-defense-b-back-26.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense B Back\" /></p>\r\n\r\n<p>If you&rsquo;re defending B site from Heaven, you have such a good vantage point that you probably don&rsquo;t need to use smoke (just make sure someone is covering your back at Mid). However, if you&rsquo;re down on the ground by the plant site, smoking off both sides of the pillar is a smart play.&nbsp;</p>\r\n\r\n<p>This way, the enemy won&rsquo;t be discouraged to enter the area, making it possible for your teammates in Heaven to pick anyone off. Also, you still have additional cover and keep the enemy guessing about where you&rsquo;re hiding.</p>\r\n\r\n<p><img alt=\"Split Defense B Forward\" src=\"https://images.ctfassets.net/et9p1kivitqh/5fxtigrDCfVwXQuRZVKy4a/13f420854f9fddddfaecda8ffcbc768b/Split-Defense-B-Forward-28.jpg?fit=fill&amp;w=500&amp;h=300\" title=\"Split Defense B Forward\" /></p>\r\n\r\n<p>If you want to play aggressive, fight all the way up to B Main and smoke off the entrance leading to the enemy spawn. They&rsquo;ll have nothing to do but walk in blind or pick another route. Just be sure you hurry to this spot if you want to control this area, because the enemy has a big head start when it comes to reaching this room.</p>\r\n\r\n<p>While few people love Split, there&rsquo;s no avoiding it. And if you&rsquo;re forced to play it from time to time, hopefully this guide can help you make the most of it.</p>', 1, NULL, 'Text Guide', '2020-12-02 01:50:21', '2020-12-08 14:55:42', NULL),
(26, 8, 1, 'TF2 Beginner Guide', 'tf2-beginner-guide', 'New to TF2? Sharpen your skills with our beginner guide!', '', '121221083_game_guide_thumb-1920-41441.jpg', 'thumb-1920-41441.jpg', 'jpg', '<p>Team Fortress 2 is now free, so everyone with a Steam account owns it. If you haven&#39;t played before, it can be an intimidating, hat-riddled game. We thought it&#39;d be useful for us to tell you what you need to know to start having fun. But we thought that at 5pm on a Friday, so we&#39;ve only got the very basics ready so far. We&#39;ll add to this over the weekend, but here&#39;s how the game modes work, and which classes you should play first.</p>\r\n\r\n<h2 id=\"which-mode-should-i-play\">Which mode should I play?</h2>\r\n\r\n<aside data-render-type=\"fte\" data-skip=\"dealsy\" data-widget-type=\"seasonal\">&nbsp;</aside>\r\n\r\n<p>First of all, have a play around with the offline training mode - it&#39;s good for the very, very basics. When you&#39;re ready to go online, click Start Playing - you&#39;ll have to choose a game mode. The default is Payload, but it&#39;s a little complex. Click the arrow on the right and pick King of the Hill. It&#39;s a mode where there&#39;s only one control point to fight over, and whoever holds it longest wins. It&#39;s Team Fortress 2 in its absolute simplest form, so it&#39;s a great place to learn how all the classes work.</p>\r\n\r\n<p>If Start Playing fails to find you a game, go back to the main menu and click Browse Servers. This is a big scary list, but once it&#39;s finished loading, look for one that has a number less than 100 in the Latency tab. If they&#39;re all jumbled up, click the Latency tab to sort by that.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/06/Team-Fortress-2-Server-Browser-Settings.jpg\" href=\"http://media.pcgamer.com/files/2011/06/Team-Fortress-2-Server-Browser-Settings.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/00feebb22615387a344ef813ee87a75f-970-80.jpg 970w\" /></a></p>\r\n\r\n<h2 id=\"which-class-should-i-choose\">Which class should I choose?</h2>\r\n\r\n<p>Once you&#39;re in game, pick either team. You usually can&#39;t join the one with the most players. Then you&#39;ll have to pick a class.</p>\r\n\r\n<p>A good starting choice is the Medic: you heal people on your team by firing a beam at them, and that&#39;s immediately useful and appreciated by your team mates. At the basic level, it&#39;s all you need to do. And that gives you time to watch how your team mates play, see who beats whom, and learn a bit about what the weapons do.</p>\r\n\r\n<p>When you fancy a change, switch to Heavy. You&#39;re slow, and your gun takes a while to spin up, but once you start firing someone&#39;s usually dead by the time you stop. You&#39;re also the first person Medics will think to heal, and since you just played Medic yourself, you know how to be a good patient and keep them protected. It&#39;s a really satisfying relationship.</p>\r\n\r\n<p>After that, it&#39;s mostly personal preference. Soldier&#39;s the best all-rounder, so another good early choice. Don&#39;t stick with any of them for too long until you&#39;ve played all nine: each new one you try helps you understand the role of the others better too. Spy is probably the hardest to be effective with when you&#39;re a beginner, but he&#39;s worth playing just so you understand roughly how they work.</p>\r\n\r\n<p>Some classes, particularly Spy and Demoman, work very differently once they unlock certain items. To describe all the differences would be long and pointless. But if a black Scottish cyclops charges at you with a giant sword, get out of the way. And if a you hear an electronic crackle shortly after a Spy appeared to die, he&#39;s alive, and he&#39;s behind you.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/06/Team-Fortress-2-guide-5.jpg\" href=\"http://media.pcgamer.com/files/2011/06/Team-Fortress-2-guide-5.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/c46b4d742159a1cce1737ec67fb70d35-970-80.jpg 970w\" /></a></p>\r\n\r\n<h2 id=\"bored-of-king-of-the-hill-now-how-do-the-other-modes-work\">Bored of King of the Hill now, how do the other modes work?</h2>\r\n\r\n<p><strong>Payload:&nbsp;</strong>the attacking team must escort a cart along some railtracks to an objective. The more of then stay near the cart, the faster it moves. The defenders can stop it by killing them, or standing near the cart themselves.</p>\r\n\r\n<p><strong>Payload Race:&nbsp;</strong>same as Payload, except both teams have a cart. Up to you whether to focus on escorting your own cart, or stopping the enemy escorting theirs. First cart to the finish line wins.</p>\r\n\r\n<p><strong>Control Point:&nbsp;</strong>much like King of the Hill, but with five control points. You fight over the central point at first, then whoever gets that can try to take the next point along on the enemy&#39;s side. You can&#39;t capture a point if you don&#39;t own one next to it, and you lose the game if the enemy team captures all your points.</p>\r\n\r\n<p><strong>Attack/Defend:&nbsp;</strong>just like Control Point, except the red team owns all the points at the start. Only the blue team can capture: once they take a point, it&#39;s theirs forever. Red wins if they can hold out for a certain time.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Capture the Flag: each team has a briefcase in their base. They have to capture the enemy briefcase, and bring it back to their base. If their own briefcase has also been stolen, they can&#39;t score a point until it&#39;s returned. First team to a certain number of captures wins.</p>', 1, NULL, 'Text Guide', '2020-12-02 02:48:45', '2021-03-18 06:20:45', '2021-03-18 06:20:45'),
(27, 8, 1, 'Engineer Complete Guide', 'engineer-complete-guide', 'New to Engineering? Become a pro in minutes with our exclusive Engineer guide!', '', '330652381_game_guide_867682.jpg', '867682.jpg', 'jpg', '<h2>Engineer How to Play?</h2>\r\n\r\n<p><strong>Engineer&rsquo;s</strong>&nbsp;look at the game whether it&rsquo;s on&nbsp;<b>offense</b>&nbsp;or&nbsp;<b>defense</b>, is important enough for it&rsquo;s own guide. You will get good at Engineer once you&rsquo;ll know all the mechanics and tactics, but it&rsquo;s far from mastering the class. You&rsquo;ll become a master texan once you&rsquo;ll understand the whole&nbsp;<b>mindset</b>&nbsp;including four&nbsp;<i>core Engineer skillsets:</i></p>\r\n\r\n<ul>\r\n	<li>Teamwork</li>\r\n	<li>Prediction</li>\r\n	<li>Gamesense</li>\r\n	<li>Awareness</li>\r\n</ul>\r\n\r\n<p>The reason why I am mentioning these skillsets from the start is that if you want to understand them all, you must take a look at common engineering mistakes players often do and see the difference between understanding the class or failing the class.</p>\r\n\r\n<p>Common Engineering Mistakes</p>\r\n\r\n<p>There are a few mistakes that you, as an Engineer should never make. This section will go trough the common ones and teach you how to avoid them.</p>\r\n\r\n<p><b><u>Picking an Engineer</u></b></p>\r\n\r\n<p>This is probably the most obvious and most common mistake a few newer Engies do. Basically if you see your team contains more than 2 Engineers, just play something else. Stacking this class causes unfun games, stalemates and more often than not, another Engineer will either steal metal and ground from his fellas or won&rsquo;t be benefitial to his team at all.</p>\r\n\r\n<p><b><u>How to avoid this mistake:</u></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Don&rsquo;t pick an Engineer if your team already has 2 Engineers.</li>\r\n	<li>If you have multiple Engineers around you, switch to something else yourself.</li>\r\n</ul>\r\n\r\n<p><b><u>Loadout</u></b></p>\r\n\r\n<p>Another mistake which most newer Engineer players do is having unnecessary loadout combination. On defense, you&rsquo;d be much better off with a Wrangler equipped than a Pistol. Little time to setup? Use Jag. Getting spammed by the Demoman? Use Short Circuit.</p>\r\n\r\n<p>To put more simply, be aware and prepare your gear based on the situation.</p>\r\n\r\n<p><b><u>How to avoid this mistake:</u></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Adapt on the current situations and change your loadout when you have time.</li>\r\n	<li>Know which weapons are good and which are less worth using.</li>\r\n</ul>\r\n\r\n<p><b><u>Spread Out</u></b></p>\r\n\r\n<p>Probably the most common mistake among pub players is placing Sentries, Dispensers and Teleporters close to another buildings just because it looks stronger &ndash;<b>it&rsquo;s not</b>.<br />\r\nSingle Demoman can destroy the entire defense by just one smartly put stickies because of splash damage. However, if you move your Sentry away from your fella, it can cover another flank or route + enemies will have harder work pushing trough.</p>\r\n\r\n<p><b><u>How to avoid this mistake:</u></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Spread out your building so they won&rsquo;t die so easily.</li>\r\n	<li>Covering more area will prevent enemy flanking or capturing the objective.</li>\r\n	<li>Be smarter and choose a better spot.</li>\r\n</ul>\r\n\r\n<p><b><u>Turtle Engineer</u></b></p>\r\n\r\n<p>Turtle Engineer is a nickname for Engineers who likes to sit behind their Sentry gun, with Dispenser up their back and willing to die with his buildings.<br />\r\nYou&rsquo;d be more efficient if you move around your nest and check for Spies.<br />\r\nAlso spread your buildings to a needed spots, Sentry should watch the objective, Dispenser should be put near your team, Teleporter should be active at any circumstances.</p>\r\n\r\n<p><b><u>How to avoid this mistake:</u></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Be active around your nest and check for any danger.</li>\r\n	<li>Use your tools to help your team and your buildings. Spread them out to your team.</li>\r\n</ul>\r\n\r\n<p><b><u>Abandon just in time</u></b></p>\r\n\r\n<p>Don&rsquo;t be afraid to run away from your nest, let it destroy and then build another one in passive lines behind your team. Trying to save it from &Uuml;ber push and die simply isn&rsquo;t worth it. Remember, your life if much more important than life of your buildings. Getting your buildings destroyed is a part of playing Engineer, don&rsquo;t mourn too long, grab your wrench and get in fight!</p>\r\n\r\n<p><b><u>How to avoid this mistake:</u></b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Stop repairing yoru Sentry when it has been attacked by the &Uuml;ber push and run away.</li>\r\n	<li>Use your&nbsp;<b>Gamesense</b>&nbsp;to decide whether it&rsquo;s a good idea to stay or setup on another point.</li>\r\n</ul>\r\n\r\n<p>Engineer&rsquo;s Arsenal</p>\r\n\r\n<p><b><u>Sentry Gun</u></b></p>\r\n\r\n<p>The difference between excellent Sentry Gun placement and average Sentry Gun placement can sometimes be very little; a matter of inches, or an angle that is off by a few degrees, can determine whether a Sentry Gun can effectively cover a certain approach, whether it will give away its location to enemies too easily, whether it will take too long to rotate into firing positions, and so on.</p>\r\n\r\n<p>This does not mean that you should take a long time to adjust the Sentry Gun blueprint before placing it &ndash; doing so is a hallmark of inexperienced Engineer play.<br />\r\nHowever, observe how certain placements perform, and if the Sentry Gun demonstrates any weaknesses in that position, try to place the Sentry Gun so it will be more effective in the future.That being said: The longer it takes enemy to notice your Sentry, the better.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-1.jpg\"><img alt=\"\" height=\"151\" loading=\"lazy\" sizes=\"(max-width: 371px) 100vw, 371px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-1.jpg\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-1.jpg 371w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-1-300x122.jpg 300w\" width=\"371\" /></a></p>\r\n\r\n<p><i>* DPS= Damage per second<br />\r\n**Rockets fires every 3 seconds, dealing 53 to 150 damage on direct hit (falloff is calculated from the distance of the Engineer to the target, not from the Sentry to the target).</i></p>\r\n\r\n<p><b><u>Dispenser</u></b></p>\r\n\r\n<p>Build your Dispenser in a convenient location for your teammates to reach.<br />\r\nDo not place your Dispenser in areas with lots of enemies nearby. They will be destroyed quickly. Try to locate the Dispenser behind an obstacle, such as a crate or a low wall, which will shield it from a fair amount of incoming damage.<br />\r\nBut that&rsquo;s not all what Dispenser can do, you can place it like a barrier against Cloaked Spies or you can jump on it to get on better places, where you&rsquo;ll have an advantage.</p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-2.jpg\"><img alt=\"\" height=\"121\" loading=\"lazy\" sizes=\"(max-width: 329px) 100vw, 329px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-2.jpg\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-2.jpg 329w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-2-300x110.jpg 300w\" width=\"329\" /></a></p>\r\n\r\n<p>Keep in mind that the Dispenser has 25 metal inside from start so you&rsquo;ll spend 100 metal + you&rsquo;ll get 25 back.</p>\r\n\r\n<p><b><u>Teleporter</u></b></p>\r\n\r\n<p>Make sure which direction to head is obvious to your teammates. When the Teleporter is being carried, pressing Alt-Fire rotates it 90 degrees. Use this to face your Teleporter away from walls and corners. Place it behind a cover like a rock which will shield it from incoming damage.<br />\r\nAvoid standing right on top of your Teleporter Exit, so as to avoid being telefragged.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-3.jpg\"><img alt=\"\" height=\"121\" loading=\"lazy\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-3.jpg\" width=\"249\" /></a></p>\r\n\r\n<h2>Building Spots Requirements</h2>\r\n\r\n<p>An Engineer, who has a decent map knowledge can surprise his enemies with a cheeky Sentry spots. But don&rsquo;t forget that the ideal spots should not prevent buildings from doing their job correctly.</p>\r\n\r\n<p><b><u>Sentry gun</u></b></p>\r\n\r\n<ul>\r\n	<li>Area denial</li>\r\n	<li>Defending an objective</li>\r\n	<li>Providing a safe zone</li>\r\n	<li>Reducing the pressure on your team</li>\r\n</ul>\r\n\r\n<p><b><u>Dispenser</u></b></p>\r\n\r\n<ul>\r\n	<li>Dispensing health and ammo</li>\r\n	<li>Backup at front lines</li>\r\n	<li>Holding team&rsquo;s sustainablility</li>\r\n</ul>\r\n\r\n<p><b><u>Teleporter</u></b></p>\r\n\r\n<ul>\r\n	<li>Delivering teammates to the front safely</li>\r\n	<li>Quickly transporting allies from point A to point B</li>\r\n	<li>Allowing slower classes to get to the front lines much faster</li>\r\n</ul>\r\n\r\n<p>Alright let&rsquo;s take a look at few maps and discuss it&rsquo;s most common and functional Sentry, Dispenser and Teleporters exit spots. Here are some examples:</p>\r\n\r\n<p><u><b>Upward</b></u></p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-4.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-4.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-4.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-4-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-4-768x432.png 768w\" width=\"820\" /></a></p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-5.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-5.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-5.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-5-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-5-768x432.png 768w\" width=\"820\" /></a></p>\r\n\r\n<p><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-6.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-6.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-6.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-6-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-6-768x432.png 768w\" width=\"820\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b><u>Dustbowl</u></b></p>\r\n\r\n<h2><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-7.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-7.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-7.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-7-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-7-768x432.png 768w\" width=\"820\" /></a></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-8.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-8.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-8.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-8-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-8-768x432.png 768w\" width=\"820\" /></a></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2><a data-fancybox=\"post_image_0\" data-fancybox-group=\"post_image_0\" href=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-9.png\"><img alt=\"\" height=\"461\" loading=\"lazy\" sizes=\"(max-width: 820px) 100vw, 820px\" src=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-9.png\" srcset=\"https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-9.png 820w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-9-300x169.png 300w, https://www.naguide.com/wp-content/uploads/2019/02/team-fortress-2-engineer-how-to-play-9-768x432.png 768w\" width=\"820\" /></a></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Gamesense</h2>\r\n\r\n<p>Gamesense is maybe the most important thing on advanced levels because it allows you to know your position not only around your team, but in a match as a whole. While playing as Engie, you should have an idea where the&nbsp;<b>front line</b>&nbsp;is. This magical line can actually help you when&nbsp;<b>moving that gear up / back</b>. For instance, when your team manage to push a little bit to claim a certain area, you want to move your gun there and secure that area, punish enemy players who wants to claim it back. I&rsquo;m not talking only about moving your Sentry.</p>\r\n\r\n<p>Moving a Dispenser could be more viable. Make sure you&rsquo;ll keep that Dispenser behind a cover. It should be near a chokepoint or an area, where are things getting a little bit more dangerous so your team can easily retreat to refill ammo and health.Teleporter should be built slightly more back than previous buildings but also pay attention to it&rsquo;s effectiveness. Having a Teleporter way behind your team,where an action is happening isn&rsquo;t always good. It&rsquo;s understandable to&nbsp;<b>not</b>&nbsp;building your shiny plate too aggressive (close to enemy team) beacuse previously mentioned front line is constantly moving so your Teleporter have small change to survive and your just teleported teammates too.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Metal Management</p>\r\n\r\n<p>As you all know, Engineer&rsquo;s maximum Metal capacity is 200 Metal. Good to know that Metal is diffrent from Ammo. Even you get both of these things from the same source.</p>\r\n\r\n<p>Here&rsquo;s a quick list of all sources of metal:</p>\r\n\r\n<ul>\r\n	<li>Small / Medium / Full Ammo packs</li>\r\n	<li>Ressuply Lockers</li>\r\n	<li>Dispensers</li>\r\n	<li>Payload Carts</li>\r\n	<li>Broken Building Parts</li>\r\n</ul>\r\n\r\n<p>It is important to know, when you want to spend your metal or get another one. For example if you have 70 metal, you should take a medium ammo pack rather than the full one to prevent wasting a bunch of metal.</p>\r\n\r\n<p>Also if you see a friendly Dispenser, it&rsquo;s okay to take a metal from it&nbsp;<u>IN CASE</u>&nbsp;your fellow Engineer won&rsquo;t need it any time soon. That being said, don&rsquo;t steal metal from your Engies. If you would accidently take a metal from a Dispenser, it is polite to give it back in form of upgrading their Dispenser.</p>\r\n\r\n<p>Multitasking</p>\r\n\r\n<p>It&rsquo;s no secret you are more effective when you&rsquo;re doing multiple things at once. Developing your ability to handle more things at the same time in a rough situations really pays off.<br />\r\nUse this when rolling out to the front lines, upgrading, fighting or defending your buildings.The time when your Sentry go down has to come one day, and when that will happen, you have to remain calm and you should have new places to build in mind. Be effective with your blueprints, provide support to your team and lead them to victory!</p>', 1, NULL, 'Text Guide', '2020-12-02 02:53:15', '2021-03-18 06:20:41', '2021-03-18 06:20:41'),
(28, 8, 1, 'Spy Complete Guide', 'spy-complete-guide', 'New to Spy? Become a pro in minutes with our exclusive Spy guide!', '', '364751329_game_guide_867685.jpg', '867685.jpg', 'jpg', '<h2 id=\"getting-started\">Getting Started</h2>\r\n\r\n<p>Silent. Deadly. Mocking. If there&#39;s a class whose role in TF2 is slightly fuzzy, it&#39;s the Spy. He&#39;s physically one of the weaker classes, but has a one-hit kill, can disguise as the enemy team and can turn invisible. He&#39;s technically a support class, alongside the Medic and Sniper, but in the wibbly world of TF2 classes, I&#39;ve no idea if what you do could be classed as support.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/07/TF2spyguide2.jpg\" href=\"http://media.pcgamer.com/files/2011/07/TF2spyguide2.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/5a79fb27f60d3ae849baed2de397e0db-970-80.jpg 970w\" /></a></p>\r\n\r\n<p>As a Spy, you need to be where your team isn&#39;t and where the enemy is. The Spy&#39;s Knife is one hit-kill, but only from the back. The Invisibility Watch and the Disguise Kit are how to get into the correct position to take advantage.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>An unseen Spy is still pretty vulnerable. His invisibility cloak is constantly ticking down, he can&#39;t shoot, when he bumps into an enemy or he gets hurt he&#39;s briefly visible and when he cloaks and uncloaks there&#39;s a noise and a period where you can be seen but not attack. So why do it? Because there are places to hide: invisibility is about placement, using it to get behind enemy lines is necessary. And it&#39;s fun.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/07/TF2spyguide3.jpg\" href=\"http://media.pcgamer.com/files/2011/07/TF2spyguide3.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/906236ca08f67bd8d553fa978c67fe85-970-80.jpg 970w\" /></a></p>\r\n\r\n<p>You can boost the cloak&#39;s duration by collecting ammo, so a good player will know where those dumps are before making any kind of move. Stay off to the side and check doorways before stepping through. Most people run a path of least resistance to where they want to be, so skulking in the shadows will mean you&#39;re unlikely to be nudged.</p>\r\n\r\n<p>The disguise kit is for when you want to get out of the shadows. It allows you to approach enemies and engineer nests without being instantly recognised, although it has its vulnerabilities. A Pyro will be able to light you up, and when you do attack it drops the disguise. Timing is critical when in the disguise: attack when you&#39;re part of a large push towards your own team, so people will be focussed on your team. Aim for Medics about to drop Ubercharges, then Heavies, Soldiers and Demos.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/07/TF2spyguide4.jpg\" href=\"http://media.pcgamer.com/files/2011/07/TF2spyguide4.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/dedec7b3d5dd4d4dff5ceb9c0ae48c49-970-80.jpg 970w\" /></a></p>\r\n\r\n<p>The third element of the vanilla Spy is the Sapper. This device is used to disable and ultimately destroy the enemy Engineer&#39;s buildings. Unlike the other weapons, dropping a Sapper while disguised won&#39;t drop the disguise. An Engineer can knock off the Sapper, but you can spam it by holding down the fire button. Running around the building as you do leaves the Engi in two minds: if he tries for the Sapper, you could stab him. If he goes for you, you might lose your life but he might lose his build. It&#39;s no good doing this in isolation, though. Ensuring you&#39;re backed up by Demos, Heavies and Soldiers pretty much guarantees destruction.</p>\r\n\r\n<p>Don&#39;t forget the Revolver: it&#39;s a valuable tool for sniping sapped buildings, and helping you escape when your disguise drops. It&#39;s a slow firing gun, but as long as you&#39;re accurate you&#39;ll be able to make most people think twice about pursuing you.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/07/TF2spyguide5.jpg\" href=\"http://media.pcgamer.com/files/2011/07/TF2spyguide5.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/f51846d00bacfc3e962ce0c36a5771cb-970-80.jpg 970w\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2 id=\"the-most-valuable-alternate-weapons-for-the-spy\">The most valuable alternate weapons for the Spy</h2>\r\n\r\n<aside data-render-type=\"fte\" data-skip=\"dealsy\" data-widget-type=\"seasonal\">&nbsp;</aside>\r\n\r\n<p>The Spy&#39;s greatest tool is his situational awareness. I&#39;d aim for the Cloak and Dagger to be your first unlock: it&#39;s a replacement for the watch that drains the cloak on movement, and replenishes it while standing still. It drains more quickly than the standard cloak, and you can&#39;t use ammo to replenish it.</p>\r\n\r\n<p>But if you&#39;re still you&#39;re invisible, so it lets you watch how fights play out. I use it to take stock of the enemy movement, watching out for their building placements, looking for any particularly insistent Spy checkers. Just watching where people tend to be, gives you a good idea of where you shouldn&#39;t be.</p>\r\n\r\n<h2 id=\"is-the-spy-bundle-worth-buying\">Is the Spy Bundle worth buying?</h2>\r\n\r\n<p>If you want a hat, the Fancy Fedora is worth owning at 49p but both The Ambassador and Dead Ringer are probably best left until you&#39;re more comfortable in the Spy&#39;s skin.</p>\r\n\r\n<p><a data-component-tracked=\"1\" data-url=\"http://media.pcgamer.com/files/2011/07/TF2spyguide1.jpg\" href=\"http://media.pcgamer.com/files/2011/07/TF2spyguide1.jpg/\" rel=\"nofollow\" target=\"_blank\"><img alt=\"\" data-normal=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" data-original-mos=\"https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec.jpg\" data-pin-media=\"https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec.jpg\" data-srcset=\"https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-970-80.jpg 970w\" data-was-processed=\"true\" sizes=\"(min-width: 1000px) 970px, calc(100vw - 40px)\" src=\"https://vanilla.futurecdn.net/pcgamer/media/img/missing-image.svg\" srcset=\"https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-320-80.jpg 320w, https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-650-80.jpg 650w, https://cdn.mos.cms.futurecdn.net/0fac344dac431d469f21c327695e8dec-970-80.jpg 970w\" /></a></p>\r\n\r\n<h2 id=\"how-to-help-a-spy\">How To Help a Spy</h2>\r\n\r\n<p>Don&#39;t stand anywhere near him. He&#39;s a vulnerable target, and I&#39;ve had a huge number of deaths occur thanks to people drawing fire into my cloaked body. Also, follow through on his sapping. Quite often if he&#39;s sapped an enemy Engi&#39;s equipment, he&#39;ll have died in the process from a wrench to the skull. Don&#39;t let his death be in vain.</p>\r\n\r\n<h2 id=\"how-to-fight-a-spy\">How to fight a Spy</h2>\r\n\r\n<p>Spychecking is a skill the Pyros are best suited to. Flame corners and protect ubercharging Medics &ndash; they&#39;re often the target.</p>', 1, NULL, 'Text Guide|Video Text', '2020-12-02 02:56:57', '2021-03-18 06:20:36', '2021-03-18 06:20:36'),
(29, 5, 2, 'Taking your Game to the next Level', 'taking-your-game-to-the-next-level', 'Learn how to take your League of Legends gameplay to the next level!', 'https://www.youtube.com/embed/0GhKEYNM5V0', '2020342644_game_guide_!ss.png', '!ss.png', 'png', '<p>In this League of Legends Game Guide, you will learn how to take your gameplay to the next level.</p>\r\n\r\n<p>This video features expert League of Legends expert &amp; GamesGuidz Coach:&nbsp;Ibriz Daya.</p>', 1, NULL, 'Video Guide|Coach Ibriz Daya', '2020-12-04 04:58:46', '2021-03-18 06:15:10', NULL);
INSERT INTO `game_guides` (`id`, `game_id`, `guide_type_id`, `title`, `slug`, `short_description`, `embed_video`, `image`, `original_image`, `mimes`, `description`, `status`, `video_notes`, `guide_tag`, `created_at`, `updated_at`, `deleted_at`) VALUES
(30, 5, 1, 'THE MOST IMPORTANT LEAGUE OF LEGENDS FUNDAMENTAL', 'the-most-important-league-of-legends-fundamental', 'The best methods to get your farming game up to par.', '', '138246206_game_guide_!ss.png', '!ss.png', 'png', '<p>Hey everyone</p>\r\n\r\n<p>Welcome to GamesGuidz, where we will be teaching you how to take your game to the next level.</p>\r\n\r\n<p>In today&rsquo;s League of Legends guide, we&rsquo;ll be exploring ways in which you can upgrade your last hitting skills all the way to the pro level.</p>\r\n\r\n<p>We&rsquo;ll show you how to take your last hitting from this (bad) To this (good)</p>\r\n\r\n<p>So, first things first. Professional players tend to use 10cs per minute as an indication of how their farming is going, and that is something to aim for, though it may not always be attainable.</p>\r\n\r\n<p>Let&rsquo;s go through the basics on how you can reach that level consistently.</p>\r\n\r\n<ol>\r\n	<li>\r\n	<p>1) &nbsp;Make it easy on yourself. This one feels like a bit of a cop out, but... pick Champions with easy last hit animations (show vlad/karthus as examples of not). I cannot stress how simple it is for me to last hit with melee characters when compared to ranged, and even then different attack speeds and projectile travel timings are all things to factor in. Find a champion that works for you, and don&rsquo;t be afraid to take an attack speed rune if you feel like you need it.</p>\r\n	</li>\r\n	<li>\r\n	<p>2) &nbsp;Don&rsquo;t be afraid to use abilities to hit minions but be aware that the enemy could punish your cooldowns or lack of mana. We&rsquo;ll go a bit more in depth on how to play around the enemy laner later on.</p>\r\n	</li>\r\n	<li>\r\n	<p>3) &nbsp;Pay attention to your minion auto attacks to make sure that they don&rsquo;t snipe last hits away from you. If two minions are dropping at a similar rate, you should chip away at one first to de-sync them and then you can have time to get both minions.</p>\r\n	</li>\r\n	<li>\r\n	<p>4) &nbsp;Last hitting under tower? General rule of thumb is tower shot - tower shot - auto for melee, and auto - tower shot - auto for ranged. This of course changes depending on your champion, but is a good way to approach things. Cannons are more difficult to get the hang of calculating but far more rewarding.</p>\r\n	</li>\r\n	<li>\r\n	<p>5) &nbsp;Don&rsquo;t worry if you miss one - it shouldn&rsquo;t throw you off of the next three.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>Once you nail the basics, practise last hitting in custom games or practise tool, first with an easy champion like Varus, then with Varus but no items, then with a different champion entirely and no items</p>\r\n\r\n<p>The REALLY advanced strategy though is to do all of this while also being under pressure from the enemy laner. Always keep on your toes for potential trades, all-ins, or other punishes, and try to have last hitting come to you as second nature - so you can focus on your opponent. Once</p>\r\n\r\n<p>you&rsquo;ve learned to just last hit minions subconsciously, you&rsquo;ll be able to trade more efficiently, buy more items to amp up said trades, and win more lanes and games.</p>\r\n\r\n<ol start=\"6\">\r\n	<li>\r\n	<p>6) &nbsp;Try to always position yourself in a way that you can hit minions and the enemy laners. Again, playing around an opponent and learning how to CS reliably can be a little bit of a daunting task at first, but once you get farming down to a subconscious level you can focus on ruining the enemy laner&rsquo;s day.</p>\r\n	</li>\r\n	<li>\r\n	<p>7) &nbsp;Don&rsquo;t be afraid to give up minions in order to conserve health or a better lane state. We&rsquo;ll explore lane states more in a future guide but basically.. Just try to stay out of kill range for your opponent. The more time you can spend alive and in lane, the more minions and gold you can generate. On that note...</p>\r\n	</li>\r\n	<li>\r\n	<p>8) &nbsp;Kills are nice but CS is guaranteed gold if you can nail it. Killing minions is so important that you should nail it before thinking about anything else.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p>We hope that you found this useful and that you&rsquo;ll be joining us for the next guide. Thank you!</p>', 1, NULL, 'Text Guide|Coach Ibriz Daya', '2020-12-04 05:18:55', '2021-03-18 06:15:58', NULL),
(31, 5, 1, 'Bard Guide', 'bard-guide', 'Improve your Bard gameplay with our simple guide!', '', '1300904466_game_guide_!ss.png', '!ss.png', 'png', '<p><b>Strategy</b></p>\r\n\r\n<ul>\r\n	<li>Collect as many magical chimes as you can, this will cause Bard&rsquo;s auto attack to further increase his poke damage against enemy laners.</li>\r\n	<li>Cast&nbsp;<b>(Q) Cosmic Binding&nbsp;</b>on enemy laners&nbsp;to root and stun them in place. You can also disable them if you cast&nbsp;<b>(Q) Cosmic Binding</b>&nbsp;on enemy champions near terrain or walls.</li>\r\n	<li>Place&nbsp;<b>(W) Caretaker&rsquo;s Shrine</b>&nbsp;in safe areas during the laning phase (i.e. near the allied turrets) to have fully charged heals.</li>\r\n	<li>You can set up ganks for your jungler from unique locations with&nbsp;<b>(E) Magical Journey</b>, as you can cast it on terrain that are not normally wared.</li>\r\n	<li>You can stun enemies by luring them into your&nbsp;<b>(E) Magical Journey</b>&nbsp;then hitting them with&nbsp;<b>(Q) Cosmic Binding</b>.</li>\r\n	<li>Cast&nbsp;<b>(R) Tempered Fate</b>&nbsp;to disable enemy champions and either position your team for a more advantageous team fight or to disengage and regroup.</li>\r\n	<li><b>(R) Tempered Fate</b>&nbsp;can be casted on enemy turrets &ndash; use this to tower dive on low-health enemy champions.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Core Items</b></p>\r\n\r\n<p><b>Eye of the Watchers</b>&nbsp;&ndash; A standard Sightstone upgrade for Ability Power-based Supports, Eye of the Watchers aids Bard by giving him bonus Ability Power, Mana Regeneration and ward placement capabilities.</p>\r\n\r\n<p><b>Redemption</b>&nbsp;&ndash; This item gives Bard another healing skill to help his teammates during clashes. Redemption also has decent boosts in health, cooldown reduction and mana regeneration.</p>\r\n\r\n<p><b>Ardent Censer</b>&nbsp;&ndash; A great synergy item for Redemption and Bard&rsquo;s&nbsp;<b>(W) Caretaker&rsquo;s Shrine</b>, Ardent Censer gives bonus attack speed to allied champions who were healed or shielded by Bard. This proves useful during clashes where Bard can heal either a single teammate or his whole team and give them all bonus attack speed.</p>', 1, NULL, 'Text Guide', '2020-12-08 15:02:07', '2022-04-30 04:20:00', NULL),
(32, 3, 2, 'Walking Guide', 'walking-guide', 'Learn how to use silent walking in CSGO!', 'https://www.youtube.com/embed/TVvDpC4lMf0', '910938234_game_guide_!ss.png', '!ss.png', 'png', '<p>In this CSGO Esports Guide, you will learn how to effectively walk &amp; crouch walk to improve aim and movement.</p>\r\n\r\n<p>This video features expert CSGO player &amp; EsportsGuides Coach:&nbsp;Simsimsom.</p>', 1, NULL, 'Video Guide|Coach Simsimsom', '2021-01-07 15:12:33', '2022-04-30 04:19:51', NULL),
(33, 3, 2, 'Right Hand Peak', 'right-hand-peak', 'Learn how to Right Hand Peak in CSGO!', 'https://www.youtube.com/embed/iv4tRbH3hVE', '660636528_game_guide_!ss.png', '!ss.png', 'png', '<p>In this CSGO Esports Guide, you will learn how to effectively right hand peak!</p>\r\n\r\n<p>This video features expert CSGO player &amp; EsportsGuides&nbsp;Coach:&nbsp;Simsimsom.</p>', 1, NULL, 'Video Guide|Coach Simsimsom', '2021-01-07 15:13:29', '2022-04-30 04:19:35', NULL),
