(87, 35, 2, 5, 'Hi Harsh! There are some new exciting locations for you to checkout in-game with new the Season. Including: The Volcano, Sunny Steps and Lazy Lagoon.', 1, '2021-03-22 04:09:24', '2023-01-04 07:11:57', NULL),
(88, 36, 2, 16, 'Hallå! Att spela på mobil är svårare på grund av mindre precision och mindre skärmar. Det enklaste sättet att komma igång, hoppa in i Battle Royale och träna dödar. Titta på våra Fortnite-guider för mer hjälp!', 1, '2021-03-22 04:11:15', '2022-10-25 07:16:46', NULL),
(89, 37, 2, 6, 'Sup man! You need to learn how to Shoot and Aim first of all, stick to a single map when playing and getting started to familiarise yourself with popular hiding spots and good shooting poits. You can use this to your advantage and get better at the game.', 1, '2021-03-22 04:12:38', '2023-01-04 03:38:27', NULL),
(90, 37, 2, 6, 'I have loads of cod guides, check them out as you might find them helpful :)', 1, '2021-03-22 04:12:55', '2023-01-04 03:38:27', NULL),
(91, 38, 2, 18, 'Hello! :) Of course! What do you need help with exactly? Have you checked out our VALORANT video guide series?', 1, '2021-03-22 04:14:04', '2022-10-25 07:17:37', NULL),
(92, 41, 2, 8, 'Hey again! Great to hear back from you. It\'s best to master and focus on one position and one lane, top lane is a good lane to get started.', 1, '2021-03-22 04:15:42', '2022-06-22 07:34:42', NULL),
(93, 42, 2, 15, 'Thanks so much Harsh! <3', 1, '2021-03-22 04:16:28', '2022-10-25 07:17:15', NULL),
